List<Map> songs = [
{'title' : 'PAA, DE, GISIK NAMGIPAKO',
'song' : "Paa De, Gisik Namgipako, \nNamgnirangko on-gipako, \nMande aro sa-grerangba, \nMiteltokchina darangba.", 'songNumber' : 1},
{'title' : 'RE-BABO, GITEL, CHINGONA',
'song' : "1. Re-babo, Gitel, chingona, \nPatibo chingni tom-ana; \nChingni Gitel, re-bapabo, \nChingni pamong Na-a ong-bo. \n\n2. Darangnin papko wattokbo, \nNamgnirangko patipabo; \nChing' bi-ako chu-sokatbo, \nMol-molako knatimpabo. \n\n3. On-bo Gisik Rongtalako, \nTom-tomatbo ching' gisikko; \nNang-ko chinga olakina, \nBilko on-bo, Gitel, chingna.", 'songNumber' : 2},
{'title' : 'TUNASIO BI-A',
'song' : "Tunasio olakina, \nGitel, angko jokatbo; \nMikrakkujaon siangode, \nSalgiona rimangbo.", 'songNumber' : 3},
{'title' : 'TANGO NAMCHONGMOTABA',
'song' : "Tango namchongmotaba, \nIsol\' olakiosa; \nSinasian\' saloba; \nGisik Nama unosa, \nAtchiramasachiba \nJisu baksa dongmangen; \nSalgi\'na sokangoba, \nIsol biap on-sogen.", 'songNumber' : 4},
{'title' : 'APA ISOLNI KA-SARA',
'song' : "Apa Isolni ka-sara \nJisun\' ka-sara baksa, \nGisik Nama, ka-sa' tom-tom, \nPangnan gapchong ang\' gisik.", 'songNumber' : 5},
{'title' : 'NAMCHONG KARIMGIPA',
'song' : "1. Namchong Karimgipa, \nOng ate gisiksan; \nChing\' Kristian ka sao bakrima, \nSalgisakni gitan. \n\n2. Apa, ching\' gisiksan \nBi-a patiarang\'; \nKa-dong,\' katchaa, miksonga\'san, \nChing\' kena simbrarang. \n\n3. Duko duk man-rima, \nChing\' balko chilrima; \nAro saksa sakgipinna \nMikchi ong-chakronga. \n\n4. Ching\' Nang-on watgrikna, \nKa-bea ka-tongo; \nIndiba apsan ka-donga, \nGronggriktaigen changsao.", 'songNumber' : 6},
{'title' : 'ISOL NANG MUNG DONGCHONG',
'song' : "1. Grongjaskal Isol nang mung dongchong, \nUni skiachi dilchina, \nUn\' mes nolo rakichina, \nGrongjaskal Isol nang-mung dongchong. \n\n(Ring-taitaiani) \nGrongjaskal, grongjaskal, \nJisun\' ja-o grongjaskal; \nGrongjaskal, grongjaskal, \nGrongjaskal Isol nang-mung dongchong. \n\n2. Grongjaskal Isol nang-mung dongchong, \nUn\' grang\' ning-o donnuchina, \nSalni sal cha-na on-china, \nGrongjaskal Isol nang-mung dongchong. \n\n3. Grongjaskal Isol nang-mung dongchong, \nDukrang nang-ko jajaaton, \nNang ko gipake jokatchong, \nGrongjaskal Isol nang-mung dongchong. \n\n4. Grongjaskal Isol nang-mung dongchong, \nNang-na pangnan ka-sachina, \nSian salo chelchakchina, \nGrongjaskal Isol nang-mung dongchong", 'songNumber' : 7},
{'title' : 'ON-BO ATAM\'PATIANIKO',
'song' : "1. On-bo atam\' patianiko, \nJokatgipa, skang tuna; \nChinga ku-rachaka papko, \nAma Na-a jokatna. \n\n2. Re-duulo\' chingko gimaan\', Brarang batsotangoba; \nDuulenga Nang ni sa-grean, \nJoka Nang\' sepang\' chinga. \n\n3. Wal andal\' ka-sinbeoba, \nAmja donnuna Nang-na; \nNeng nikja Na-a pangnaba, \nMandetangko nitimna. \n\nSrapode rang-gitik sia\' \nTuram ching\' gopram ong-o; \nGane ching-ako, gri\' sia\' \nDe mesagen salgio.", 'songNumber' : 8},
{'title' : 'PRINGO RING-ANI',
'song' : "Walgimiko rakiaha, \nGitel angko jokataha, \nWalni p'lak bobiloniko \nJokattokjok Na-a angko. \n\nDa-o ia pring' seng-ao \nGitel anga bi-a Nang-o, \nSalgimiko Nang mikkango \nRakipabo, Gitel, angko. \n\nAnga papi, gisik bilgri, \nRe-na anga kana, mikgri, \nNang ni Rongtalgipa Gisik \nAngko dilchong ka-sindikdik. \n\nAngni pilak kam ka-arang, \nOng-chong Nang-ni mikchaa' u'rang. \nSalni p'lak bobiloniko \nJokatpabo Na-a angko. \n\nla salni seng-a gita, \nAng' Ka-tong ong-chong u'gita; \nDuk aro ruraarang'niko \nRakipabo salgimiko.", 'songNumber' : 9},
{'title' : 'RONGTALA, RONGTALA, ISOL BILAKBEGIPA',
'song' : "1. Rongtala, rongtala, Isol b'laksranggipa; \nPringo ching, mitelan ring-a Nang-ona sokchong, \nRongtala, rongtala, ka-saa b'laksranggipa; \nSaksano Gitam patia nangrima. nede \n\n2. Rongtala, rongtala, kakketrang tubama; \nSonan mukut' okgale grikan' chi dultoke; \nKirubrang, seraprang Nang'na sko' choknoka \nDongchenga, donga aro dongkamgen. \n\n3. Rongtala, rongtala, andala dongpenga; \nPapi mande mikronchi Nang ko nikjaoba, \nNa-asan rongtala, darang gipinde gri, \nChugimik bilan ka-saao simtek gri. \n\n4. Rongtala, rongtala, Gitel Isol b'laka; \nSagal, a-sak, salgi p'lak Nang' kamko mitelgen; \nRongtala, rongtala, ka-saa b'laksranggipa, \nSaksano Gitam patia nangrima.", 'songNumber' : 10},
{'title' : 'SENG ANI PAA',
'song' : "Seng-ani Paa, dingtang ong gijagipa, \nP'lakna patina jaksrambegipa, \nNang' rongtala mikkangko chinga am-a, \nGisik an-saoe Nang-ko mitela. \n\nNangrimatgipa toromo ching' katchaa, \nNang-o dongrime olakirima; \nSeng-a Na-a, Salgioni on-ata, \nKristo Seng-an, ka-sara Degipa. \n\nPagipako parakatgipa Seng-a, \nNang' ka-saako ching' ka-tong'o ru'bo, \nUn' katchaako uina ka-pakengkua, \nNang' Songnokko chingon mangrakatbo. \n\nJisu Kristo, ching Nang-na bamsranga, \nNang' Katako pilakchin gipatna; \nKristooni jekai ka-saako man-baa, \nSakgipinrangnaba ka-saskana.", 'songNumber' : 11},
{'title' : 'ATAMNI BI-A',
'song' : "1. Sal napa walaha, \nPilakon andaljok, \nSepangjok sina ugitan, \nChipchapan walginok. \n\n2. Maikai ba-ra' dona, \nTusio manderang, \nGimagen sian' salode, \nManderangni gamrang. \n\n3. O Gitel, jokatbo, \nKenaoni, walona; \nNang-ni nokol dongtimchina \nSeng-kuja dipetna. \n\n4. Chakatode pringni, \nNiksoemung salko, \nRe-pana torom' ramako, \nOn-bo chingna bilko. \n\n5. Jensalo sianggen, \nWate a-gilsakko, \nRimange Salgin' kosak'na, \nNeng-takatbo chingko.", 'songNumber' : 12},
{'title' : 'TUSIENGO DONGTIMPABO', 
'song' : "1. Gitel Jisu ka-sagipa \nWalo angko jokatbo; \nTusiengo dongtimpabo, \nKenarangko chel-atbo. \n\n2. Salo angko jokataha, \nNa-a ka-sapaenba. \nCha-na ringna on-tokaha, \nGitel ka-sabegipa. \n\n3. Namgija kamko watsrange \nAng' bakrangna ka-sabo; \nJensalo anga sianggen \nSalgichina rimangbo.", 'songNumber' : 13},
{'title' : 'ATAMO RING ANI',
'song' : "1. Sal gimiko rakiaha, \nGitel angko jokataha; \nAngni dakna nanga kamko \nDakchakaha Na-a uko. \n\n2. Da-o ia atam walo. \nGitel, anga bi-a Nang-o; \nMikrakachi Nang ko ring-na \nBilko on-bo, Gitel, Na-a. \n\n3. la walni wala gita, \nSiani sal ua gita; \nSibo, tangbo, jeba ong-bo \nGitel angko tom-tom donbo.", 'songNumber' : 14},
{'title' : 'DA O SAL RE-ANGJOK',
'song' : "1. Da-o sal re-angjok, \nWal sepangenga; \nWalni andalsisi \n'Sako gipenga. \n\n2. Jisu neng-gipana \nOn-bo neng-takna; \nPatiako man-e \nAn-ching mikchipna. \n\n3. Sagipa pilakko, \nKa-dimeatbo; \nPaponi papiko \nRakipakubo. \n\n4. Walgimikni ruut'o, \nNang-ni sa-grerang \nDonge ang' kosako \nNitimchong u mang. \n\n5. Pringo mikraktaion, \nNang-ni nikao \nRongtalenba, unon \nChakatna on-bo.", 'songNumber' : 15},
{'title' : 'ATAMO BI-ANI',
'song' : "1. Gitel ching' Nokgipa, \nChing' papko watgipa; \nGitel, Nang-ni nokol saksa \nDakbo bil man-gipa. \n\n2. Chinga salgimiko, \nJoka Nang' nitimao; \nIa atam walo chinga \nBi-taienga Nang-o. \n\n3. Gitel, ka-sagipa, \nApa, ching' Nokgipa, \nla walgimiko chingko \nChelchakbo Na-asa. \n\n4. Pringo bi-taina 'ne, \nNang-o kam ka-taina, \nOn-bo, Gitel, chingna bilko, \nSal sal miteljringna.", 'songNumber' : 16},
{'title' : 'SAL NAPNASIENGAHA',
'song' : "1. Sal napnasiengaha; \nP'lak' neng taknasiaha; \nAskirang ching-baengon, \nOlakibo walangon, \nChing' Isolkon. \n\n(Ring-taitaiani.) \nRongtala, Rongtala, \nP'lakni Gitel, \nSalgi Nang-ko paraka; \nA-a Nang-ko mitela, \nSakni Gitel. \n\n2. P'lak janggini Pagipa, \nA-ako ong-atchenggipa, \nNang' mikkangko ching' am-a, \nNang' baksa nangrimna ska, \nSepang Na-an. \n\n3. Andalbanasiengo, \nKa-sagipa, patibo; \nAskirangko badeon, \nNang ko chingni ka-tongon \nMitelbea. \n\n4. Chingni nikanioni, \nNapangon askirangni, \nO salgin' Gitel, chingna \nSeng-baa' naatbo jringjrotna \nWal' chel-atbo.", 'songNumber' : 17},
{'title' : 'IA SAL, O ISOL, BON-ANGJOK',
'song' : "1. Ia sal, O Isol, bon-angjok, \nDa-o wal andalbaaha; \nDa-sipringo Nang-ko miteljok, \nTusina skang mitelkua. \n\n2. A-a re-wilwilangrongengon, \nNang-ni Mondoli tusija; \nUa a-sakon nitimjringa \nSalang walang neng-takgija. \n\n3. A-gilsako pilakon a-songrang, \nSeng-ako salni sal man-baa; \nIsolo p'lakchin bi-anirang, \nDondikja mitelarangba. \n\n4. Gitel, a-sak' songnokrang gita, \nNang-ni Songnokan bon-angja; \nP'lakan Nang-na bamkujana, \nRaja ong-e Na'a dongkama.", 'songNumber' : 18},
{'title' : 'JOKGIPARANGNI AN-SENGA', 
'song' : "1. Ganding chinding taria, \nla ma-danga sawa? \nWalang salang matchotja \nKu-rang sale ring-esa; \nPapina sichakgipa \n'Songnok' man-na nitoa; \nUko de-a mingakon; \nKnatokchina pilakan. \n\n2. Baoni ia manderang? \nPapichime iamang; \nDukko man-bejok namen; \nJringjrot da ode an-senggen; \nStarima nangarangko \nJisu'n talatsrangtokjok; \nJakpako doktopaton \nAmjok darang bobilkon. \n\n3.Saa ding-aba dongjajok; \nOkkri cha-a sijajok; \nSal rakaba dongjajok; \nBal' mikkana kenjajok; \nJisuan niriktimgen; \nChijanggiko mesokgen; \nMikron mikchi ong-ako \nU-sitgen Isol uko.", 'songNumber' : 19},
{'title' : 'ISOLNI DAL-A',
'song' : "1. Chasongni chasongna Isol rakia, \nA-'na, china skangba, Na-an dongenga \nSa aganna amgen Nang-ni Gisikko? \nChanchibewaloba man-ja uako. \n\n2. Hajal, hajal bilsi dikdiksani pal, \nIndake donga Nang-nade ua sal; \nChingni janggide jumang gita donga, \nSalni sal indakesa janggi chon-a. \n\n3. Balwao bolni bi-jak maikai ga-aka, \nNang-ni ka-onango manderang sia; \nNang-ni ka-sanasa donga sigija, \nNang na agre chingade jokna man-ja. \n\n4. Nang ni a-jak soko maidake jokgen? \nBaona katemu, chinga bao dongnugen? \nGrang, chae Songdu, sagalchina biloba \nNang'jakon ga-akgen chinga \n\n5. Pilakkon chon-e Na-an uitoka, \nNang' mikkango gri mamungba dongnua, \nSa aganna amgen Nang-ni Gisikko? \nChanchibewaloba man-ja uako.", 'songNumber' : 20},
{'title' : 'PATIGIPANA KA-SAA',
'song' : "1. Ma-maanti Patigipako, \nImo olakitokna; \nPangnan Uko mitelemu, \nKa-srokbee ring-tokna. \n\n(Ring-taitaiani.) \nAnga Unan ka-sabegen, \nOe nanggo, mitelchong; \nAngko Jokatgipa Uan, \nJisu ka-sabegipa. \n\n2. Rama brangangmitingengo, \nAngko am-a Jisusa, \nJanggi gimaginokchime, \nUni an-chi on-esa. \n\n3. Salni salan Un' ka-saako, \nMan-e grosa dakengjok, \nAngko ka-sae jokatpabo, \nJanggi, gisik nang-nijok. \n\n4. Ka-sagipa Gitelkosa \nAnga maina watmane? \nO Gitel, angna ka-sabo, \nNamgijako watsrange.", 'songNumber' : 21},
  {'title' : 'DA-O GAME INCHROBO',
  'song' : "1. Inchro, Inchro, na-a da-o, \nA gimikan katcha' da-o, \nGitel chejok rasong chae, \nSason ka-nok Uan chee. \n\n2. Rong-do-gachi peng-gramaijok, \nNeng-gramari nitimaijok; \nGopramoni mikkim baksa, \nKristo sokba rasongosa. \n\n3. P'lak Un' chaka, P'lak Un' kaman, \nOn-a chingna rengsi man-pan'; \nKa-dong, ka-srok, tom-tom nagen. \nKristo chejok, mande chegen. \n\n4. Dakgrikchakbo, O Chegipa, \nSiaoni seng-aona; \nNang ni ja kol jokan' bichol, \nSie Nang-o, sokna Isol.", 'songNumber' : 22},
  {'title' : 'BILAKGIPA ISOL',
  'song' : "1. Bilakgipa Isol, \nChingna dakchakebo \nMitelpana \nPilakkon Amgipa, \nRasongarigipa, \nDakbo, ching' Nokgipa, \nTangbegipa. \n\n2. Kee tonualko, \nKnabo ching' bi-ako, \nBe-en Pil-gipa, \nPatibo rongtalna, \nNang-ni manderangna; \nKatako chu-sokna, \nOng-onbae. \n\n3. Ka-dimeatgipa, \nChong-mot Sakigipa, \nPatitokbo; \nSakantin ka-tongo \nNa-a pamong ong-bo, \nPangnan da-wat chingko, \nRe-dilgipa. \n\n4. Saksano Gitamna, \nPangnan mitelchina, \nChubatao, \nUn' nitoa Songnok', \nRasongko nikenok; \nNamen ka-sabenok, \nPangnajolna.", 'songNumber' : 23},
  {'title' : 'A-GILSAKNI PILAK MANDE',
  'song' : "1. A-gilsakni pilak mandel \nIsolko katchae mitelbo; \nBamtokbo Una, ka-sroke, \nUn' mikkangona re-babo. \n\n2. Gitel Isol ong-chongmota, \nDakchaka gri chingko daka; \nAn-ching Uni jak ong-enga, \nUa an-chingko aldua. \n\n3. Un' noko mitele napbo, \nUn' sarao kusi ong-bo; \nUn' bimungko miteltokbo, \nIndake dakna kraa uno. \n\n4. Maina an-ching' Isol nama, \nPangnan Ua ka-sachaka; \nUni beben kim-kim donga \nAro jringjrotna dongkama. \n\n5. Pa, De, Gisik Namgipana, \nJeko salgi, a-a de-a, \nMande aro sa-grerangba \nJringjrotna miteltokchina.", 'songNumber' : 24},
  {'title' : 'RAJANA BAMBO',
  'song' : "1. Rajana bambo, p'lakni kosako; \nUn' bilko ring-bo aro ka-saako, \nP'lakko Rakkigipa an-chingni Danil; \nRasongo donggipa, de-a man-gipa. \n\n2. Un' bilko nibo, Un' ka-sachaka, \nDonga bangbango, seng-ako gana; \nUni ka-onanga kimpretarango, \nAndala Un' re-a balwan' grangrango. \n\n3. Nang' jaksramako agangen sawa? \nGnang rang-sitao, teng-suao nika, \nA-brioni joka a-kaweona, \nMikka'o ong-kata, ripamchioba. \n\n4. A-ani dedrang, bilgrigiparang, \nNang-o ka-donga, ka-donggramaija; \nNang' ka-sachakarang maidake kim-kim \nAn-chingko Dakgipa, Nokgipa, Ripeng", 'songNumber' : 25},
  {'title' : 'ISOL PAGITCHAMRANGNI',
  'song' :"1. B'laksranggipa Isol pagitcham'ni, \nName dilgipa salgin' kotok'ni, \n'Sakko seng-ata sal, ja, askirang; \nDe-a Nang-na ching' mitelan ku-rang. \n\n2. Nang' ka-saan chasongna dilbaaha, \nIa' songnan chingko sesoaha; \nNa-an ching' raja, pangchak' dilgipaba \nNang-ni katan' niam, ching' ramaba. \n\n3. Dakgrika ji-jaon, sabisi sokbaon, \nChakna kate nang ka-bak kurion; \nJelbatchong chingo nang' bebe torom, \nNang namao tangangkuna tom-tom.", 'songNumber' : 26,},
  {'title' : 'BI-ANI SAL, NITOA SALO',
  'song' : "1. Bi-ani sal, nitoa sal, \nNeng-takata angko un' sal; \nUn' sepangona rimange, \nAm-ako on-na agane; \nDuk, sakna, jajrengarango, \nKa-dimea anga nang-o, \nJoka ruraan' ja-gaoni, \nSokpilon \"Bi-an' sal\" nang-ni. \n\n2. Bi-ani sal, nitoa sal, \nRa-angbo ang' bi-a da-al; \nKakketgipa ang' Gitelna, \nPatigipa am-gipana; \nGe-eta an-tangko am-na, \nKa-donge bebera-china; \nGalgen jajrengarang unan, \nSenggen \"Bi-ani sal\" nang-nan. \n\n3. O, namgipa sal \"Bi-ani\" \nOn-pabo ka-dimeani; \nPisgah a-chuo niwate, \nRe-kuja'na nang-ko wate; \nGale be-enni gandingko, \nRa-e jringjrot ang' man-gniko; \nInwatangna nang-na un' sal, \nRe-naha nama \"Bi-an' sal.\".", 'songNumber' : 27},
  {'title' : 'O ISOL CHING\' PANGCHAKBAANI\'',
  'song' : "1. O Isol, ching' pangchakbaani, \nChasong chasongoni; \nBalmikkao ching' Katnapani, \nAro Nok Jringjrotni. \n\n2. A-bri a-chu ba a-sakni, \nBimang ong na skangan, \nIsol Na-an jringjrotoni, \nJringjrotnaba apsan. \n\n3. Nang' nikao hajal chasongrang, \nAtamsasik gita, \nBatanga sal nana skang skang, \nWalni prohor gita. \n\n4. Sal karirang chotchanggija, \nRimangjok dedrangko; \nU'mangni tanga jumangsa, \nGuala wal seng-o. \n\n5. O Isol, ching' pangchakbaani, \nChasong chasongoni; \nSijaskal ching' Na'an Dilani, \nAro Nok Jringjrotni.", 'songNumber' : 28},
  {'title' : 'JISU NAMSRANGGIPA',
  'song' : "1. Jisu namsranggipa, \nPilaknin Raja ong-a, \nIsolnimung De Mandenin; \nAng Una ka-saa, \nUko mandera-a, \nKatchaan', rasong Ua angnin. \n\n2. A-kawe abrirang, \nBalenggipa bibalrang, \nBeben, nitosrangbeoba, \nJisu'n nitobat, \nJisu'n rongtalbat, \nAng' ka-tongko katchaata. \n\n3. Salni teng-suana, \nJarambong ja teng-ana, \nChing-chetchet askirangnaba, \nJisuan teng-bata! \nSa-grerangnaba, \nJisu teng-subatsranggipa. \n\n4. P'lak nitoarangni, \nA-gilsakmung sakoni, \nJisu, Nang-o dongchongmota, \nKa-sabatgipa, \nNambatgipa gri, \nNa-a janggin' Jokatgipa. \n\n5. Jokatgipa Na-an, \nP'lak jatrangni Nokgipa; \nMandeni De Isolnimung, \nRasong on-china, \nNang ko mitelchong, \nJringjrotna kingking ong-jringchong.", 'songNumber' : 29},
  {'title' : 'ISOLKO MITELTOKNA HAI!',
  'song' : "1. Isolko miteltokna hai! \nTorom noko! \nJisuna rasong on-na hai! \nTorom noko! \nMe-apa, me-chikmarangba, \nPante, me tra, bi-sarangba, \nSko choknoke olakina, \nTorom noko! \n\n2. Isol donga dal-niktokna, \nTorom noko! \nMandera-e napna nanga, \nTorom noko! \nPa, De, Gisik Namgipana \nRasong on-na an-ching Una, \nKu-rang apsan de-mitelna, \nTorom noko! \n\n3. Ring-achiba mandera-na, \nDe Jisuko. \nKena ginang gisiktangchi, \nTorom noko. \nBi-achiba mol-molpana, \nDe Jisuko. \nMika nia ja-ku ga-achi, \nRasong on-na bewalrangchi, \nKena ginang gisiktangchi, \nTorom noko. \n\n4. Paa Isolko grongram biap, \nTorom noko. \nNangarangko bi-ram biap, \nTorom noko. \nGitel Jisu iako ina, \nPilak jatnin bi-ram ong-a, \nAn-ching kragija dakjana, \nTorom noko. ", 'songNumber' : 30},
  {'title' : 'PATIAN\' MIKKA WADAPGEN',
  'song' : "1. Patian' mikka wadapgen; \nIan ka-san' ku-rachaka; \nKarirang' gital pil-atgen, \nSakoni' watatgipa. \n\n(Ring-taitaiani.) \nJimbee patia, \nJimbeakosa nanga, \nGa-akenga toktakrangsa, \nChing' bi-a jimakosa. \n\n2. Patian' mikka wadapgen, \nGamchate tangchaatgipa; \nBri a-we gipangpilsranggen \nJimgipa mikkan' gam-a. \n\n3. Patian' mikka wadapgen, \nWatatbo Gitel chingna; \nOn-bo maikai gital ong-na \nChu-sokatbo Nang' kata. \n\n4. Patian' mikka wadapgen! \nWagenode da-alan; \nIsolna gita ku-chakgen, \nOkam' Jisuo gitan.", 'songNumber' : 31},
  {'title' : 'ANGA DONGKUENGA NANG-ON',
  'song' : "1. Seng-banasion gitchakmrang aramrang, \nWalni jagringmu katpilangengon, \nSeng-baon Pringprangni dimelangengon \nIsol, anga dongkuenga Nang-on. \n\n2. Mitino bi-e, Isolmung dongnuon, \nUni tom-tomgipa gronggrikramo, \nUno Uko rongtale olakia, \nPringni an-saogipa dongnuramo. \n\n3. Neng-bemane, anga tunasiengo, \nMikchipnasio ang' Nang-o bi-on, \nNeng-takatbo, Nang' grang ning-o ganggope, \nSepangpiti, Isol, pring' mikrakon. \n\n4. Siani salni seng-bao mikrakon, \nA-sakni jagringrang katpiltokgen, \nUa seng-baon katchabata sal naon, \nIsol, Nang mung jringjrot' tangpilkugen.", 'songNumber' : 32},
  {'title' : 'SENG JOKAI CHAKATBO',
  'song' : "1. Darangan nipabo, \nSeng jokai, chakatbo, \nJisun' re-bao an-sengjok, nipabo ...(x2) \n\n2. Kristoni re-baesa \nKanarang niktoka, \nA-gilsakni manderang katchatoka... (x2) \n\n3. A-songni miteba, \nUijae kritaba, \nUn' ku-bibanisa gimatokaha...(x2) \n\n4. Siani jagringo, \nSongdonge songtango, \nNika uama-dangba teng-suako...(x2) \n\n5. Kristoni re-baako \nDarangan knapabo, \nGisikchi chanchie darangan nibo...(x2)", 'songNumber' : 33},
  {'title' : 'SAL NAMA NENG-TAKAKO',
  'song' : "1. {Sal nama neng-takako, \nDarangba manitokchong; \nWate gama suako, \nIsolko olakichong.} x2 \n\n2. {Toromirang darangan, \nDamsano tom-dakemung; \nKa-dimea pilakan, \nGisiko an-sengemung.} x2 \n\n3. {On-a Isol neng-takna, \nOn-aha darangnaba; \nPilak gitel, nokolna, \nDingtang ong-ja darangba.} x2 \n\n4. {Bimung minge Jisukon, \nDarangan mitelchina; \nA-songanti darangon \nJanggi tanga dipetna.} x2", 'songNumber' : 34},
  {'title' : 'SAL DOKNI KAMRANG BON-JOKAI.',
  'song' : "1. Sal dokni kamrang bon-jokai, \nNeng-takan' salba sokjokai, \nO Gisik, Isolni salo \nKa-dime, mitelbo Uko. \n\n2. Cha-chatni simila gita, \nAn-ching mitelna u'gita, \nUko knae Ka-sagipa, \nNamnikpagen an-chingkoba. \n\n3. Gitel marangko wataha, \nUko knae ka-dongaha, \nKa-sagipako mitelgen; \nChanchia anga jokpagen. \n\n4. Torom mande naman' salo, \nNeng-taka uamang uno, \nIndake salni sal napna; \nJa-mano man a neng-takna.", 'songNumber' : 35},
  {'title' : 'SAL NENG-TAKAN\' CHIN GITA',
  'song' : "1. Nambea Gitelni \n Sal neng-takan', \nChin gita salgini, \nOn-jok Uan. \nMitele Uakon, \nManigen ua salkon; \nSkigen namarangkon, \nGilja noko. \n\n2. Skigiparang baksa \nSkulo tom-gen. \nSastroni katakon \nGisik ra-gen, \nTorom procharokrang, \nJeko angna uamang \nMesoke skiata, \nUkon ra-gen. \n\n3. Je songo sa-grerang \nGit ring-toka, \nJeo toromirang \nAn-sengtoka, \nO Gitel, Namgipa, \nBiap on bo angnaba, \nSalgichi ring-pana \nRimbo angko.", 'songNumber' : 36,},
  {'title' : 'AN-SENGE ANTI SAKO',
  'song' : "1. An-senge anti sako, \nDilbataijok an-chingko; \nHai bi-na da-o Un' noko, \nIsolni patiako. \n(Nambat' salarin' salna \nChin neng-takan' jringjrotna.) x2 \n\n2. Jokatgipan' bimungo, \nNangrimgrike bi-engo, \nChing' pap, kratchaa ra-angbo, \nA-sak, simbra' chel-atbo. \n(On-bo neng-takna Nang-o, \nChingko ia Nang-ni salo.) x2 \n\n3. Nang' bimungko mitelna, \nNang' dongpaako uina, \nNang rasongko nikpana, \nOn-bo Nang' noko chingna \n(On-bo Gitel cha-totna, \nNang' alako jringjrotna.) x2 \n\n4. Jangat' Nama Katako, \nPapi, toromirangna, \nChea, ka-dimeako, \nChel-at pilak sintea. \n(Indake Gitelni sal \nMesokchong salgin' suk sal.) x2", 'songNumber' : 37},
  {'title' : 'O SAL NENG TAK KATCHAANI',
  'song' : "1. O Sal Neng-tak' katchaani \nO Sal ka-srokbean', \nDuk simbra'rang gimaani, \nNambat' ching-bat' Na-an; \nNokma, nokol ring-baaha, \nChasongrangna Nang-on, \n'Ne Rongtala, Rongtala \nSakgitam Saksanon. \n\n2. Nang-on, a ako dakchengao, \nSeng-a ong-chengaha; \nNang-on jokatna chingko, \nKristo chakataha; \nNang-on, Gitel Gisikko \nWatonatchengaha; \nNang-on, on a seng ako, \nChu-soktoksrangaha. \n\n3. Da al neng-gipa jatrang, \nMan-a salgin' manna; \nBakrimna toromirang, \nRupan' singga' sika; \nJeo Nama Katan' seng-a \nTeng-sue gipenga, \nJringjrotni chimik joka \nAldue janggina. \n\n4. Gital, gital patian' naa \nIa Neng-takan' Sal'ni, \nChing' nangarangko man-a \nOn-gimin gisikchi. \nRongtalgipa Gisikna, \nMitelna Paa, Dena; \nMondoliba ring-china \nSaksanon' Gitamna.", 'songNumber' : 38},
  {'title' : 'MITELBO GITELKO',
  'song' : "1. Rasong ching Isolna Un' p'lak kamrangna, \nMingnama gamrangko, Un' patianina; \nKangja Detangkoba, an-ching paprangna, \nOjok janggin' do-ga p'laknan napchina. \n\n(Ring-taitaiani.) \nMitelbo Gitelko a sak gam-chakchina, \nMitelbo, Gitelko jatrang katchachina; \nRe-ba Gitelona Uko mitelna \nOn-bo rasong Una. Un' p'lak kamrangna. \n\n2. Re-ba Un' nokona, Katchae mitelna \nSakanti ka-sroke dangdike on-na; \nRongtalna dakrang'ni, Jisun' an-chio, \nBrejok janggitangkon on-e chisolo. \n\n3. Amsokja aganna, Un' dal-a kamrang, \nNiksokja katchaako manden' ka-tongo; \nNambata, Rongtala, patianiko, \nImbo hai ra-chakna Gitel Jisuko.", 'songNumber' : 45},
  {'title' : 'MITELBO ISOLKO ASAK SALGIN\' RAJAKO',
  'song' : "1. Mitelbo Isolko a-sak salgini Rajako, \nMitel' O ang' janggi, nang' tangan' jokataniko \nHai re-babo jongada, noabirang, \nKa-sroke mitelna Uko. \n\n2. Mitelbo Isolko, p'lakkon sason ka-enggipako, \nGrangtango ganggope raki-simsakenggipako; \nUa skatang on-a jeko chu-onga, \nNiroke nang nangarangko. \n\n3. Mitelbo Gitelko Uan nang-ko silroroata, \nSalni sal ja-rike Un' nang' nama ka-sachaka; \nB'laksranggipa nang na maiko dakjawa, \nNang' ripeng ka-sabegipa. \n\n4. Mitelbo Gitelko, O janggi, Uko mitelbo \nRang-sitgipa p'lakan hai tubambo Un' mikkango; \nO manderang, intokbo Amen! Amen! \nKatchae Uko olakibo.", 'songNumber' : 46},
  {'title' : 'O HAJAL KU-SIKRANG RING-CHONG',
  'song' : "1. O, hajal ku-sikrang ring-chong \nPiokgipan gitko \nRaja Isolní rasongko, \nUn' ka-saan' cheako. \n\n2. Ang' Nokgipa Isol angni, \nParakna dakchakbo; \nGipatna a an' p'lak bakrango. \nUn' bimung rasongko. \n\n3. Jisu, Nang' bimung katchaata, \nChing' duk jajrengako \nTom-tom janggi an-sengata, \nKu-rang papi' knabo. \n\n4. Papni bilko Ua pe-jok, \nKaako engsrangjok; \nUn' an-chi papko talatjok, \nAngna gamchatbejok!", 'songNumber' : 47},
  {'title' : 'DAKGIMIN GITELKO MITELTOKA',
  'song' : "1. A-a aro salgin' ning-o \nSal, ja, aro askirang, \nAn-tangtang ramako re-e \nGitelko miteltoka. \n\n2. Isol U-ibegipaan \nKu-siktangchi pilakkon \nDake done alduenga, \nA-ning a-sak, pilaknan. \n\n3. Uni bil, ku-barangbachi \nPilak biapo Uko \nRing-tokchina gisik nange; \nRing-aichina Isolko.", 'songNumber' : 48},
  {'title' : 'ABRAMNI ISOLNA',
  'song' : "1. Abramni Isolna rasongko on-tokbo, \nJringjrotoni jringjrotona Uan Isol. \nUn' agre dongjajok, Uan Isol chong-mot, \nSalgi aro a-gilsakba olakibo. \n\n2. Isol ku-rachakjok; Uo pangchakaibo. \nAn-tangnirangko jokatgen, Ua aganjok. \nKatchinikgiparang, toromi manderang \nKristona sengsotokenga Uo ka-dongbo. \n\n3. Isol kakketgipa, Uan bichal ka-gen; \nKosak, ka-mao, jechi ong-chong Un' bil donga. \nGisik pil-srangtokbo, Un songnok sepangjok, \nMikrak', bi-bo, Kristo re-baa, tarisobo.", 'songNumber' : 49},
  {'title' : 'MITELANI GIT',
  'song' : "1. Jihovana inchrobo, \nP'lak na simang a-songrang; \nKatchae dangdike on-bo \nJihovana p'lak jakrang. \nKa-sroke Un' mikkang na \nRe-babo ring-ani gnang. \nJihovana inchrobo, \nP'lak na simang a-songrang. \n\n2. Jihovan Isol ong-a \nIne na simang uibo: \nAn-chinga Unin ong-a, \nUan Dakgipa an-chingko. \nAn-ching Unin manderang, \nAro cha amramni mesrang, \nJihovan Isol ong-a \nIne na simang uibo. \n\n3. Jihovani bimungko \nPangnan namchina inbo. \nDe-mitela gnang napbo \nUni cholgugarango, \nRing-bo Uni rasongko \nUni nok sararango. \nJihovani bimungko \nPangnan namchina inbo. \n\n4. Maina Jihova nama, \nKa-sachakgipa ong-a, \nUni ka-sae dakara, \nUni bebe ong-ara, \nJringjrotni jringjrotonan, \nPilak chasongrangonan. \nJihovana inchrobo, \nP'lak na simang a-songrang.", 'songNumber' : 50},
  {'title' : 'ISOLNI ONG-ATA P\'LAKAN',
  'song' : "1. Isolni ong-ata p'lakan, \nMitele ring-bo ching baksan. \nAlleluia, Alleluia! \nDing-gipa sal, ching-begipa, \nTeng gipa ja, rupa gita, \nO mitel', O mitel', \nAlleluia, Alleluia, Alleluia! \n\n2. Ta-rak balwa balenggipa, \nAramrang, gitchoenggipa, \nUko mitel, Alleluia! \nMitelpabo, na-a seng-baa, \nAtamni askirangara, \nO mitel', O mitel', \nAlleluia, Alleluia, Alleluia! \n\n3. Chirang grikbea jokenga, \nKnatoe ring-bo Gitelna, \nAlleluia, Alleluia! \nWaal ching eng' kamenggiparas \nMande' ding-ate seng-ata, \nO mitel', O mitel', \nAlleluia, Alleluia, Alleluia! \n\n4. A-aba, salni sal chingni \nPatia' ra-baa Isol'ni, \nUko mitel', Alleluia; \nPul ba bite jeba ong-chong, \nIsolko rasong chaatchong. \nO mitel', O mitel', \nAlleluia, Alleluia, Alleluia! \n\n5. Mande ka-sachakgiparang \nSakgipin' kema ka-a, jerang, \nRing-bo, na-mang, Alleluia, \nMitel Pamung, De, Gisikko \nSakgitamon Saksasanko, \nO mitel', O mitel', \nAlleluia, Alleluia, Alleluia!", 'songNumber' : 51},
  {'title' : 'KATCHAE, KATCHAE OLAKINA',
  'song' : "1. Katchae, katchae olakina \nIsol, rasong chagipa; \nSal andalako gimaata, \nNa-a papko watsranga; \nNang-o jringjrot' katchaani, \nJajrengako chel-atbo; \nChingni ka-tongrango donge \nJringjrot' katchaako on-bo. \n\n2. Salgi, a-sak - Nang-ni kamrang \nNang ko rasong chaattoka, \nAski, sa-gre Nang' sepango \nJringiring de-mitelbea. \nSagal, a-bri, a-kawerang, \nPulrang, bolrang, do-orangba, \nNang-ko katchae de-mitelna \nChingko pangnan okama.\n\n3. Kema ka-e chingna on-a, \nNa-an Patibegipa; \nJanggini katchaani chimik, \nNa-an Neng-takatgipa, \nNa-an Apa, Jisu Gitel, \nKa-sagiparang Nang-nin: \nKa-sagrikna chingko skibo; \nKatchaako on-na Nang-nin.\n\n4. Pilakan inchrotokchina, \nJatanti de-mitelna; \nApani ka-saa' dongenga, \nMandeska' ka-sagrika, \nKatchae ring-e chinga re-a, \nDakgrikao chegiparang; \nJringjrot' janggini cheani \nNang na chingko saldoa.", 'songNumber' : 52},
  {'title' : 'A-GILSAK APANIN',
  'song' : "1. A-gilsak Apanin. \n'Ne an-ching knaronga, \nMaina Uni dakgiminrang  \nUko rasong chaata; \nA-gilsak Apanin, \nChanchion katchaani; \nSalgi, sagal, bolrangoba, \nAiao inmanani. \n\n2. A-gilsak Apanin, \nDo orang katchae ringa; \nPulrang, salni nabaani \nApako mesoka. \nA-gilsak Apanin, \nNitoe dakaha, \nBalwaoba, tom-tomoba, \nUko aganpraka. \n\n3. A-gilsak Apanin, \nPangnaba gualjawa, \nNamgijarang bang-beoba \nNokgipa Isolan. \nA-gilsak Apanin, \nDakgrika dongkua, \nGitel Jisuko ra-chakna, \nSalgi, a-sak nanga.", 'songNumber' : 53},
  {'title' : 'MAIRONGPILE DA LA NA-A!',
  'song' : "1. Nikon anga, Gitel, Nang' ong-atarang, \nNang' jakni kam, dil-dil ong-gnirangko; \nChanchion maikai dal-dalgipa a-arang: \nNa a ong-atjok algri bangbangniko. \nUnon ang' janggi ring-gen Gitelna, \nMairongpile dal-a Na-a! \n\n2. Na-a aganon kimpretan' randingachi, \nBa ding-karin balsrisri ku-rangchi; \nNikon anga riprapani nalsachi, \nBa a brio sundaren' rongrangchi. \nUnon ang' janggi ring-gen Gitelna, \nMairongpile dal-a Na-a. \n\n3. Nikon seng-ao jringjrot Nang-ni rasongko, \nSkobikrok chisolo Nang-ni dukko; \nAng tubama ka-bee Gitel nang-o, \nAn-chitang on-e sichakgipao. \n{Unon ang' janggi ring-gen Gitelna, \nMairongpile ka saa Na-a!} x2 \n\n4. Jensal' Gitel aramo re-bapilgen, \nRimdona sengenggipa \"Namchikko\"; \nUnon Nang-mung salgio jringjrot dongpagen \nGitel, ang' katchaa unon chu-sokgen. \n{Unon ang' janggi ring-gen Gitelna, \nMairongpile dal-a Na-a!} x2", 'songNumber' : 54},
  {'title' : 'JIHOVA ANG\' NIRIKGIPAA',
  'song' : "1. Jihova ang' Nirikgipa, \nAngna nanga griwa; \nTom-tom chi, sam namao angko, \nTuata, moanga. \n\n2. Ua ang' janggi an-saoata, \nAn-tangni bimungna, \nKakket dake an-tang ramao, \nUa angko re-dila. \n\n3. Re-genoba Sian a-kongko, \nKengen maina anga; \nNang-ni monggot, Nang-ni gol-dik. \nAngko ka-dimeata. \n\n4. Na-a dona ang' cha-chakani, \nBobilrang mikkango, \nAng' rangkare suakpile \nNongjok to ang' skoo. \n\n5. Beben nama ka-sae daka, \nAng janggi ja rikgen, \nAro anga jringjrot'noko, \nGitelmung dongkamgen.", 'songNumber' : 55},
  {'title' : 'MATCHUNI CHIKONGO CHONGIPA JISU.',
  'song' : "1. Matchuni chikongo chongipa Jisu, \nAtchiani walo tom-tome tujok; \nSalgini askirang uni kosako, \nGitelni turamko name nitimjok. \n\n2. Salgini sa-grerang una git ring-a. \nMa-gipa asonge uko nitima; \nMatchurang mikoa bi-sa mikrake, \nIndiba chongipa Jisu grapjaha. \n\n3. Katchaani walo an-ching git ring-a, \nJisu re-baako an-ching mania; \nSalgioni Jisu chingna ka-sabo, \nPangnan bi-sarangko tom-tome dilbo.", 'songNumber' : 57},
  {'title' : 'DAUD RAJANI SONGOCHIM',
  'song' : "1. Daud rajani songtangochim \nMatchu nolo dongachim. \nUnosa bi-sa ba-ejok, \nTuatna chikongsajok; \nMariam Un' ma-achim, \nJisuan un' bi-sachim. \n\n2. Salgioniong onbajok, \nPilaknin Gitel ong.jok. \nAtchiram matchu nolosa, \nTuata chikongosa, \nKangalrang baksa dongjok, \nA-gilsako Kristojok. \n\n3. Ma-a paatangko manijok \nChonoba mandéra-jok: \nMa-tangko niroke sningjok; \nUni ka-bako dongjok. \nKristian bi-sa bamtokbo, \nKa-sabee namtokbo. \n\nChinga Uko sningpaginok \nSalantin Ua chejok; \nUan chona bilgriachim; \nGrapa ba, ka-dingachim; \nChgingni dukko chakpanok, \nChingni kusi Uninjok..", 'songNumber' : 58},
  {'title' : 'JISUNI ATCHIA',
  'song' : "1. Grang chae bilonbaenba, \nSalgioni sa-grerang, \nDo-bok nirikgiparangna \nMikkang pa-jok uamang. \nUko nike nirikgipa, \nDil-dil ong-jok gisiko; \nAganemu sa-grerangba, \nDa-ken injok u'mangko. \n\n2. Anga kata nambeako \nNa-simangna agangen: \nBethlehemni songjinmao, \nDaud Rajani ma-drango, \nSalgioni ong onbaemu \nMe-chik oko atchijok; \nJokatgipa Gitel Jisu \nA-gilsakna re-bajok. \n\n3. Indinemu pilak sa gre \nSepangona re-baaha; \nName ku-rang saltokemu \nKa-sroke ring-tokaha; \nIsolko miteltokchina. \nManderangna namchina, \nDipjro dipjro ring-tokemu, \nGakatangjok salgina.", 'songNumber' : 59},
  {'title' : 'AIAO! MAIKAI KA-SABEA',
  'song' : "1. Sabasi, ka-sroke inchong, \nKa-sariri dake; \nDarang manden' kusi ong-chong, \nPaponi joktoke. --> x2\n\n2. Aiao! maikai ka-sabea, \nManderang, nitokbo, \nPaponiko jokattokna \nWataha marangko. --> x2\n\n3. Ka-saa Deko Isol wate, \nOn-atbejok sasti; \nMe-chik oko atchiate, \nJokata Jisuchi. --> x2\n\n4. Ia sukko knapatoke, \nKu-rangsan ring-china, \nPilak songni, pilak mande, \nSoke Salgiona. --> x2", 'songNumber' : 60},
  {'title' : 'SA-GRERANGNI GIT',
  'song' : "1. Rasong gnanggipa gitcham git waljatchio re-baa, \nSa-grerang a-gilsak sepang mandena ring-aha: \n\"A-gilsako manderangna namnika tom-toma;\" \nA-ani gam-ani kosako sa-grerang ring-kua. \n\n2. Tom tom gnanggipa sa-grerang salgioni re-baa; \nNeng-gipa a ani kosak' salgini git donga: \nA-gilsakni duk man-gipa, aro kangalgipa, \nA-ani gam-ani kosako sa-grerang ring-kua. \n\n3. Na-simang, bal jrimgiparang, be-en neng.giparang \nJa-o pari gnanggiparang, a-ding dogiparang; \nNibo! da-alo suk salrang bakbak re-baenga, \nNeng-takbo aro knatimbo, sa-grerang ring-kua, \n\n4. Agansogimin bilsirang bakbak re-baenga, \nJensalo Isolni Songnok a gimiko donga: \nAro a-gilsak gimiko tom-tomani donggen; \nUnon pilak manderangmu sa-grerang ring-taigen.", 'songNumber' : 61},
  {'title' : 'KUSI\' A-NA GITEL RE-BA\'',
  'song' : "1. Kusi' a-'na Gitel re-ba' \nRajako rim'sochong: \nKa-tonganti dring dakchina, \nP'lak bilrangan ring-chong --> x2 \nP'lak bil, p'lak bilrangan ring-chong. \n\n2. Jokatgipa sason ka-a, \nRing-china manderang; \nMingtaichong chi', 'bri, ro-ong', bakra, \nA-ba kusin' ku-rang', --> x2 \nA-ba, a-ba kusin' ku-rang. \n\n3. Pap' dukrang dal-jachinaha. \nBa bu-surang a-o; \nPatianiko Ua gipatna, \nRe-ba', gnang sao jeo --> x2 \nRe-ba', re-ba' gnang sao jeo. \n\n4. Bebe, ka-saa' Uni sason. \nAro jatirangna \nMesoktokchong kakket' rasong' \nKa-saan' aiao ina', --> x2 \nKa-saan', Ka-saan' aiao ina.", 'songNumber' : 62},
  {'title' : 'KNABO! SA GRERANG RING-A',
  'song' : "1. Knabol sa grerang ring-a, \n\"Rasong Raja gitalna, \nA-'sak tom-tomchong da-o, \nIsolmung nangrimao!\" \nHai, jatrang katchatokbo, \nSa-grerangmung ring-pabo, \n\"Kristo atchijok da-alo, \nBethlehem songjinmao.\" \n\n(Ring-taitaiani.) \nKnabo! sa-grerang ring-a \nRasong Raja gitalna. \n\n2. Jringjrotni Gitel Kristo \nDe-a minga salgio, \nRe-bajok nibo Uko \nAtchijok me-chik oko, \nNika manden' be eno \nDal-batgipa Isolko, \nDongrimna mande baksa \nNamnikjok Jisu racha. \n\n3. Ra-chak' Salgin' Rajako, \nRa-chak', Tom-tom' Pamongko: \nUa ra-baa seng-a, janggi, \nManden' an-sengpilani, \nAtchia' onatbe tangko, \nGimaatna sian' beriko; \nA'n' dedrangko tangchaatna, \nAtchitaia'ko on-na.", 'songNumber' : 63},
  {'title' : 'TOM-TOM\' WAL, RONGTAL\' WAL',
  'song' : "1. Tom-tom' wal, rongtal' wal, \nNitoa, katchaan' wal, \nMariammung Bi-sana. \nKa-sagipa Dederacha! \nTom-tom tusiangku'. --> x2 \n\n2. Tom-tom' wal, rongtal' wal, \nAndal' gri, teng-an' wal. \nSa-grerang ring-chimengon, \nRakkualrang mes nitimengon, \nKristo atchiaha. --> x2 \n\n3. Tom-tom' wal, rongtal' wal, \nAskian ching-an' wal, \nUigiparang ra-baaha \nOn-arangko Jisuona, \nJisu atchiaha. --> x2\n\n4. Tom-tom' wal, rongtal' wal, \nAskia, teng-kukal, \nSa-grerangmung ring-pana, \nAlleluia' Kristo re-baa, \nChingni Jokatgipa. --> x2", 'songNumber' : 64},
  {'title': 'O BETHLEHEM, CHONGIPA SONG',
  'song' : "1. O Bethlehem, chongipa song, Maikai tom-tom, nang-on, \n'Sako askirang teng-suon, \nManden' tusiengon, \nNang-on un' wal dongenga \nJringjrotna Seng-gipa; \nNichaksoa p'lak chasongni \nNang-on chu-sokaha. \n\n2. Mariamni De Jisuan, \nNang-on atchiaha; \nManden' tusitokmitingon \nSa-grerang nitima. \nO salgirang, ring-chrobo, \nJisu atchiaha; \nRing-e Isolko mitelbo, \nTom-toma re-baaha. \n\n3. Maikai rinok tom-tom re-baa! \nJisu an-chingona, \nUandake Isol on-arang' \nAn-chingna patia! \nA-sakna Ka-sagipa, \nNang' rebaako knaja, \nNang-o ka-donggiparangsan \nNang' dongpaako uia. \n\n4. O Bethlehemoni Jisu \nChing'na re-bakubo, \nChing' paprangko su-srangkubo, \nKatchaatbo chingko. \nSa-grerang, ring-angkubo, \nGit knatobegipa, \nChing' baksa pangnan dongkambo, \nIsolni Degipa.", 'songNumber' : 65},
  {'title' : 'HAI, AN-CHING DEMITELNA',
  'song' : "1. Re-babo, re-babo, bebera-giparang, \nJisu'na kusi ong-e re-batokbo; \nIsolni Depanteko chingna on jok, \nHai, an-ching de-mitelna --> x2 \nHai, an-ching de-mitelna, Jisu Gitel. \n\n2. Ring-tokbo, ring-tokbo, p'lak jatni manderang \nIsolni dedrang katchae miteltokbo; \nChugipa Isolko rasong chaatbo, \nHai, an-ching de-mitelna; --> x2 \nHai, an-ching de-mitelna, Jisu Gitel. \n\n3. Da-al' Jisuni atchiako mania; \nJisu, Nang' bimung jringjrotna dongchina \nIsolni Kata mande gita re-baa, \nHai, an-ching de-mitelna; --> x2 \nHai, an-ching de-mitelna, Jisu Gitel.", 'songNumber' : 66},
  {'title' : 'RAJA SAKGITAM',
  'song' : "1. Ching' raja sakgitam ong-a, \nBoksisrang' ching' chel-e ra-baa: \nA-ba, a-bri a-kaweo, \nAskiko ja-rika. \n\n(Ring-taitaiani.)\nO, aski nitobegipa, \nAski ching-batbegipa, \nSaliramchi re-mitingo \nJisuona dilangbo. \n\n2. Bethlehemni Rajaona. \nMukut stikna sona' ra baa; \nChingni Gitel, Jisu Kristo, \nJringjrot Raja Na-an. \n\n3. Kunduruko anga ra-baa, \nSimilgipa cha-chat Nang-na; \nChingni Isolko mitelna, \nUna rasong on-na. \n\n4. Mur' anga Jisuna ra-baa, \nSian' salna ian ong-a, \nDuk man-gipa Jisu chingna \nSichakna nangaha. \n\n5. Rasong gnangbegipa Jisu. \nRaja, Isol, Jokatgipa: \nAlleluia, Alleluia. \nMande inchrochina.", 'songNumber' : 67},
  {'title' : 'GALILI\' CHI',
  'song' : "Galili' chi, sagal nama, \nNang' chisamo Jisun' roram, \nNang-ko nikna sikbeengjok, \nMaina angko katchaat'nok. \n\n(Ring-taitaiani.) \nGalili' chi, sagal nama, \nJisu nang ko namnikaha; \nGalili' chi, nitoa chi, \nNa-a angna uni saki. \n\n2. Nang' chisamo Jisu skijok \nJinma bang-en knatimbejok \nMaina uno Janggin' Kata' \nPapirangna parakaha. \n\n3. Nang-ni ro-ongrang, an-cheng, samrang, \nBol' salakim, do'o'ni ku-rang \nUko gisik naattoka, \nMaina Uni roram na-a. \n\n4. Nang' ringrango Ua ga'jok, \nNang' chisamo Ua rojok; \nNang' bal raka, chipokpeka, \nPilak Uko Gitel minga.", 'songNumber' : 68},
  {'title' : 'ANG\'GITEL KANGALBEACHIM',
  'song' : "1. Ang Gitel kangalbeachim, \nUn' turam biap chikongchim. \nIndita gam ang' Gitelnin, \nRajarang Uko am-aha. \n\n2. Ang Gitel kangalbeachim, \nKangalrangmung cha-rimaha, \nIndita gam ang' Gitelnin, \nJinmarangko okkaataha. \n\n3. Ang Gitel kangalbeachim, \nUko chisolo su aha, \nIndita gam ang' Gitelnin, \nP'laknan patia komija.", 'songNumber' : 69},
  {'title' : 'KRISTONI SICHAKA',
  'song' : "1. Kristoko nibo! --> x2\nUan chingko jokata, \nUa, da-nang, sichakjok, \nChingni papko ra-chakjok \nAn-tangni an-chichi jokata. \n\n2. Uko so-otjok, --> x2 \nDatkape ja ako jakko; \nDa-nang sko choknokaha, \nCha-u maikai kratcha-aha, \nKa-sae jokata papirangko \n\n3. Chu-sokjok! ina, --> x2\nAngni siao chu-sokjok! \nUko man-e cha-gipa \nRo-ong ning-o gopenba, \nSimilgipako nonge donjok. \n\n4. Kristoan amchong, --> x2 \nNambatgipa darangna; \nUa Bilakbegipa; \nSiakoba Amgipa, \nGakatangaha Salgiona. \n\n5. Aganjok Pao, --> x2 \nAnga papini a-sel \nSichakahani gimin \nUama-dangko da-rim, \nApa, watboho, angni a-sel. \n\n6. Ukode watgen, --> x2\nNang-o katnapgipako, \nGisiksaba pil-china, \nPapkosaba galchina, \nNang ni giminan watgen uko.", 'songNumber' : 70},
  {'title' : 'O SKOBIKROK',
  'song' : "1. Skobikroko Jokatgipa \nSichakaha bolo angna, \nUni an-chiko on-aha, \nPaponiko jokataha. \n\n(Ring-taitaiani.)\nO Skobikrok! andalaha, \nJeo angna an chỉ ong at \nO Skobikrok! mitelaha, \nNang-o Gitel angna sia. \n\n2. Ro-ongrang bretjok, andalbejok, \nChampenggipa ba-ra grinjok; \nIndakmiting' angni Jisu \nNama biap'na chol ojok. \n\n3. Jisu Gitel, maikai ong-a. \nNang ni janggi' angna on-jok? \nMaini gimin datkapman-jok, \nSasti man-china, angni pal?", 'songNumber' : 71},
  {'title' : 'TANGSEKGIPAA-BRI CHEL-A',
  'song' : "1. Tangseka a-bri gnang chel-a, \nSongjinman' a-palo, \nJeo Jisu sichakaha, \nJokatna pilakko. \n\n(Ring-taitaiani.) Ua ka-sabejok namen, \nAn-ching ka-saskana; \nUni an-chio pangchaken, \nUn' kamrangko dakna. \n\n2. Ua mai dukko chakchikjok \nAn-ching uina man-ja; \nAn-chingna uno datkapjok; \nIako bebera a. \n\n3. An-chingni papko watsrangna, \nAn-chingko namatna, \nAn-chingko salgi' man-atna, \nAn-chitang' on aha. \n\n4. Jisun' agre watna papko \nAmgipa dongjachim; \nUasan salgin' do gako \nOatna amachim.", 'songNumber' : 72},
  {'title' : 'CHISOL SEPANGO DONGE',
  'song' : "1. Chisol sepango donge, \nChadenga, kenmanja; \nUo neng-begipaoba Neng-taksrangna ama; \nBakraon katnapram, Chisol, \nRaman' salakimram, Saljatchini ding-beaoni, \nAng' balko galgopram.\n\n2. Ua Chisolo, anga, \nGisiko nikengon, \nJisun' duk chakchikengako, \nAngna sichakengon; \nAngni ka-tong ku-rachaka, \nAiao inmanbea, \nJisun' bon-changgija ka-saa, \nAngan jabolrara. \n\n3. Chisolni salakimon \nAng' dongnuram ong-a; \nJisun' mikkangni ching-ana Bate seng-a nangja; \nA-gilsak jeba ong-china, \nMan-dap ba gimachong, \nAng pap mangmang kratcha-ata. \nChisol ang rasong 'chong.", 'songNumber' : 73},
  {'title' : 'O SKO RONGTAL\' MATGIMIN',
  'song' : "1. Rongtala Sko matgimin, \nDukchin jrimbeata, \nKal-stapgiparang duulon \nBu-sun' mukut' stika. \nO rasong maironggipa! \nMairong Nang' katchaara; \nAn-chiko On-chakgipa, \nNa-an angni katchaa. \n\n2. Nang' dukko chakchikara, \nPapirangna ong-skaa, \nPaprangan angni ong-a, \nNang-nin saknabea'. \nNang-na ja-sku dipanna! \nKrabatgen duk angna; \nGitel, da-o patibo. \nNang ka-saako angna. \n\n3. Nang ni sichakanimung \nKa-sana tipjaana, \nMai kata' jakkalgenchim, \nNang ko krae mitelna? \nO angko Nang-nin dakbo; \nAng' nom-angnasion, \nGitel, Nang-na ang' ka-saa' \nPangnan tipna da-on. \n\n4. Sinasion sepangbo, \nChisolko nikatbo, \nAngko chelchakepabo, \nJakgitel ong atbo. \nKa-donga batbaengon, \nJisuon tanggipa, \nUa siangnasion, \nKenchaka gri chea.", 'songNumber' : 74},
  {'title' : 'UA CHISOLMUNG MAIKO TOGEN',
  'song' : "1. Ua chisolmung maiko togen, \nKristo Jisu sijok jeon; \nP'lak ang man-a bon-gipasan, \nP'lak ang rasong kratcha anisan. \n\n2. Dongja angna rasong chana, \nSiana agre Un' angna; \nGimagni p'lak angni man-a, \nOn-gen boli Un' an-china. \n\n3. Nibo ja-a, jak, skooni, \nJokbrina duk, ka-saani, \nBao' duk, ka-sara indaka? \nBao' bu-sun' mukut gamchata. \n\n4. Angni ong-e a-gimikan, \nOn-genoba on-titisan; \nInditan ka-sa Isolni, \nAm-a janggimung p'lak angni.", 'songNumber' : 75},
  {'title' : 'ANDALANGAHA BARIO',
  'song' : "1. Andalangaha bario, \nDukni walo aski teng-ja \nAndalangaha bario, \nGitel simbrabee bi-a. \n\n2. Andalangaha a-palo, \nSaksan Gitel sintebea, \nNamnikgipa sa-grerangba \nJisuni dukko gualanga. \n\n3. Andalangaha an-chichi, \nJisu gipinrangna grapa, \nDuk saknaako chakchikoba \nApa Isol Uko gualja. \n\n4. Andalao Jisu bi-a, \n\"Apa, Nang-ni ska ong-china.\" \nAndalaoni rimange mQual \nMa Mande Jisuko so-ota. \n\n5. O Gitel, ka-sabegipa, \nNa-a angko jokataha, \nKrajaoba ka saskaenba, \nAng' an-tangko Nang-na ona.", 'songNumber' : 76},
  {'title' : 'UA TANGA',
  'song' : "1. Tanggipa Gitel Jisu, amjok papni bilko, \nChakatjok gopramoni, chee sian beriko; \nSalgi, a-sak Nang' rasong, gapchong mitelani, \nAng' ring-gen Un' rasongna; \nHalleluia! \n\n(Ring-taitaiani.)\nJisu Tanga, da oba Ua donga; \nAng ka-tongko katchaata, \nJanggin ramao dila, \nJisu Tanga, siako amsrangjok. \nAng ka-tongo Jisu donga, \nJisu ango Tanga! \n\n2. Rasong! Rasong! ang' Jisu, de-mitelgen Nang-ko, \nPiokgipa janggiko jringjrot norok' niko; \nInchro, inchro manden' jat Hojana! Daudni De \nGapchong a-sak katchaani, \nHalleluia! \n\n3. Am-kugen anga sako, nanggen maia bilko? \nJisun ama p'lak bilko, jokatna papiko, \nNang-na on-gen janggiko, su-sranggen nang' papko. \nIndakgipa Gitelko, \nHalleluia!", 'songNumber' : 77},
  {'title' : 'GITEL JISU SINGHASONO',
  'song' : "1. Gitel Jisu singhasono, \nRasong chajok salgio; \nRe-batokbo, O manderang, \nAn-ching Uko mitelna. \nMiteltokbo, miteltokbo, \nSiaoni chakatjok, \nSiaoni chakatjok. \n\n2. Bebera-bo, O manderang, \nJisu gita tangchana; \nA-gilsakko kimitoba, \nAn-ching Uon katnapna. \nKatnaptokbo, katnaptokbo, \nJisu ama tangchaatna, \nJisu ama tangchaatna. \n\n3. Da-o an-ching a-gilsako, \nSina nanggen noroko; \nSiaoni tangchanade, \nJisu on-gen an-chingna. \nNambenakjok, nambenakjok, \nJanggitangko man-gnok, \nJanggitangko man-gnok.", 'songNumber' : 78},
  {'title' : 'JISU DA ALO CHAKATJOK',
  'song' : "1. Jisu da alo chakatjok, \nIan maikai an-senga! \nKristo boli on-chakjok, \nUo chinga pangchaka. \n\n2. Imo, an-ching katchana, \nSalgin' songko ring-pana: \nSichakaha Chisolo, \nJanggitangko on-chakna. \n\n3. Kusi ong bo, darangan, \nBebera gen pilakan; \nSian' jagring gimaaha, \nJanggin' teng-a naaha. \n\n4. An-ching pilak tom-tokna, \nJisun' ja-man ja-rikna; \nSiaoni amtokna, \nHai, an chinga rongtalna.", 'songNumber' : 79},
  {'title' : 'JISU CHAKATJOK DA ALO',
  'song' : "1. Jisu chakatjok da alo, Alleluia! \nIna a-sak salgio: Alleluia! \nKatchae gam-e inchrobo; Alleluia! \nA'sak salgin ring-chakbo, Alleluia! \n\n2. Rasong' Raja tangpiljok; Alleluia! \nSia, nang' beri baojok? Alleluia! \nJoktokjok Un' siachi, Alleluia! \nGopram, bao nang' cheani? Alleluia! \n\n3. Ka-sae Ua piokaha, Alleluia! \nDakgrikao cheaha; Alleluia! \nSia peng-na man-jajok, Alleluia! \nKristo Salgiko ojok, Alleluia! \n\n4. 'Dona Kriston' dilako, Alleluia! \nChuatgimin 'ching Pamongko; Alleluia! \nChakatgen 'ching Ugitan; \nAlleluia! Chingnin gopram Salgiban, Alleluia!", 'songNumber' : 80},
  {'title' : 'UA CHAKATAHA',
  'song' : "1. Gopramon tuachim \nAng' Jisu Gitel; \nSalko sengsoachim, \nJisu Gitel. \n\n(Ring-taitaiani.) \n14Gopramoni chakatjok, \nBobilrangko chee amtokjok; \nChakatjok, walni andalako amjok, \nChingko Uan jringjrotna sason ka-angnok \nChakatjok, chakatjok, \nAlleluia! chakatjok. \n\n2. Nitimgramarijok, \nJisu Gitelko; \nMohor su-gramaijok, \nUn' gopramko. \n\n3. Siako amsrangjok, \nAng' Jisu Gitel; \nDo-gako pe-srangjok, \nJisu Gitel.", 'songNumber' : 81},
  {'title' : 'JISU DAKGRIKA\'BON-ATJOK',
  'song' : "1. Alleluia! Alleluia! Alleluia! \nJisu dakgrika' bon atjok; \nJanggi siako amsrangjok; \nCheani gitko hai ring-tok, \nAlleluia! \n\n2. Alleluia! Alleluia! Alleluia! \nSiani bil krengsrangoba. \nKristo uko bamataha; \nKa-sroke git' ring-chrotokna, \nAlleluia! \n\n3. Alleluia! Alleluia! Alleluia! \nSal gitamna duk ong.oba, \nGopramoni tangpilaha; \nKristona rasong ong china, \nAlleluia! \n\n4. Alleluia! Alleluia! Alleluia! \nGitel, Nang ni mataranga \nSiaoniko engaha; \nTanggen, ring-gen chinga Nang-na, \nAlleluia!", 'songNumber' : 82},
  {'title' : 'UKO MUKUT STIKATNA',
  'song' : "1. Jisuko rasong chaatna \nIsolni manderang; \nJisuo mukutko stikna, \nRasongba chaatna. \n\n(Ring-taitaiani.)\nMukut' stikna (Rajako), mukut' \nStikna (Rajako),\nPiokgipako Raja dakatsrangna; \nMukut stikna (Rajako), mukut\nStikna (Rajako) \nP'lakni Raja (Jokatgipa) stikatna. \n\n2. Jisuko an-ching ja-rikna, \nUnon an-sengsranggen; \nKristoni sepang dongkamna, \nAn-ching pap nangjagen. \n\n3. A gilsako donggiparang, \nPilak jat, ku-sikrang, \nInwatchina nang-ni bilrang, \nAro p'lak sa-grerang.", 'songNumber' : 83},
  {'title' : 'AIAO KA SAA ISOLNI',
  'song' : "1. Aiao ka-saa Isolni, indin tona amja, \nOn-kangsrangjok De Kristoko, \nSkobikrokni bolo, \nO ka-saa mairongpilgipa, \nUan nangjok papina sina. \n\n(Ring-taitaiani.)\nKristoni ka-saa mairongpila angna, \nKristoni ka-saa mairongpila angna, \nSagalsakna gita Un mingnamako, \nAganna amsokpilja Un ka-saako. \n\n2. Aiao ka saa Isolni, angna u-iatjok, \nGisik rongtalgipan on jok, \nAngko Uan kangjok; \nO kasaa mairongpilgipa, \nAnga Unin, Ua angnin. \n\n3. Aiao ka-saa Isolni, katchae da'o agana, \nGimagimin papirangna, \nUn' bimungo jokna; \nBakrime gipinrang baksa, \nKriston' ka-saako mesokna.", 'songNumber' : 84},
  {'title' : 'NIBO ISOLNI KA-SAAKO',
  'song' : "1. Nibo mairongpile ka-saa, \nIsol on jok chingna, \nMingjok an-chingko Un' dedrang. \nGimajok papirang, \n\n(Ring-taitaiani.)\nNibo... Un' ka-san bewal,\nMairongpilgipa\nOn-manjok an-chingna Pagipa \nMinggen, minggen an-chingko \nIsolni dedrang minggen.\n\n2. Sepangatjok Un' an-chichi, \nChel-jajok Uoni, \nAn-chingko ka-sae rimchakjok, \nUn sepango dongna. \n\n3. Mairongpilgipa rasongo, \nAn-ching dongepagen, \nGitelko an-ching nikeon, \nUgitan ong-pagen.", 'songNumber' : 85},
  {'title' : 'UN\' KA-SAAKO',
  'song' : "1. Jisun' ka-saako mitelna, \nUn' ka-saako! \nAtchiemu mande pil-e, \nBi-sa gita dukko man-e,  \nManderangni dukko ra-e, \nUn ka-saako! \n\n2. Rimbaemu bi-sarangko, \nUn' ka-saako! \nNambo ine ingipako, \nUn\' ka-saako! \nNiriktima do-boktangko, Un\' ka-saako! \nJokattoka dukoniko, \nBiap on-gen salgisako, \nUn\' ka-saako! \n\n3. Nike Ua chingni dukko, \nUn' ka-saako!\nOn-chakaha janggitangko, \nUn' ka-saako!\nChisoloon janggi galjok,\nUnon chingni papko watjok,\nMandetangko kenatjajok, \nUn' ka-saako!\n\n4. Siakoba gimaatjok, \nUn' ka-saako! \nA-ning a-sak Raja ong-jok, \nUn' ka-saako! \nAn-chitangko on-chakemu, \nPagipana aganemu, \nDuk man rimjok mandetangmu,\nUn' ka-saako! \n\n5. Man-jaskal anga salgiko, \nUn' ka-saako! \nMitelanggen Ukon pangnan, \nUn' ka-saako! \nKatnapemu Jisuona, \nKa-dongemu ka-saana, \nSina kingking inna nanga,\nUn' ka-saako!", 'songNumber' : 86},
  {'title' : 'ANGNA INTAITAIBONE',
  'song' : "1. Angna intaitaibone \nIsolni Katako; \nAnga knapana skenga, \nJisuni ka-saako, \nAngna inbo, talsrange. \nChongipana gitan; \nMaina ango bil gribe\', \nKana mande angan. \n\n(Ring-taitaiani.) \nAngna intaitaibone, \nAngna intaitaibone, \nAngna intaitaibone, \nJisuni ka-saako. \n\n2. Uko uisrangchina \nKa-sae angna inbo, \nPaponi joktokchina, \nJisuni siako. \nRipamchi grea gita, \nBakan gualjana, \nSal sal angna aganbo \nIsolni ka-saako. \n\n3. Angni jajrengan' salo \nUko gualnabe; \nAngko ka-dimeatna \nUnon aganbode. \nAro angkon namatna, \nJisu re-baaha 'ne, \nJringjring angna aganbo; \nSuk gri, una bate. \n\n4. Siangnasiengode, \nUn' ku-rachakako, \nKa-mao sea gita, \nNamedake ring-bo; \nAnga nang-na biapko \nDaksona re-angnok, \nAn-tang baksa donpana \nNang ko rimangnakjok.", 'songNumber' : 87},
  {'title' : 'KA-SAGIPA RIPENG JISU',
  'song' : "1. Ka-sagipa Ripeng Jisu, \nAn-ching papko ra-chaka; \nAn-ching ra-na man-a dukko \nBi-achi Isolona; \nAn-chingni jajrengaranga, \nAn-ching duk man-gramara, \nAn-ching ra-angjani gimin, \nBi-achi Isolona. \n\n2. Dakmajoa, ruraama? \nDuk banoba dongama? \nAn-chingde jajrengna nangja, Ra angbo Gitelona.\nGnangmade, ripeng indake, \nDukrangko ra-pagipa? \nJisu nang' bilgriko uia, \nRa angbo Gitelona. \n\n3. An-ching jrima, neng-amade? \nJajrenga champengama? \nJokatgipan an-ching' Danil, \nRa-angbo Gitelona. \nMa-drang mitchie galama? \nRa-angbo Gitelona, \nUan nangko ganggopsogen, \nNa-a unon tom tomgen.", 'songNumber' : 88},
  {'title' : 'AGANNA SKA KATAKO',
  'song' : "1. Aganna ska Katako, \nSalni kosak' niko, \nJisu aro rasongko \nJisuni ka-saako! \nAganna ska Katako, \nMaina beben ong-a; \nChu-sokata ang' skako, \nJeko gipin amja. \n\n(Ring taitaiani.)\nAganna ska Katako, \nSalgio agangniko,\nRuutbeani Katako, \nJisuni ka-saako. \n\n2. Aganna ska Katako, \nAiao inmangniko; \nBata chanchiarangna, \nPilak jumangrangna. \nAganna ska katako, \nAngna namgni ong-a; \nIani gimin anga \nAganenga nang-na. \n\n3. Aganna ska Katako, \nMingtaina nambea; \nPil-anti aganoba, \nSu-uangbatenga; \nAganna ska Katako, \nMitamde knakuja, \nJokatani Katako, \nIsolni inako. \n\n4. Aganna ska Katako, \nUibatgiparangna \nOkkria gita nika, \nlako knatimna. \nJensalo rasongrango \nRing-gen gital gitko, \nOng-kugen gitcham Kata, \nAngni skang namnika.", 'songNumber' : 89},
  {'title' : 'ANGA RIPENGKO MAN-AHA',
  'song' : "1. Anga man-jok ang' ripengko, \nAngna ka-sagipako! \nUa salbaaha ka-sachi; \nKajok an-tangmung angko; \nMamung a-sel re-baoba, \nOlgrokja indioba; \nGitel angnin anga Unin, \nJringjrotni jringjrotona. \n\n2. Anga man-jok ang' Jisuko! \nJokatna siaha angko; \nGamchi ong-ja janggitangko; \nOn-kangaha an-tangko; \nOn-skana ang mamung dongja, \nOh Gitel, ango nang-na; \nAng' ka-tong, bil, janggi p'lakkon, \nAng' on-kanggen jringjrotna. \n\n3. Anga man jok ang' Gitelko! \nOn-aha pilak bilko; \nRakibo p'lak ruraoniko, \nDilbo salgichi angko. \nJringjrotna bon-changgija suk, \nOn-bo Gitel angna da al; \nDa-o dakgrik' simsak' kamni sal; \nUnon neng-takani sal. \n\n4. Anga man-jok ang' ripengko, \nKa-sa Kakketgipako; \nNamao ka sao re-dilgipa, \nBilchi warachakgipa. \nUni ka-sabeaoniko \nAngko ekatgen maia? \nSibo, tangbo, jeba ong bo, \nGitel ang Nang-ni ong-gen.", 'songNumber' : 90},
  {'title': 'GIPIN GRI',
    'song': "1. Ripeng dongja sontol Jisu gita, \nGipin gri, gipin gri, \nJanggini saako namatna ama, \nGipin gri, gipin gri. \n\n(Ring-taitaiani)\nJisu uitoka an-ching' dukko \nSal chon-jaskal Uan dilanggen. \nRipeng dongja angni Jisu gita, \nGipin gri, gipin gri. \n\n2. U'gita gri rongtalatbegipa, \nGipin gri, gipin gri; \nSontol ripeng dongja Ua gita, \nGipin gri, gipin gri. \n\n3. Sal saba gri Uni sepang dongja, \nSal saba, sal saba; \nWal saba gri jeo Ua ka-saja, \nWal saba, wal saba. \n\n4. Toromi mandeko galchipjokma? \nP'lakba gri, p'lakba gri; \nPapiko ra-chakgija dongama? \nP'lakba gri, p'lakba gri. \n\n5. Jisu gita on-ako on-jokma? \nP'lakba gri, p'lakba gri; \nSalgioba nok' on-na jegenma? \nJea gri, jea gri.", 'songNumber' : 91},
  {'title' : 'SALGINI ONG ONBAA SA?',
  'song' : "1. Salgi'ni ong-onbaa Sa? \nJisu Jokatgipa! \nMande pil-e atchia? \nJisu Jokatgipa! \n\n(Ring-taitaiani.) \nRasong on-bo Jisuna, \nJokatako Dakgipa! \nDuk saknae ka-sara. \nJisu Jokatgipa! \n\n2. Sako bolo de-doa? \nJisu Jokatgipa! \nNang ko, angko piokna? \nJisu Jokatgipa! \n\n3. Pap' watna agana Sa? \nJisu Jokatgipa! \nJanggiko on-gipa Sa? \nJisu Jokatgipa! \n\n4. Singhasono donga Sa? \nJisu Jokatgipa! \nSana ka-sana nanga? \nJisu Jokatgipa! \n\n5. Re-bapiltaigen sawa? \nJisu Jokatgipa! \nMandetangko rimangna? \nJisu Jokatgipa!", 'songNumber' : 92},
  {'title' : 'GITEL KRISTO JISUN\' SIA',
  'song' : "1. Gitel Kristo Jisun' sia, \nPapi manderangni pal, \nJe mande Uko ja-rikgen, \nKa-sagipa jokatgen. \nJe mande namjabegipa. \nUkode Gitel wata \nPaprangoni' jokatenba, \nOn-gen dongna salgio. \n\n2. Gitel be-enko ra-aha, \nRing-gen Nang-ni ka-saako \nPapirangni a-sel Na-a \nDakjok mai aiao ina. \nNang' sian papini joka, \nPangnan salni gam, janggi; \nBebera-tokbo a-gilsak, \nKatchae uko ring-tokbo. \n\n3. Knagen Jisu, knagen Jisu, \nMol-molako papini; \nNang-ni ka-sabean' a-sel \nMitelaigen, pangnajol; Na-an Kakket, \nNa-an Janggi, \nNa-an Bilakbegipa; \nNang-ni sian' a-gilsako \nNeng-takatgen jringjrotna.", 'songNumber' : 93},
  {'title' : 'KNATIMBO, ANGNI JANGGI',
  'song' : "1. Knatimbo, angni janggi, \nNang' Gitel aganenga; \nO, neng-enggipa papi, \nNa-a Angna ka saama? \n\n2. Nang-ni kaako engaha, \nNamatjok nang matako, \nNang' brango am-eaha, \nSeng-atjok andalako. \n\n3. An-tang ba-gimin deko \nMe-chik galna amama? \nGalnaba gnang, indiba \nAnga nang-ko watgalja. \n\n4. Ang ka-sara dingtangja, \nChubatarangna bata, \nTu-batarangna bata, \nSianaba bilaka. \n\n5. Na-a angni rasongko \nNikninggen rongtaloa; \nAsonggen singhasono; \nPapi, Angna ka-saama? \n\n6. O Gitel, ang' duk ia. \nAng ka saa bilgri, nom-a; \nIndiba Nang-na ka-saa \nDakchakbo ka-sabatna!", 'songNumber' : 94},
  {'title' : 'KA SAE DAKA!',
  'song' : "1. Chakat, ang' janggi katcha'o, \nMitel' nang' Piokgipako; \nAm-enga ring-ako Uan; \nUn' ka-sae daka, indinan! \nUn' ka-sae daka, ka-sae daka, \nUn' ka-sae daka, indinan! \n\n2. Nikoba ang' ga-akako, \nDonkua ka-sa'o angko; \nJokataha angko Uan; \nUn' ka-sae daka, oh, dal-a! \nUn' ka-sae daka, ka-sae daka, \nUn' ka-sae daka, oh, dal-a! \n\n3. Bang-oba bobilrang re-na, \nA-a, norok angko peng-na; \nJok'e angko dilgen Uan; \nUn' ka-sae daka, bil rakan! \nUn' ka-sae daka,ka-sae daka, \nUn' ka-sae daka, bil rakan!", 'songNumber' : 95},
  {'title' : 'RE-BABO GITEL ANGONA',
  'song' : "1. Singhason' wate mukuttang' gale, A-ona re-baaha angna, \nBethlehemo dongja kragipa biap \nRongtalbea dongna Nang-na, \nO Gitel, Jisu re-babo, \nDonga biap ang' ka-tongo. \n\n2. Salgin' songo Nang rasongko minge, \nSa-grerang de-miteloba, \nGisiko sontole algri ong-pile, \nA-gilsako atchiaha. \nO Gitel, Jisu re-babo, \nDonga biap ang ka-tongo. \n\n3. Bol salakim perurang neng-takna, \nDo-drangna bitipko dakna, \nBakran' sam tuani, O De, Isolni, \nGalil'ni a-gisi Nang-na, \nO Gitel, Jisu re-babo, \nDonga biap ang' ka-tongo. \n\n4. Janggin' Katako Na-a ra-bara, \nMandetang' janggi jokatna, \nMukut bu-sukosa, man-a kal-stapa, \nSo-ota Skobikrokosa, \nO Gitel, Jisu re-babo, \nDonga biap ang' ka-tongo. \n\n5. Nang' chean' salo knatoa ku-rangchi, \nSa-grerang ring-a jensalo, \nNang' ka-saan' ku-rangchi okambo angko, \n\"Nang-na biap donga ang' sambao.\" \nNang' re-bae okaman' salo, \nAngni ka-tong ka-srokbegen.", 'songNumber' : 96},
  {'title' : 'JISU KA-SARA ANGNA!',
  'song' : "1. Jisu ka-sara angna! \nBible angna agana; \nBang-e uipajaoba, \nUan angna mesoka. \n\n(Ring-taitaiani.)\nJisu ka-saa' ne'! Jisu ka-sad ne! \nJisu ka-saa ne'! ang' Bible agana \n\n2. Jisu ka-sae siaha! \nSalgin' do-ga' oaha; \nAng paprangko su-sranggen, \nAro angko jokatgen. \n\n3. Jisu angmu dongpagen, \nPangnan angko re-dilgen; \nBebera-e siode, \nSalgichi rimgen ode.", 'songNumber' : 97},
  {'title' : 'PAPIRANGNA SICHAKA',
  'song' :"1. Papirangko jokattokna \nRe-bae Gitel a-gilsakna, \nKa-saako parape-e \nAn-chi on-jok papirangna. \n\n2. Jisuo je bebera-gen,\nChijanggiko ua man-gen; \nUko ringe pangnan tanggen, \nKristo baksa dongna man-gen. \n\n3. Atchiemu a-gilsako, \nParape-jok toromtangko; \nKa-sabejok, oe nanggo; \nSichakanga bobilrangna.", 'songNumber' : 98},
  {'title' : 'SA DONGA JISU GITARA?',
  'song' : "1. Salgiko watgipara Sa? \nDarangnin Gitel Jisusa. \nSalgiko watjok, mainasa? \nPapi mande jokpachina. \n\n(Ring-taitaiani.) \nSa donga Jisu gitara? \nPapni gimin sichaka! \nSichakgipa papirangna, \nSabas, Gitel, sabas Na-a! \n\n2. Isolni Dea mai ka-jok? \nUa da nang sichakangjok, \nMaini gimin sichakaha? \nRama bakna papirangna. \n\n3. Sian' ja-mano mai ong-jok? \nSiaoni chakatpiljok, \nChakatman-oa mai ong-jok? \nRe-angemu Salgiojok. \n\n4. Da-o Ua bano donga? \nSalgio niwate donga. \nAganchaka sani gimin? \nPapirangni papni gimin. \n\n5. Re-na man-jama unona? \nAn-chingan re-gen unona, \nPapirangnia sa gitel? \nPapirangni Jisu Gitel.", 'songNumber' : 99},
  {'title': 'BE-EN GIMIK KONCHIRITAM',
    'song': "1. Be-en gimik konchiritam, \nIandake Sagipa, \nJisuona re-baemu, \nAganejok uaba. \n\n2. Gitel, Nang-ni namnikode, \nAn-sengatbo inejok. \nUnon Jisu jak rim-dape, \nKusi ong-a inatjok. \n\n3. Unon konchiritamaba, \nNamedaken an-sengjok, \nUna bate pap'nikoba, \nGitel ka-sae jokatjok. \n\n4. Iandake a-gilsako, \nBadigita manderang \nNorok' rama' re-tokari, \nJokna man-ja uamang. \n\n5. Uni gimin knatimtokbo, \nUa papko namatgen, \nGitel Jisuko ra-ode, \nUni an-china talgen. \n\n6. Re-baemu bi-paebo, \nBi-amgipa gitasa, \nPaponi gisik pil-osa, \nRachakpagen Uaba.", 'songNumber': 100},
  {'title' : 'O KA-SAE JOKATGIPARA',
  'song' : "1. O ka-sae Jokatgipara, \nDakna nangako mesokbo, \nMikrake bi-na skibo, \nSalantio. \n\n(Ring-taitaiani.) \nSkango Na an bi-sachim, \nRinok, rinok, sontolgipa \nAngmu man-rimpagipa, \nNang-ni sepang' rimbo. \nO Jisu, angni ka-sara, \nAnga jringjring rona Nang-mu, \nKosako Nang' dongramchi \nAngko dilbo. \n\n2. Salanti bate Nang.' gita \nAnga ong-roroangna, \nAng' ka-tongko talatbo \nPaponiko. \n\n3. O ka-sara, Na-a angnin, \nAnga Nang-nin ong-sranga. \nGitel, ango salantin \nBil' mesokbo.", 'songNumber' : 101},
  {'title' : 'SO-OTA MAN-PAGIPARANG',
  'song' : "1. Gitel Jisu jensalo \nSu-a man-a Chisolo, \nPapi sakgni Un baksa \nSu-a man-a papnisa. \n\n2. Saksa papi kengija \nSinakoba sinteja, \nNamnikgija batesa \nKal-stapa Jisukosa. \n\n3. Duk man-bea saksade, \nAn-tang papnan uade; \nMan-e Uni ka-saako, leding \nBebera-jok Jisuko. \n\n4. Man-an salo Nang' Songko, \nGisik ra-pabo angko; \nGitel injok, Ang' baksan \nMan-egen 'ne, da-alan. \n\n5. Mande apnikjan' salo, \nJisu ka saa un' salo; \nDa-oba katnapode \nKa-sakugen Uade.", 'songNumber' : 102},
  {'title' : 'AGILSAKNA ONG ONBAE',
  'song' : "1. Salgioni Isol ong-e, \nA-gilsakna ong onbae, \nSong gimikna teng.suate, \nSal gita ching-jok. \n\n2. Gisik jarambong gitasa, \nDaud ma-chong'na re-baesa, \nGitel Jisu atchiesa, \nPapirang jokjok. \n\n3. Anga maiko agankuna? \nPapirangko Jokatgipa, \nDonga Torom Ki-tapoba, \nKnasengsotokjok. \n\n4. Manderangni saako ra-e, \nChisol su-a man-chakange, \nUnon papko gimaate. \nUan jokatjok. \n\n5. Apa Gitel nambegipa, \nGisik Katchi teng-sugipa, \nNamchongmota Jokatgipa \nChu-sokgen namjok. \n\n6. Anga ka-dongbea namen, \nAngna ka-sachong-motbegen, \nSian' salo joka man-gen, \nAnga katnapjok.", 'songNumber' : 103},
  {'title' : 'JISUNA RASONG',
  'song' : "1. Jisuna rasong, ching Jokatgipa, \nJisuna rasong, ching' ka-saa Una; \nUko katchae mandera-bea, \nJisuko ring-e salgio gita. \n\n2. Jisuna rasong, sakgipin' rimna, \nUna ka-sana aro git' ringpaa; \nNeng-gipa', branggipakoba man-na; \nHai, an-ching u'mangko okamjringna. \n\n3. Jisuna rasong, Nirik', Dilgipa; \nChingni ka-tongko katchaatjringna; \nUni sichaka aiao inmana', \nUan tangpilenga 'ne katchae ring-na. \n\n4. Jisuna rasong, oe, rasong' on-na, \nUn' ka-saako aganna ching' ring-a; \nDa-o aro jringjrotna de-mitela; \nJisuna rasong, jringjrot ong-china.", 'songNumber' : 104},
  {'title' : 'KNABO, JISUN\' KATTAKO',
  'song' : "1. Knabo, Jisun' katako, \nAng' ramako re-babo; \nAng ramako re-osa, \nSuk nokko man-gen ina. \n\n2. Papni pari dakoba. \nNamatginok ukoba; \nAn-seng baljoka jeo, \nJringjrot donggen salgio. \n\n3. Angchi re-bajaode, \nMan-jawa suk nokkode; \nPapni pari namjawa, \nNorok 'niba jokjawa.", 'songNumber' : 105},
  {'title' : 'GITEL JISUN\' BIMUNGKO',
  'song' : "1. Gitel Jisun' bimungko, \nSalni salna ring-tokbo; \nUan chingna batgipa, \nPapiko Jokatgipa. \nGitel ka-sabegipa, \nKa-sapae jokatgipa; \nUni gimin Gitelkon \nMiteltokbo salantin. \n\n2. Bebera-e Jisukon, \nGimagen dukrang unon; \nUko bebera-ode, \nSukko man-gen unode, \nGalgen nam ja gisikko; \nRa-gen Un' ge-etako; \nChijanggiko ringegen. \nUn' bimungkomitelgen.", 'songNumber' : 106},
  {'title' : 'JOKATNA SKA',
  'song' : "1. Ka-sae Nirikgipa \nRe-a a-dingko, \nNolona rimpilna \nBranggipako. \n\n(Ring-taitaiani.) \nJokatna ska,\nJokatna ska, \nBrangako Jisu jokatna ska. \nJokatna ska, \nJokatna ska, \nBrangako Jisu jokatna ska. \n\n2. Chakchike Nokgipa \nNamekai am-a. \nNoktangko itroke \nSukitangna. \n\n3. Ka-sariri Paa \nAganattoka, \nSigipa tangpila, \nBrangjawaha.", 'songNumber' : 107},
  {'title' : 'MITELA, ISOL',
  'song' : "1. Mitela, Isol: Nang-ni Deko on-jok, \nUa sienba, da-ode salgiojok. \n\n(Ring-taitaiani.) \nHalleluia! Nang ni rasong; \nHalleluia! Amen. \nHalleluia! Nang-ni rasong; \nTangchaatbo chingkon. \n\n2. Mitela Isol, Gisik seng-gipana, \nJokan cholko mesoka, walko gimaata. \n\n3. Sigipa Mesko mitelmitchutoka, \nPapni simtekarangko su srangjok Ua. \n\n4. Bimchipattokbo, ka-saan bilko on-bo \nSakoni wal chi ching gisikko ding-atbo", 'songNumber' : 108},
  {'title' : 'CHIMIK DILSA',
  'song' : "1. Chimik dilsa an-chi gape \nJisuoni joka; \nPapirang un' ning-o sripe \nPaprangko gimaata. \n\n(Ring-taitaiani.) \nAnga ra-a, da-o ra-a, \nJisu angna sijok; \nUn' gamchatbea an-chichi \nPaponi jokginok. \n2. Ua cha-u katchaa' nikna \nUnsalo chimikko; \nNamjabechim angni man-na, \nSu-srangjok paprangko. \n\n3. O ang' Gitel, Nang-ni an-chi \nPangnan bilgrijawa; \nIsolni pioka intal \nJokjok, pap dakjawa. \n\n4. Ka-dongachi nikantaltal \nNang parirang joka, \nKa-sae jokata 'ne ring-an \nOng-gen siaona. \n\n5. Nambata, knatobata git', \nUnon anga ring-gen, \nJensalo angni to-ta sre, \nGopao jrip tugen.", 'songNumber' : 109},
  {'title' : 'KRISTO PAPKO RA-CHAKJOK',
  'song' : "1. Je chel enga salgi'na, \nJisu aganattokjok, \nGa-akbabagipana, \nJisu papko ra-chakjok. \n\n(Ring-taitaiani.) \nRing-taitaibo, ring-taibo,\nManden' papko ra-chakjok. \nTalatsrangbo katako, \nKristo papko ra-chakjok. \n\n2. Paponi joktokginok; \nKa-dongbo Un' ka-saana \nJisu papko ra-chakjok; \nRe-bo, on-gen neng-takna. \n\n3. Duk on-ja angko ka-tong; \nAnga ra-a niamko; \nSimtekarang dongjajok; \nOn-jok man-na salgiko. \n\n4. Pilak pari namtokjok, \nBatesa ang' paprangban; \nJisuan ra-chaktokjok, \nNapnok Umung salginan.", 'songNumber' : 110},
  {'title' : 'DAL GIPA OJA DA O SEPANG',
  'song' : "1. Dal-batgipa Oja sepang, \nKa-sabegipa Jisu; \nDuk man-gipako katchaata, \nKu-rangko Jisun' knabo. \n\n(Ring-taitaiani.)\nKerubni nambata git. \nMandena krabata git,\nNambata mitelani, \nka.sagipa Jisu.\n\n2 Kema ong-aha nang' paprang, \nKu-rangko Jisun' knabo, \nSalgini ramako re-bo, \nJisun' mukutko stikbo. \n\n3. P'lak rasong chakatgipana, \nBebera-a Jisuo, \nNaljokatgipan' bimungna, \nAnga ka-saa Jisuna. \n\n4. Un' bimung kenako gala, \nGri Jisun bimungna gre; \nKnae ang gisik katchara, \nNambata bimung Jisun'. \n\n5. Nitoa salgi'na sokon \nGronggrikna ang' Jisukon; \nKa-sae singhasonko dule, \nMitelgen Un' bimungkon.", 'songNumber' : 111},
  {'title' : 'O MAIKAI JOKATGIPA!',
  'song' : "1. Kristo ang' papko ra-aha; \nO maikai Jokatgipa! \nNambee angna chol' oaha; \nO maikai Jokatgipa! \n\n(Ring-taitaiani.) \nO maikai Jokatgipa! \nGitel, angni Gitel! \nO maikai Jokatgipa! \nGitel Jisuan. \n\n2. Ang' janggiko piokaha; \nO maikai Jokatgipa! \nUni an-chichi tslata; \nO maikai Jokatgipa! \n\n3. Paponi angko su-sranga; \nO maikai Jokatgipa! \nDa.o uan Raja ong.a; \nO maikai Jokatgipa! \n\n4. Uan angko amatgipa; \nO maikai Jokatgipa! \nMajoao cheatgipa; \nO maikai Jokatgipa! \n\n5. An-tangko Una pakwatjok; \nO maikai Jokatgipa! \nA-gilsak angko amjajok; \nO maikai Jokatgipa!", 'songNumber' : 112},
  {'title' : 'NAMJOKMA AN-CHIO',
  'song' : "1. Rongtaljokma na-a Jisun' an-chichi? \nKristoni an-chio aue? \nKa-dongjokma da-o na-a Uana, \nNikemung paptangko rongtala? \n\n(Ring-taitaini.)\nNamjokma, an-chio, \nNang-ni induria parirang?\nNang-ni ba-ra namen rongtalsrangjokma, \nSu-srange Jisuni an-chio? \n\n2. Dongengama na-a Jisun' sepango, \nMan-jokma rongtala an-chichi? \nNa-a Uchin ka-dimeengamade, \nMan-emung rongtala an-chichi? \n\n3. Chawari re-baon ba-ra bokgenma, \nJisuni an-chio su-srangen? \nTariama Salgichina re-nade, \nKristoni an-chio rongtale? \n\n4. Galattokbo papni namgijarangko, \nTalsrangbo aue paponi; \nJokenga nang-na chimik dilsa uno, \nRongtalbo aue paponi.", 'songNumber' : 113},
  {'title' : 'SOTSKU MANGSKU',
  'song' : "1. Sotsku mangsku kenani gri \nNolni ning-o dongachim; \nMangsa a-brichi brangaha, \nChel-achi brangbeaha; \nAiao, rong-grim, a-bimandu! \nChel-beaha Rakualoni. x2 \n\n2. Gitel, Nang-mung sotsku mangsku, \nChu-ongkujama Nang-na? \nIndiba Rakual agana, \nIa branggipa Angnin. \nRama ga-nangjabeoba. \nA-brichi Ang' mesko am-egen  x2 \n\n3. Piokgiminni giseponi \nMangsaba uisokjachim, \nBadita andala, chi tu-ako, \nGitel re-pretangaha, \nBakrachini mes ma-ama, \nSae nom-boke sinakengaha.  x2 \n\n4. Gitel,an-chi baoni ong-a \nA-brini ramajoljol? \nBranggipako rimbapilmiting, \nRakualni an chi ong-a, \nGitel, Nang-ni jak' maikai mataha? \nDa-walo bu-su bu-beaha.   x2\n\n5. Pilak a-bri bretgiminoni, \nAro a-kuangoniba, \nSalgiona a-bokaha, \nKa-srokbo, man-pilaha! \nSa-grerang inchakpilaha, \nKa-srokbo, Gitel man-pilaha!   x2", 'songNumber' : 114},
  {'title' : 'A-KAWEO BALGIPA PUL',
  'song' : "1. Balgaojok a-kaweo pul, Chi' similbegipa; Angni janggi ka-sroka Un' bibana! \"A-kaweo balgipa Pul.\" \nAngko mikaoata, \nAng' papni marangko rongtalatsranga. \nKa-tongko katchaata, \nJajrengarang bon-a, \nRuraan' salona Uan ang' Danil \n\"A-kaweo balgipa Pul.\" \nPringprangnaba bata; \nHajalrangna bate angna nambata.  \n\n2. Angni paprangko ripee, \nDukko ra-chaktokjok. \nRuraan' salo angni nape chakram nok;\nOn-manjok Unan an-tangko \nWate miterangko.\nAn-tang bilni ning-o angko rakia.\nA-gilsak angko wato\nSatan ruraoba,\nSokgen Jisun' dongram ariona;\n\"A.kaweo balgipa Pul.\" Teng-a Pringprang gita,\nHajalrangna bate angna nambata.\n\n3. Man-manjok Ripeng Jisuko, \nGamchatbatbeako,\nOn-mangen tom tomo patianiko \nChijanggin' chi ka-sinbea, \nNagen bibaloni,\nAng' jringjrot' janggi okkagen mannachi. \nNikegen Un' bimangko,\nKatchabeengako,\nChipakkorerangko badeangmano;\n\"A kaweo balgipa Pul,\" \nPringprangnaba bata,\nHajalrangna bate angna nambata.", 'songNumber' : 115},
  {'title' : 'MES BI-SANI AN-CHI',
  'song' : "Namchong ang' Gitelni an-chi, \nA-gilsakna Sichakgipa; \nNamchong Isolni Depante; \nPaponiko Jokatgipa. \nNoloni chel e brangangon, \nAng ka-tong duk saknabeon; \nUn an-chiosan su-srangbo, \nSuurina bate bokskagen! \n\n(Ring-taitaiani.)\nSuurina bate, \nSuurina bate, \nSu-srang' Mes Bi san' an-chio, \nSuurinaba bokbatsrange.\n\n2. Bu-sun mukutko Ua stikjok, \nChisolo Un' be-enko on-jok; \nDuk saknaako Ua chakjok, \nIndinde sigramaijajok. \nDilbo Un' an-chi chiringna \nPapko su-srange talatna; \nUn' an-china 'gre gipin gri, \nSuuri gita bokatpana. \n\n3. Apa, brangbejok Nang-oni, \nKa-tong chel-jok Nang ka saoni; \nAng' pap namen gisimsrangjok, \nChichi su-srangna taljajok. \nGitel, Nang' chisol sepango, \nBamgope anga mol-mola; \nSu-srangpabo Nang' an-chichi. \nSuurinaba bokbatsrange.", 'songNumber' : 116},
  {'title' : 'UN\' RE-BAON',
  'song' : "1. Un' re-baon, Un re-baon, \nAn-tangni mandeko \nChimongna gamchatbea \nUn' ka-saarangko. \n\n(Ring-taitaiani.)\nPringprang gita nitoa \nUn' skoo stiknaha;\nNitoa ching begipa\nUni mukutna.\n\n2. Uan chimonggen, Uan chimonggen, \nGamchata Songnok na, \nKa-sara Un' rongtala \nPilak mandekon. \n\n3. Bi-sa chongiparang, Una \nKa-saarang, u'mangba \nUni mukut gamchatbea \nUni namnika.", 'songNumber' : 117},
  {'title' : 'AGANGEN JISUNA',
  'song' : "1. Agangen Jisuna ang' dukrangko, \nMan-ja balko ripena saksan; \nAng' amjaengo Ua dakchakgen, \nUa ka saa, simsakenga. \n\n(Ring-taitaiani.) Agangen Una! angni Jisuna! \nMan-ja balko ripena saksan, \nAgangen Una! angni Jisuna! \nDakchakgen Jisu'n, dongja gipin.\n\n2. Majoa man-on Jisuko nanga, \nAngni bojako chilchakpana; \nAgangen Una! angni Jisuna! \nAng' duk, suk salo chakrimgipa. \n\n3. O a-sak maikai majona senga, \nO angni ka-tong papna sina; \nAgangen Una! angni Jisuna! \nDakchakgen Ua a-sak chena.", 'songNumber' : 118},
  {'title' : 'SHARON GOLAP',
  'song' : "1. Ring-bo Sharon Golap git' angna. \nBibalrangni nitobatgipa; \nUa song sagal nalsao, \nJisun' ka-san' chin mesoka. \n\n(Ring-taitaiani.)\nSharonni Golap balgaoenga, \nJisu ian Nang' ka-saani chin; \nNitogipa Pulni bibal, \nDa-o man-jok Nang-ko, Sharon Golap.\n\n2. Re-angjok Janggin' rong-brak rama, \nBranggipa mesni branga gita; \nNikja' kingking biap damsa, \nJeo bala Sharon' Golap.\n\n3. Balkubo mesokatbo rama, \nUa biap jringjrotni dongram; \nJe'n chu-sokgen ang' ka-tongo, \nJringirot pangnan Sharon' Golap.", 'songNumber' : 119},
  {'title' : 'BEBEO RE-DILGIPA ISOL',
  'song' : "1. Samtangtango bobilchek, \nRe-na namja a-rongsrek; \nRe-mitingo a-sakko \nIsol donga sepango. \nNeng-e brangenggiparang \nKnae katchagen Un' ku-rang \nUa ina \"Ja-rikbo \nSukko man-gen Ang' noko\".\n\n2. Ripeng chong-mot ong gipa \nSakprakprakko Dilgipa, \nChing' rama andaloba; \nKa-dongaibo unoba. \nJajrengarang duultokon, \nJanggin kenani ong-on, \nUa ina \"Ja-rikbo \nSukko man-gen Ang' noko\". \n\n3. Ruraanirangko cheon, \nJokatani sokbaon, \nJanggi man-na ka-dongon, \nSalgio bimung dongon. \nJisun an-chi su-srangna \nKema ka-a papko watna; \nJisu ina \"Ja rikbo \nSukko man-gen Ang' noko\".", 'songNumber' : 120},
  {'title' : 'JISU SHARON GOLAP',
  'song' : "1. Jisu Sharon Golap, bal' ang ka-tongo \nKakket rongtala, on bo nitoao; \nAng' jeoba dongbo, gipchina p'lakchinan; \nKa-saani simila gun Isolnisan. \n\n(Ring-taitaiani.) \nJisu, Sharon Golap, \nBalgao ching-e ka-sa'ni ang ka-tongo. \n\n2. Jisu Sharon Golap, nitoa angna, \nBata a-gilsakni pilak bibalna; \nNang' rongtala, ka-sachakani bilchi, \nGapatbo ang' janggi tangao salanti. \n\n3. Jisu Sharon Golap, samra-sampilna, \nNang' rinoka ka-saachi saako namata; \nBal jrime neng-skimgipa janggirangna, \nAn-senga, ka-donga, ama on-taina. \n\n4. Jisu Sharon Golap, balgaobo pangna, \nNang rasong nikchina, a-kitikona; \nJatantiko Na a sason ka kujana, \nChoknoke Nang' ja-o olakijana.", 'songNumber' : 121},
  {'title' : 'NAMGIPA GISIK, PAROA',
  'song' : "1. Namgipa Gisik, Paroa, \nAngona bilbabo; \nAngade, gisik namjabe, \nNa-asa namatbo.\n\n2. Chanchie gamna, rangnasa, \nDakari namgija; \nJanggiko jok'na chanchina \nGisiko nanggija.\n\n3. O Gitel racha indake \nDongchagen basakna? \nNa-ade angna ka-sara, \nUako uina. \n\n4. Namgipa Gisik, Paroa, \nDongpabo angoba; \nIsolna anga ka-saode, \nJokpagen angaba.", 'songNumber' : 127},
  {'title' : 'GISIK RONGTALBEGIPA',
  'song' : "1. Gisik Rongtalbegipa. \nAng' ka-tongo teng-subo; \nChel-atbo andalako, \nSeng-atbo ang' gisikko.\n\n2. Nang-ni bilchi talatbo \nAng' marang gnang ka-tongko; \nAngni ka-tongo ruutjok, \nPaprangan gitel ong.jok.\n\n3. Gisik Rongtalbegipa, \nKa-srokatbo ang ka-tong'; \nAng' dukrangko chel-atbo, \nMatarangko namatbo\n\n4. Gisik Rongtalbegipa \nAngo dongkambo pangnan; \nP'lak namgija skarangko \nPe-ate raja ong-bo.", 'songNumber' : 128},
  {'title' : 'ISOL, GISIK,ANG KA-TONGO DONGBO',
  'song' : "1. Isol, Gisik, ang ka-tongo dongbo; \nPapna ka saaoni angko salbo; \nAng' bilgriako bilakatsrangbo; \nNang-na krae ka-sana dakchakbo.\n\n2. Dil-dil ong-gnirangko Nang-o bi-ja, \nMikjumangrangko anga dabija, \nSa-greni re-baako nichaksoja; \nKa-tongni dimela' gimaat' kosa.\n\n3. Nang ka-sabo 'ne, Na-an ge-eta, \nKa-tong gimikchi Nang-na ka-sana. \nChisolko nie, uo ma-gapna, \nNang-ko am-eon, on-pabo man-na.\n\n4. Nang ni sepang'ko uijringna on-bo, \nGisiko dakgrikon chelchakkubo, \nNang-na bamjana skako chel-atbo; \nChakchikako Na-an angna skibo.\n\n5. Sa-grerang gita Nang na ka-sana; \nAn-saoatbo, ang gisikko, Na-a. \nNang' ganchini wal-sare, Nang' ka-saa, \nBolian angko Nang-na on-kanga.", 'songNumber' : 129},
  {'title' : 'ISOL KA-SAA, ISOL RASONG',
  'song' : "1. Isol ka-saa, Isol rasong, \nOn-bo bil Mondolina; \nChengo gita nang' manderang, \nChena nitoe balgaona. \n{On-bo seng-a, bil, ka-donga, \nIa sal mikkangchakna.} x2\n\n2. Nibo maikai ching' changduula, \nRa-bie Nang' bebe rama; \nKena, jajrengan chipaha, \nJoka kamna mitelna. \n{On-bo seng-a, bil ka-donga, \nIa sal mikkangchakna.} x2 \n\n3. On bo ching' kim kim chadengna, \nKristian silchidareo; \nSakgipinrang jokan' kamna, \nKristo gita ka-saao. \n{On-bo seng-a, bil, ka-donga, \nIa sal mikkangchakna.} x2", 'songNumber' : 130},
  {'title' : 'ISOL MANDEKO OKAMA',
  'song' : "1. Isolni Sunduk sambao, tuengachim walsao, \nKa-atna an-tang kamko, okamjok Samuelko; \n\"lakai Gitel anga, maina Nang' nokol knara,\"\n Donjok nang ko Ang' kamna, katchinike aganna. \n\n2. Ua gita changsao, chanchisogija' salo \nOkamjok Gitel nang-ko, ka-atna an-tang kamko; \nPakwatako mesokna, Uni kamko ka-china, \nBamgopaton jak donna, patiani ong-china. \n\n3. Champengna ia 'a-sako, amja Gisikni bilko, \nIsolni mangsongako, nikja je ning-tuako; \nOn-enga Ua bilko, jakkalchong Nang' salrango, \nPilak nang-ni kamrangko, ra-chakchina salgio.", 'songNumber' : 131},
  {'title' : 'ON-KANGANI',
  'song' : "Dem-a ang' ja-chik Gitel Nang-na, \nManden' bilgrianirang baksa; \nMaina sia Adamo p'lakan, \nMan-pila janggi Jisuosan.\n\n(Ring-taitaiani) \nRa-bo da alon angko chu-gimik, \nKraatbo Nang' kamrangna; \nGapatbo ang' ka-tongo, \nGisik Rongtalgipako. \n\n2. Dondapon Nang' nokkolrangni jak,\nSokbachong Gisik Rongtalgipa;\nSu-srange rongtalatna papko,\nBilakatna bilgrianiko.\n\n3. Dil-dil ong-gnirang ang' ramao \nA-sak katchaanina ka-pako; \nDakchakbo on-e teng-suako, \nNikna Nang-ni kakket ramako.\n\n4. Ong atbo Gitel Nang’ nokkolko, \nChing-enggipa chakki andalao; \nTeng-suna brangenggiparangna, \nMesokna rama Nang' nolona.", 'songNumber' : 132},
  {'title' : 'RE-BACHINA NAMA KATA',
  'song' : "1. Re-bachina Nama Kata \nA-chikrangni songona, \nA-song kosi bisikrangko \nGalatbo, kratcha-china. \n\n2. Mande aro kamalrangba \nRa-tokchina Jisuko; \nMiterangni bilakakol \nChel-beachi galatbo.\n\n3, A-chikrangba. A-jongrangba. \nU-ichina bebekon; \nPaprangoni joktokemu \nRing-tokchina ku-cholsan.\n\n4. Nama Kata re-bachina, \nDarang song songantina; \nTol-a kamal, tol-a mite. \nGalatbo, kratcha-china.", 'songNumber' : 135},
  {'title' : 'JANGGINI KATTARANG',
  'song' : "1. Angna pil-e ring-taibone, \nJanggini Kattako. \nNitobeako nina 'ne \nJanggini Kattako. \nKnatobea Katta \nKa-dongako skia, \n{Knatobea, aiao ina, \nJanggini Kattarang.} x2 \n\n2. Kristo pilaknan on-enga \nJanggini Kattako. \nPapi, knabo Un' ku-rangko, \nJanggini Kattako. \nIndin ka-sae on-a, \nSalgiona sala, \n{Knatobea, aiao ina, \nJanggini Kattarang.} x2\n\n3. Okamako aganskabo. \nJanggini Kattako. \nPapko watani inprakbo \nJanggini Kattako. \nJisu Jokatgipa, \nPangnan rongtalatbo; \n{Knatobea, aiao ina, \nJanggini Kattarang.} x2", 'songNumber' : 136},
  {'title' : 'SASTRO KATTA ISOLNI',
  'song' : "1. Sastro Katta Isolni, \nGamchatgipa gam angni; \nAngan baoni aganna, \nAngan maia mesokna.\n\n2. Angko brangao manengna, \nUn' ka-saako mesokna; \nGol-dik, danil, Na-an angna \nBa boksis ba sastina.\n\n3. Dim-dimatna ang' duko \nRe-miting a-rongsrekko; \nAma 'ne skina angko, \nBebera-e siako.\n\n4. Ong-gni sukko aganna, \nSengsoa 'ne duk papina; \nSastro Kata Isolni, \nGamchatgipa gam angni.", 'songNumber' : 137},
  {'title' : 'PORAIBO BAIBEL\'',
  'song' : "1. Poraibo Baibel', rongtalgipa Ki-tap. \nJisun' Katta' da-jakwat gamchata; \nMikrakatgen tusigipa manderang'. \nKu-rachaka tangchagen janggiba.\n\n(Ring-taitaiani.)\nPoraibo Baibel', Poraibo Baibel', \nNang janggi ong-gen unon jakgitel.\n\n2. Poraibo Baibel', an-chingni gam janggi \nGa-akgipako jokatna ama; \nUn' gamchata hajal tangkana bata, \nGimagimin janggi' man-pilata.\n\n3. Dal-a' chonakoba re-dilna tochri, \nBranggipa nangja kenna wal-mindik; \nGimagimin papina ka-dongani \nNambatgipa Ki-tap aro gol dik.", 'songNumber' : 138},
  {'title' : 'ISOLNI NIAMRANG',
  'song' : "1. Angna 'gre dongjachina \nNang-ni gipin mite; \nMamung bimang dakako \nOlakitoknabe. \nIndinari da ra-a, \nIsolni bimungko \nRongtala 'ne manibo \nNeng-takani Salko.\n\n2. A-sako ma-'ko paako, Tango mandera-e, ind \nJanggi donga mandeko, \nSo-ote galnabe. \nRakkibo janggi tangao, \nAn-tangko rongtale, \nBeng-a naa til-eknabe; \nNa-a cha-unabe.\n\n3. On-nabe saki tol-e, \nSongsulko miknenge, \nGipinni mamungnaba \nTangnabe mikboke. \nNang' bil, gisik, ka-tongchi \nKa-sabo Gitelna, \nAro an-tangna gitan, \nKa-sabo songsulna.", 'songNumber' : 139},
  {'title' : 'DAUDNI SKANGGIPA GIT',
  'song' : "1. Chanchi' Torom Ki-tapko \nWalang salang gisiko; \nUko namnikgipana \nIsol ka-sara una.\n\n2. Namgijamu ku-mongja, \nOniako dakpaja; \nMitakgipa baksade \nAgangrikja uade.\n\n3. Chisamo bol chagipa \nJakrurongja pangnaba; \nUa bol gita chachan \nToromini suk pangnan.\n\n4. Bebu balponga gita, \nKena papi ugita; \nBichal ka-an salode \nJokjawa papirangde.\n\n5. Papin', toromin' rama, \nDingtanggrike dakanga, \nToromin' Janggichina, \nPapini gimaachina.", 'songNumber' : 140},
  {'title' : 'BARTIMIAKO NIKATA',
  'song' : "1. Ka-sapabo'ne Daudni De \nJisu, ka-sabo angna; \nIndi' ine okamatjok \nBartimia saksa kana.\n\n2. Uko p'lakan beng-tokaha; \nBeng-akoba mingjaha. \nJisu uko okamate, \nMaiko nanga sing-aha.\n\n3. Bi-amesa cha pae donga, \nIndiba gamko nangja; \nKa-sae mikronko namatbo \nGitel, ukosa nanga.\n\n4. Jisu ka-sae aganatjok, \nJeko bi-a on-atgen; \nIndi' inon mikron nikjok, \nJisu baksan re-angjok.\n\n5. Knatimtokbo, O kanarang, \nJe mande Uo bi-gen, \nUan man-gen mikronkoba \nPaponiba jokpagen.", 'songNumber' : 141},
  {'title' : 'ISOL OKAMENGA',
  'song' : "1. Isol okamenga, \nO manderang; \nMaisa ka-tokenga? \nO ripengrang.\n\n2. Isol okamenga, \nNachil songbo; \nMande ong-pajama? \nGisik on-bo.time\n\n3. Isol okamenga, \nO ka-dongbo; \nKa-onangbeoba; \nSigen, kenbo.\n\n4. Isol okamenga, \nSal re-angjok; \nCholko da-wataha, \nJaroangjok.", 'songNumber' : 124},
  {'title' : 'RE-BABODA NOKTANGONA',
  'song' : "1. Re-baboda Noktangona \nBrange bano dongenga; \nNang-ni balrang jrimbeoba, \nRe-ba man-gen neng-takna.\n\n(Ring-taitaiani) \nOkamenga, Paan' Nokona, \nJokatgipa ka-sae an-chingko; \nRe-bagija chakchikode, \nGimagen nang' janggide. \n\n2. Gisik pil-e re-baode, \nGitelan rimchaksoa; \nBebe ra-e mol-molode, \nSalgin' sa-grerang katchaa.\n\n3. Oe, na-a jekai tangenga, \nRe-ba Jisu sengenga; \nDuk, mikchin' wario sripe, \nDongchagenma indake.\n\n4. An-senge donggen ua songo, \nMan-e janggin' tom-toma; \nAn-tangko on kanggipako, \nJanggikon jokatsranga.", 'songNumber' : 143},
  {'title' : 'ANGA AM-JA AN-CHI, KIMIL',
  'song' : "1. Anga am-ja an-chi, kimil, \nAm-ja tangka, sonako, \nGisik name bi-akosa, \nAm-a manden' gisikko.\n\n2. Nang-ni kritana batkale \nAngan an-chi on-chakjok; \nAngchi re-bae jokbo, papi, \nNang-ni re-ade norok.\n\n3. Gisik on pabo, papirang, \nOn-pabo gisik name; \nIsol ka sachakpaenga, \nIsol jokatmanchagen.\n\n4. Iandake mol-molesa, \nOkamenga pilakkon; \nRe-batokbo Isolona, \nChakchikode siaigen.", 'songNumber' : 148},
  {'title' : 'JE CHOLGUGA JE CHOLRAMAR',
  'song' : "1. Je cholguga, je cholrama, \nNamgijachi dakanga, \nUa nambea, apala, \nPilak uchi re-anga; \n{Pilak papi siangode, \nNorokosa dongea.} x2\n\n2. Je cholguga, je cholrama, \nSalgiona dakanga, \nUa cholrama apchangket, \nUko re-gipa bang-ja; \n{Indiba ua siode, \nSagiona re-anga.} x2\n\n3. Dakna skangan Dakgipaan, \nDonjok Una niamko; \nPapina duk,torom'na suk, \nIndake sina nangjok: \n{Watatemu Depantekon, \nGimaatjok paprangko.} x2\n\n4. Uni gimin katnaptokbo, \nSichakaha Jisuan; \nImbo ra-na re-batokbo, \nGisik nange Jisuko. \n{Ka-sae rimanggen Jisuan, \nBiap on-gen salgion.} x2", 'songNumber' : 149},
  {'title' : 'JISUN AGRE JOKATGIPA',
  'song' : "1. Papni gimin kengiparang. \nJisuona re-babo; \nPilakkoba Jokatgipa \nJisunasa ka-dongbo; \n{Chingni Gitel Jisun' agre \nJokatgipa dongjajok.} x2 \n\n2. Janggitangko on chakemu, \nChingni papko ra-chakjok; \nMarang watna sichakemu, \nManderangko jokatjok. \n{Chingni Gitel Jisun' agre \nJokatgipa dongjajok.} x2\n\n3. Uni ka-saako uiemu, \nKatnapebo Uona; \nNorokoni katbaode, \nJisu ama jokatna. \n{Chingni Gitel Jisun' agre \nJokatgipa dongjajok.} x2", 'songNumber' : 150},
  {'title' : 'AN-CHION BIL',
  'song' : "1. Pap baljrimaoni jokpagenma? \nUn' an-chion bil, an-chion bil. \nNamgijako amsrange chegenma? \nAiao inmana an-chin' bil.\n\n(Ring-taitaiani.) \nUn' an-chion mairongpile bil, \nMes Bisan' an-chion; \nAiao mairongmanpila Un' bil, \nGamchatgipa Un' an-chion.\n\n2. Man-genma duk jajrenga gri dongna? \nUn' an-chion bil, an-chion bil; \nRe-ba' skobikrok an-chin talatna, \nAiao inmana an-chin bil.\n\n3. Suurinaba bate bokbatgenma ? \nUn' an-chion bil, an-chion bil; \nPapni dakrangba rongtaljawama? \nAiao inmana an-chin bil.\n\n4. Raja Jisuna kamko ka-genma ? \nUn' an-chion bil, an-chion bil; \nUko miteljringna na-a donggenma ? \nAiao inmana an-chin' bil.", 'songNumber' : 151},
  {'title' : 'PAPIRANGA',
  'song' : "1. Re-batokbo, papiranga, \nJisunasa ka-dongbo. \nPapirangko okamenga, \nImbo re-bae jokpabo. \n{Jisun' agre \nPapirangde jokna gri.} x2\n\n2. An-chitangko on-chakenba, \nMairongpile duk man-jok! \nUkon mande ra-tokenba, \nJringjrot duk'ni joktokjok. \n{Jisu saksan \nPapirangko jokata.} x2", 'songNumber' : 152},
  {'title' : 'O NENG GIPA, RIPEGIPA',
  'song' : "1. Jongada, ka saa ripengrang, \nMa-de,ma-jong, noabirang, \nKnatimtokbo, angni ma drang, \nGam-ako, Gitelni ku-rang.\n\n(Ring-taitaiani.)\nO neng-gipa, ripegipa, \nKangal, cha asibegipa: \nDa-alon nang-ni jokani sal, \nDa-alon nama ra-chakan' sal.\n\n2. Ka-sariri Jisu ina, \nMaina na-a jajrengenga? \nJekai donga, jekai ong-a, \nRe-babo, na-a, Angona.\n\n3. Kana, kora, mikgri, ku gri, \nMandesal aro gisik gri, \nRe-babo na mang Angona; \nAnga ama jokattokna.\n\n4. A-gilsako tangmitingo, \nJokan' cholko on-mitingo, \nKatnapjaode Jisuona, \nRe-na nanggen norokona.", 'songNumber' : 153},
  {'title' : 'O BRANGGIPA JONGADARANG',
  'song' : "1. Obranggipa jongadarang, \nTusigipa songni dedrang, \nGisik pil-e mikraktokbo, \nHikhikari niniebo.\n\n2. Re-guale bol gri songko, \nGe-a bitchil, papni bolko; \nTusigipa songni dedrang, \nIanjama an-ching kamrang?\n\n3. Kratcha-anian andapa, \nRasong onan, be-eno pina, \nO branggipa jongadarang, \nRe-bapilbo, ka-saarang.\n\n4. U'mangni rasong krat cha-an, \nUamangni Isol okan; \nGimaan u'mangni chon-kama, \nIan chingni dakanima?\n\n5. A.namgija, a-rongsrekchi \nRe-nabene, sian' jolchi, \nO branggipa jongadarang, \nTusigipa songni dedrang.", 'songNumber' : 154},
  {'title' : 'ISOL KA SAE OKAMENGA',
  'song' : "1. O angni ka saa ripengrang, \nAndalao donggiparang, \nIsol ka-sae okamenga, \nRe-babo, na-'mang. Angona.\n\n2. Pante aro chonakoba, \nAro budeparangkoba, \nOng-ja Ua okamjade, \nBatesa agana, ka-sae.\n\n3. Re-babo, na 'mang, Angona, \nAnga ama jokattokna; \nBiap bang-a Angni songo, \nSukko man-gen na 'mang uo.\"\n\n4. Iandake okamenga, \nImbo, re-na Uanona; \nIndake okamana 'gre \nAro maiko nangpitide?\n\n5. Watbatokbo andalako, \nAro Satanni kamrangko; \nDongmitingo a-gilsako, \nSebo na-mang janggitangko.", 'songNumber' : 155},
  {'title' : 'NA-A SANA KENA ?',
  'song' : "1. Na-a sana kena? \nAganboching angna. \nNisigipa be en a ako, \nMaina una kena?\n\n2. Dikdiksa papni suk, \nPangnan be-enni duk. \nIsoloni na a kate, \nDukni baksaba duk.\n\n3. Jisuona re-bo \nNamgijako watbo, \nJanggi, be-en, Jisun' jako \nUnasa kenbebo.\n\n4. Grapmanggasiange, \nJisuona re-e. \nPakkretango chisol' gate \nBi-bo olakie.\n\n5. Ua ka-sagipa,\nNang-ko jokatgipa; \nRajan Raja uni bimung. \nDe Isol namgipa.", 'songNumber' : 156},
  {'title' : 'DUK MAN-GIPARANG PAPNA',
  'song' : "1. O duk man-giparang papna, \nJisuchin' re-babo. \nJrime olgipa paprangko, \nGitelchin ra-babo.\n\n2. 'Bri gita ong-oba ang pap. \nJisuchin romromgen; \nIandake mangsongosa, \nGitelde jokatgen.\n\n3. Jisuni ja-ao tugope, \nAng' papko agangen, \nNa-an papko watjaode, \nAngade gimagen.\n\n4. Giteltangko maniosa, \nBi-akode on-gen; \nGiteltango anga bi-gen; \nBi-en sichipaigen.", 'songNumber' : 157},
  {'title' : 'RE-BABO UONA NA-A',
  'song' : "1. Papi Kristoo bi-enba, \nChel-atbo kenako. \nKa-sae nang-ko nipilenba, \nJokatgen janggiko.\n\n2. Re-babo Uona na-a, \nUan sengsoenga; \nNang-ni pilak namgnirangko \nOn-na namnikenga.\n\n3. Re-babo Uona na-a, \nA-gilsakko waten, \nMaina bebera-na amja, \nWatgija uakon?\n\n4. Re-babo Uona na-a, \nKa-dimea Uon; \nDuk, sia, namgijarangba \nGimatoka Uon.", 'songNumber' : 158},
  {'title' : 'A-GILSAKNA KA PAKAMA?',
  'song' : "1. A-gilsakna ka-pakama? \nJanggitangko chonnikama? \nMandesalni gisik nama \nSo-otgipa ong-jawama?\n\n(Ring-taitaiani.) \nNibo mande! nangni salde \nRe-angenga, bate bate; \nKa-saan' salko watatode. \nMai ong-gen chon-kamaode?\n\n2. Ja-pang intal ginanggipa, \nJisu Isol Jokatgipa, \nSichakgipa, Patigipa, \nGnangchimgipa, Dongenggipa.\n\n3. U-ijae jeko daka, \nGitel una ka-sachaka. \nKatnapgipan' papko wata. \nSastroo gnang ku-rachaka.\n\n4. Jena kena, a-ning a-'sak, \nAng' de ine on-enga jak'. \nSokjawaha nang-ko a jak, \nNorokoni katbo bakbak.", 'songNumber' : 159},
  {'title' : 'RE-BABONE, JISU AGANENGA',
  'song' : "1. Re-babone, Jisu aganenga, \nJanggini Gitel ka-dimeata; \nO neng gipa, bal jrima man-gipa, \nRe-babo, Angan neng-takatgipa.\n\n(Ring-taitaiani.)\nAng na re-ba, Ang'na re-ba', \nAngona re-ba, on-gen neng-takna, \nOn-gen neng-takna, on-gen neng-takna.\n\n2. Janggina dakgrikeen neng gipa, \nNang' Gitel nang-ko okamtaienga, \nDukrang bon-gen, tang-gen, nang' kenchaka. \nRe-babo, Angan tom tomatgipa.\n\n3. O sigipa, pap' ning-o donggipa, \nGisik mikraken jajrengbegipa, \nWatsrangbo sintean'dakgrikako, \nRe-babo, Anga on-gen janggiko.\n\n4. Neng takani, tom-tom, janggikoba, \nSiaosa man gende ong-jawa; \nIndiba dao dukko man-beoba, \nSalgini sukko uiatsogen 'na.", 'songNumber' : 160},
  {'title' : 'DUK, JAJRENGA NENG-BEGIPA',
  'song' : "1. Duk, jajrenga, neng begipa, \nNa-an ong-ama? \nSaksa ina. 'On-gen, re-ba', \nNeng-takna.\n\n2 Maikai uigen? Uko u-ina \nGnangma maiba chin? \nJako, ja-o, oksambengo \nGnang parin\n\n3. Uni skoo stikamade \nRajan Mukutko? \nSonan' ong-ja, mukut daka, \nBu-suko.\n\n4. Uko ja rikode anga \nMan-genma maiba? \nBang-a kam, duk, bang-a neng-a \nMikchiba.\n\n5. Indioba watjaode, \nMaia ja-manchi? \nDuk, jajrenga grigen Jordan \nNalsachi.\n\n6. Angko rimna aganode, \nIngenma, Nangja? \nSalgi, a-a gimajaskal, \nJechakja!", 'songNumber' : 161},
  {'title' : 'JISU\'N A-GILSAKNI SENG-A',
  'song' : "A-gilsak gimaaha pap andalao, \nJisu'n a-gilsakni Seng-a, \nSal jatchin' sal gita Un' rasong ching-jok. \nJisu'n a-gilsakni Seng-a.\n\n(Ring-taitaiani.) Una re-baa, nang-na seng-enga, \nNamnambee angna naaha. \nMikgrichime, da-o nikenga, \nJisu'n a-gilsakni Seng-a.\n\n2. Uo dongkamgipan andala dongja; \nJisu'n a-gilsakni Seng.a. \nDilgipako ja riko Seng-a man-a, \nJisu'n a-gilsakni Seng-a.\n\n3. Andalao donggipa kana manderang \nJisu'n a-gilsakni Seng-a. \nUni ina gita dakode nikgen, \nJisu'n a-gilsakni Seng-a.\n\n4. Nangjawaha ina Salgio salko, \nJisu'n a-gilsakni Seng.a. \nMes Bi-san' seng-gipa Sonan' A-songo, \nJisu'n a-gilsakni Seng.a.", 'songNumber' : 162},
  {'title' : 'JISUONA BAKBAKAN RE-BA',
  'song' : "Jisuona bakbakan re-ba', \nSastroo jokan' chol' mesokaha; \nAn-ching' gisepo Ua dongenga, \nKa-sae ina re-ba'.\n\n(Ring-taitaiani.)\nKa-srok' kasrok' gronggriketokgen, \nPaponi naljokatmantokgen, \nNang' baksa, Jokatgipa, tom-gen. \nNoko surigija.\n\n2. Bi-sarang, re-bae knatimpabo, \nSakantiba ka-sroketokbo, \nKusi onge Ukon ra-tokbo, \nImbo, bakbak re-ba'.\n\n3. Da alo ching baksa donga, nibo, \nUn' Katako nachil songtokbo; \nKa-sariri ku-rangko nabo. \nDederacha, re-ba'.", 'songNumber' : 163},
  {'title' : 'O KA-SARA TU-BEAHA',
  'song' : "1. Cholguga sa oe donga? \nUo teng-subatenga, \nChisoloni teng-suara, \nJokatgipani ka saa.\n\n(Ring-taitaiani.)\nO ka-sara tu-beaha, \nAngna ua oeaha; \nAngna, angna, \nAngna oe donga.\n\n2. P'laknan Ua oe donga, \nUoni jokna ama, \nKangal ong bo, man-e cha-bo, \nP'lak jat U'niko man-a.\n\n3. Re-angboda bobiloba, \nUa oengmitingo, \nChisol' ra bo mukut' man-gen, \nKasaani namgnia.\n\n4. Chibimani nalsachide \nChisolko nangjawaha, \nJanggini mukutko ra-gen, \nSalgio ka-sabatna.", 'songNumber' : 164},
  {'title' : 'PAPI, RE-BA\'',
    'song' : "1. Jisun' okamitingo, \nPapi, re-ba' !\nNang na bi-chakmitingo\nPapi, re ba' !\nDao uko ku-rachakna,\nPapi, re-ba'. \nDa-o Uko uiani sal\nPapi, re-ba'!\n\n2. Jrime ripegipama ? \nPapi, re-ba'!\nRipechakgen Jisuan, \nPapi, re-ba'!\nJisu tol-napja nang-ko,\nPapi, re-ba!\nJisu nang-ko ra-chakgen,\nPapi, re-ba' !\n\n3. Un' mol-molako knabo,\nPapi, re-ba' !\nRa-chakbo patiako, \nPapi, re-ba'!\nJisun' okammitingo,\nPapi, re ba' !\nNang na bi-chakmitingo,\nPapi, re-ba'!", 'songNumber' : 165},
  {'title' : 'ATCHITAINA NANGA',
  'song' : "1. Jokani, seng-an' ramako uina, \nSkigipa walo, Jisuona re-baa \nJisu namedake una inaha. \nAtchitaina nanga.\n\n(Ring-taitaiani.)\nAtchitaina nanga, \nAtchitaina nanga,\nChong-motan Anga nang-na aganenga, \nAtchitaina nanga.\n\n2. Mandeni dedrang nachil songtokbo, \nJisuni inako bebera-tokbo, \nIa kata' magna ong-aijachina, \nAtchitaina nanga.\n\n3. Sukari neng-takna man-na skode, \nJokgiparangmung gitko ring-na skode. \nNa-a jringjrotni janggiko man-na skode, \nAtchitaina nanga.\n\n4. Re-anggipana na-a ka-pakama? \nSalgin' cholgugao nang-na sengenga. \nIndide knatímbo nanga katako, \nAtchitaina nanga.", 'songNumber' : 166},
  {'title' : 'UANO ANGNI BIMUNGKO SEJOKMA?',
  'song' : "Bi-ja gamsengko man-na, \nTangka ba sonako; \nSalgiko man-chongmotna, \nNang-ni nolo napna, \nNang\" Songnokni ki-tapo, \nSonani birapo, \nNa-a angni bimungko, \nSeahama uno?\n\n(Ring-taitaiani.)\nAngni bimung gnangma, \nSonani birapo? \nNang' Songnokni ki-tapo \nAngko' sepajokma?\n\n2. Gitel ang' pap bang-bea, Sagal an-cheng gita; Nang' an-chian chu-onga, \nU'rangko talatna! \nNa-an ku-chake sea,\nMuktani oikorchi, \n\"Gitchakoba nang-ni pap, \nTalatgen Ang' an-chin.\"\n\n3. Namen nitogipa Song, \nChing-begipa nokrang, \nRasongni jagringona, \nTeng-suchaka u rang, \nJeo napja ruraarang, \nNitima sa-grean, \nGimaatja songnokrangko \nUnon gnang ang' bimung.", 'songNumber' : 167},
  {'title' : 'O JISU, CHADENGGIPA',
  'song' : "1. O Jisu, chadenggipa, \nAng' ka-tong' a-palo, \nChipchange do-ga dona, \nNang-na walo salo; \nChakchike Na-an senga, \nDoktike dongkua, \nKratcha-na ang nangenga, \nNang-ko champengkuna.\n\n2. O Jisu doktikgipa, Ang' ka-tong do-gao, Nang' jak matako man-a, Bu-a bu-su Nang' skoo; \nO ka-saa, chakchikgipa, \nUina ampilgija, \nO pap, champengbegipa, \nAng ka-tong' chipchanga.\n\n3. O Jisu mol-molgipa, Ina Na'a ka-sae, Angni nang-na siako, Da-chonnikbo, dede; \nO Gitel, kratcha pile, \nKu-chake' da o bi-a, \nAng ka-tong' Nang-na oe, \nDongkampabo, Na-a.", 'songNumber' : 168},
  {'title' : 'UO KA-DONGBO',
  'song' : "1. Re-ba pap jrimgipa janggi. \nGitel ka saa bang-a; \nUn' katao ka-dongachi, \nMan-gen neng-takpana.\n\n(Ring-taitaiani.)\nKa-dongaibo, ka-dongaibo. \nKa-dongaibojok;\nUan' jokatgen, \nUan jokatgen \nUan jokat nok.\n\n2. Papni a-sel dukko man-gen \nMande a-gilsako; \nP'lakchin dukrang nang-ko duulgen. \nJokjawa iano.\n\n3. Jisuo bebera-bo na-a, \nKatchaaniko man-gen; \nUan janggi aro rama, \nNang-ko neng-takatgen.\n\n4. Gamchata patianina \nJisun' an-chi jokjok; \nSuuri gita bokatgipa \nAn-chio aubojok.\n\n5. Rongtalgipani dolona \nRasongko man-pana; \nBon-changgija sukko man-na \nRe-batokchimboda.", 'songNumber' : 169},
  {'title' : 'RAMA RE-GIPARANG',
  'song' : "1. Bachina re-a manderang. \nApchangket ramako? \nRe-ange maina man-toka, \nJinmani solako?\n\n2. Uamang Rajani ma-drang, \nDe sa-a pilakan, \nJringjrotna gamko man-paemu \nKusi ong-gen pangnan.\n\n3. Mainasa uama-dangko, \nKangalsa nikake? \nBa-ra mingnama chinako \nPilakba nikjake!\n\n4. Ramako daka mainasa, \nBu-suni jatchiko? \nRe-angjok Raja uakon, \nGalja Un' ramako.\n\n5. Nambea ramadilmako, \nMainasa re-jade? \nNorokchinasa sokanggen, \nUako re-ode. \n\n6. Gipinde grima ramara, \nRe-nara Salgichi? \nJisun' je rama apchangket, \nDongjajok gipinchi.", 'songNumber' : 173},
  {'title' : 'ME-TRA SAKCHIKUNG',
  'song' : "1. Chawarina re-chaksona \nMitam me-tra re-angjok; \nChawarini ru-utbaana \nMe-chikrangba tusijok. \nWaljatchio knasotokjok \nChawareide sepangjok, \nJe manderang to' ra-bajok, \nTochri so-e re-sojok.\n\n2. Je manderango to grichim, \nToko brena am-angjok; \nRe-bapile nikeaha, \nDo-gakode kang-sojok. \nUnon u' mang ina, grape, \nGitel, do-ga opabo, \nGitel ina, aganchake, \nNa-simang katangtokbo.\n\n3. Cheche, papi tusigipa, \nSiginiba wal gitan; \nSimsakgija dongsogipa, \nUnsalo apnikjagen. \nGrape, ka sapabo ingen; \nIsol ka-saja unon; \nAndalao dongna nanggen, \nWagam chikmijilao.", 'songNumber' : 174},
  {'title' : 'A-GILSAKKO DUBIATA',
  'song' : "1. A-gilsakni darang manderangan, \nKnatimtokbo, Rakgipa Isolsan, \nJensalo papi ong-tokbeaha, \nToromi Noako ge-etaha.\n\n2. Ka-saemung uko uiatjok, \nRingko dake dongchina aganjok. \nA-gilsakoni darang janggikon, \nIsol siatna sikjok pilakkon.\n\n3. Unsalo Isol ka-onangbee, \nSotbri salna mikkako waate. \nDubiattokjok, pilakni nokko \nTangarijok sakchet mangmang ringo.\n\n4. Jensalo a-gilsak chiarijok,\nPilakan so-so jeng jeng dongtokjok. \nDarang janggirangkon siattokjok, \nMande, matburung, do-oba jokjajok.\n\n5. Knatimtokbo, Isolni bil-jakko, \nPapirangko Un' ka-onangako. \nJe mande tangengon watja papko, \nUa man-chongmotgen Uni saoko.", 'songNumber' : 175},
  {'title' : 'INDONGA SAL RE-ANGODE',
  'song' : "1. Sal re-angjok, papiranga; \nRe-batokbo 'ne okama. \nIndonga sal re-angode, \nMan-jawaha ja-manode.\n\n2. Maina ia a-gilsako, \nA-sal gri namja biapo, \nTusidape dongtokenga? \nChakatboda, sal re-enga.\n\n3. Chibimako chobatátna, \nSengtimenga Jisu nang-na; \nUna 'grede ka-sagipa \nDongjajok pilak songoba.\n\n4. Cholcholanti re-roroe,\nOkamenga, Re-babo 'ne; \nOkamenga Paan' nokona; \nHai, an-ching re-na uona.", 'songNumber' : 176},
  {'title' : 'SATGIMINKO RAGEN',
  'song' : "1. Aganboching, gisik angni, \nSawa ja-pang, nang ni dukni? \nJe manderang jeko ge-gen, \nUa uko rana nanggen.\n\n2. Je mande namako ge-gen, \nBichal salo sukko ragen. \nNamgijako satgiparang \nOng-tokgen Norokni dedrang.\n\n3. Nama namja bitchri' ge-na \nBil donga pilak mandena, \nGitel Jisu iako ina, \nGisik rakbo ku-siktangna.\n\n4. Angni gisik, na-a maiko \nGe-aha chanchibo uko. \nNamakoma, namgijako, \nRana nanggen duk ba sukko.", 'songNumber' : 177},
  {'title' : 'JRINGJROTNA NA-A BANO DONGGEN',
  'song' : "1. Bano donggen jringjrot na-a? \nIa sing-ani nang na angna! \nNang' aganchaka mai ong-gen \nJringjrot na-a bano donggen?\n\n(Ring-taitaiani.)\nJringjrot na-a, jringjrot na-a, \nBano donggen jringjrot na-a?\n\n2. Bang-an seokjok Kristoko, \nPaponi an-pile da-alo; \nSalgi' patia u'mangna; \nBano donggen na-a jringjrotna?\n\n3. Apchangket ramako wate, \nKa-ma ramachi ong-one, \nMai ong-gen uni chon-kama? \nBano donggen na-a jringjrotna?\n\n4. An-pil' da-on bebera-bo, \nKa-dongbo Un' ka-saan' bilo, \nOng-gen katchaan' aganchaka, \nJokmanaha jringjrot na-a.", 'songNumber' : 178},
  {'title' : 'BANG JAHACHIM',
  'song' : "1. Bang jahachim da-o bebera-na, \nBang-jahachim Jisuko man-na; \nSan'ba gisik ina, \nChel-angku Gisika, \nSokbaon sal nambata \nAm-gen Nang-ko.\n\n2. Bang-jahachim, da-alon re-babo; \nBang-jahachim, da-anpilangbo; \nJisu okamengon, \nSa-grerang sengengon, \nRe-ba' bi-chakengon \nO branggipa.\n\n3. Bang jahachim, rakari batjok! \nBang jahachim, bao? soksrangjajok! \nBang jahachimoba, \nNambatja indiba, \nDuk' gima'on bon-ea \nBang-jahaoba.", 'songNumber' : 179},
  {'title' : 'SALGINI RAMAKO RE-NA',
  'song' : "1. Salgini ramako re-na, \nNanggen ja-kusan de-na; \nKristoko miksonge nina, \nNanggen Un' ja man re-na.\n\n(Ring-taitaiani.) \nRe-bo, re-bo, de-bo nang-ni ja kuko, \nMiksonge Nisanona re-bo; \nNipilnabe nang-ni janggilchiko, \nWatbo a-saknirangko.\n\n2. Salgini ramako re-na, \nOng-ja altua rama; ming \nNanggen namgijako gelna, \nSatan kotokko chena.\n\n3. Salgini ramako re-na, \nChisolan Nisan chingna, \nGisik Rongtalgipan' on-a, \nKu-cholsan bi ao chena.", 'songNumber' : 180},
  {'title' : 'PAPNI GIMIN KEMA BI-A',
  'song' : "1. Ka-sapabone, O Isol! \nAngna ka-sabone, Gitel! \nKa-saako nike katnapgen, \nGitel angkoba rimsogen.\n\n2. Ang' pap darangnan batoba, \nNa-ajokatgen indiba. \nO Jisu, Nang nan ka-donga, \nJokgen 'ne ka-donga anga.\n\n3. Su-srange galbo ang' papko, \nAng' gisik namja, namatbo. \nPapni giminan ang gisik \nMikchi chiwaring ong-ginok.\n\n4. Namgijakosa dakmanjok, \nPapnade anga kenjajok; \nJakbikpilgen Isol unan, \nUko namja maina ingen?\n\n5. Ua papnan kenbeengjok; \nIsolnasa ka-dongaijok. \nO jokatpabone, Gitel, \nPapina ka-sabo, Isol.", 'songNumber' : 181},
  {'title' : 'PAPONI JOKGEN INAKO',
  'song' : "1. Paponi jokgen inako \nKnasoe ka-dongjok; \n{Jajrengarangba gisiko, \n(Pilakan namtokjok.) x3} x2 \n\n2. Pap aro duko ga-ake, \nNorokni andalao, \n{Gitelni giminsa joke, \n(Man-pajok seng-ako,) x3 } x2\n\n3. Jokani kata gipangchong \nDarangmarangchina; \n{Salgin' mande re-batokchong, \n(Mitel mitchuchina.) x3} x2", 'songNumber' : 182},
  {'title' : 'NAMBEJOK, NAMBEJOK',
  'song' : "1.Jensalo anga katnapjok, \nKa-sagipa Jisuona; \nO, mairongpile namnikjok! \nMitelronggen Ukon pangnan.\n\n(Ring-taitaiani.) \nNambejok, nambejok, \nPapko su-srange talatjok! \nMikrakchina skiarangko, \nNamnikbea uarangko, \nNambejok, nambejok, \nPapko su-srange talatjok.\n\n2. Nama kaman chu-sokaha, \nJisunisa nokol anga; \nUan angko okamaha, \nKa-dongbejok Una anga.\n\n3. Angni gisik jamanggipa, \nDa-wat na-a namgipako, \nUan ka-sae Jokatgipa, \nMan-atgipa Salgin' sukko.\n\n4. Anga ku-rachakjok jeko, \nIsol sepang tom-tom dongna, \nDarangnaba batgipako, \nKa-dongaha man-chongmotna.", 'songNumber' : 182},
  {'title' : 'JENI PAP\'',
  'song'  : "1. Jeni pap' wataha, \nNamgija gimaaha, \nJeni papko chanjawaha. \nSabas ua mande!\n\n2. Wate namgijako, \nSintie gisiko, \nMan-e Isolni ka-saako \nDaka nama kamko.\n\n3. Done namgijako, \nDuk man-a gisiko, \nKa-donge man-jok iako \nKa-saa ka-dongako.\n\n4. Bi-ronggipa mande, \nIsol' sepang donga, \nDukni, sukni sal sokode, \nKa-dimea ua.", 'songNumber' : 184},
  {'title' : 'JOKATPABONE PAPIKO',
  'song' : "1. O Jisu, jokatpabone papiko; \nDakmanaha namgija papni kamko, \nWatnabene, Gitel, ia papiko; \nJokatpabo Nangni ka-saachi angko.\n\n(Ring-taitaiani.) \nJokatpabo, jokatpabo, \nO Jisu, jokatpabone papiko.\n\n2. Mangnamjabea anga, papi, bil gri; \nKangal papini Na-asa gam, janggi. \nGitel, Nang-ni ka-saachi jokatpabo; \nNang-na agre dongjajok a-gilsako.\n\n3. A-'sakni ma-mantini bobilrangna \nKena angni gisik salanti una. \nSatanni pilak sa-gre bahinirang, \nAngko pongsik ponggona am-a u'mang.\n\n4. Watna nanggen jensalo a-gilsakko, \nPilak rura konda dultokgen angko; \nChel-attokbo papini p'lak kenako, \nRimpabo, Gitel, Salgisakna angko.", 'songNumber' : 185},
  {'title' : 'CHATBEA AN-CHICHI',
  'song' :"1. Chatbea an chichi \nSu-srangna' ne angko, \nAnga knaenga, O Gitel, \nNang-ni okamako.\n\n(Ring-taitaiani.) \nAnga re-bara, Gitel, Nang-ona, \nChisol an-chi chiringo angko \nsu-srangchina.\n\n2. Nang' ka-saani gimin \nAngo bil bang-bea; \nGisik an-chinekrangkoba \nNang' an-chin su sranga.\n\n3. Chingni ka-tong ning-o \nKa-saani kamrangko, \nJisu an-tangan ong-ata, \nNisie paprangko.\n\n4. Gitelan an-chingni \nBil aro toromba; \nUni indake ka-saana \nMitelbo na-aba.", 'songNumber' : 186},
  {'title' : 'BRANGGIPA MES ANGA',
  'song' : "1. Branggipa mes anga, \nDongjachim noltango, \nKnachakjachim okamako, \nAro bamjahachim. \nNokko namnikgija \nSka chel-achi re-na, \nBranggipa bi-sa ong-achim, \nKa-sajachim Paana.\n\n2. Maikai Nirikgipa \nAm-aha mestangko, \nJa-rikangjok Apa angna \nBakra ba a-brina. \nOkkrienba anga \nSaksan sinasio, \nRimbaaha ka-sachakachi. \nJokatjok brangako.\n\n3. Jisu'n Nirikgipa. \nAngna ka-sae Ua. \nAn-chitangchi auate, \nRongtalatjok angko. \nBrangangako angni \nAm-e nikeaha; \nMobaaha noltangona, \nUan rakienga.", 'songNumber' : 187},
  {'title' : 'ANGKO AM-A',
  'song' : "1. Ang' Jokatgipa Bethle'mchi re-baa. \nGisolo atchie duk man-nasa; \nAiao inmanani, de mitelbo, \nAngko am-a ,angko, x3 \nAiao inmanani, de mitelbo, \nAngko am-a, angko.\n\n2. Ang Jokatgipa, Chisolni bolo, \nGroko chotchake jokata angko. \nAiao inmanani, maikai ong-a? \nAngna sia, angna! x3 \nAiao inmanani maikai ong-a? \nAngna sia, agna!\n\n3. Ang' Jokatgipa skang gita chacha, \nNoloni angni chel-e brangoa, \nChi-e ruutbee mol-molbeaha, \nAngko am-e, angko, x3\nChi-e ruutbee mol-molbeaha, \nAngko am-e, angko,\n\n4. Ang Jokatgipa ong-onbataigen; \nNama ka-donga, sal ruutangoba; \nAnga nikmangen Un' ong-onoa. \nAngna re-bae, angna, x3 \nAnga nikmangen Un' ong-onoa, \nAngna re-bae, angna.", 'songNumber' : 188},
  {'title' : 'NANG NI PAP SIMBEOBA',
  'song' :"1. {Nang-ni pap simbeoba, \nSuuri gita bokskagen.} x2\nU'rang gitchaksrangoba, \nGuuri gitagen. \nNang ni pap simbeoba, x2\nSuuri gita bokskagen. x2\n\n2. {Isolchi pil-batokbo, \nMol-molako knapabo.} x2\nKa-sachakbea Ua, \nKa-sabegipa. \nIsolchi pil-batokbo, x2\nMol-molako knapabo. x2 \n\n3. {Nang papko Uan watgen, \nUko gisik ra jaha.} x2\n'Angchi nibo, manderang'. \nNang' Isol ina. \nNang' papko Uan watgen x2\nUko gisik ra-jaha. x2", 'songNumber' : 189},
  {'title' : 'GITEL, ANGKO WATNABE',
  'song' : "1. Gitel angko watnabene, \nIan ang' bi-a; \nGipinrangko okamengon, \nAngko watnabe.\n\n(Ring-taitaiani.) \nGitel, Gitel, ian ang' bi-a; \nGipinrangko okamengon, \nAngko watnabe.\n\n2. Nang ni ka-saan' singhasono \nTom tomatpabo; \nJa-chik dem-e skimbeenga, \nAngna ka-sabo.\n\n3. Nang ni bilna ka-dongemu, \nNang-ko am-enga; \nAngni ka-tong parirangko \nAn-sengatgenma?\n\n4. Na-an ka-dimean' Chimik, \nJanggin' Nokgipa \nA-an' aro Salgi' 'sako \nSawa dongkua?", 'songNumber' : 190},
  {'title' : 'CHANGSANON PILAKNAN',
  'song' : "1 Niam'ni jokjok, katchabeani \nJisuni an-chin' papko watani! \nMata ga-akan', niamchi sao, \nKa-san' piokjok pilakko.\n\n(Ring-taitaiani.)\nChangsanon O, papi ra-chakbo, \nChu-soken jong bebera-srangbo; \nChisolko da wat, bal ga-akgen; \nKristo piokjok, chu-soken.\n\n2. Jakgiteljok, an-ching gro bon-aha, \nJisuan on jok joksranganina; \nRe-ba angona 'ne okama, \nUan an-chingko jokatsranga.\n\n3. Isolni dedrang, bimung rasongni, \nUn' ka-saan rakigen, ga-akaoni; \nOkamon tanggen siaoni, \nPatia jokatsrangani.", 'songNumber' : 191},
  {'title' : 'PAGITCHAMRANGNI BEBERA-A',
    'song' : "1. Pagitchamrangni bebera-a, \nAm-jok wa-al, patok, mil-amko, \nOh maikai rasongni Kata, \nKnaa ka-sroksrok 'ching' ka-tongo!\n\n(Ring-taitaiani.) \nPagitchamrang, bebera-ao \nHai dongkamna, sibo, tangbo.\n\n2. Pagitchamrang bebera-e, \nChakjok sasti, kaa andala' \nAn-ching dedrangba indake \nBebena sina maikai kraa.\n\n3. Pagitchamrang gita 'chingba, \nRongtala janggi tangachi, \nKa-sagen ripeng, bobilna, \nAganprakgen Nang ko kamchi.", 'songNumber' : 192},
  {'title' : 'BRANGGIPANI RE-BAPILA',
  'song' : "1. Re-ange namen grape \nKu-rachakgen; \nSalgin' bobil ong-aha, \nNang baksaba. \nDe ong-na krajabejok, \nKa-sa' Apa, \nAngko nokkol dakaibo, \nNang-ni noko.\n\n2. Angni p'lak papko watbo, \nJisun' gimin; \nAng' gisikko dilkubo, \nPil-srangchina; \nPaprang gimasrangchina \nDa-ontaltal, \nJisun' gisik dongchina \nAng' ka-tongo.\n\n3. Namgija songo dongon \nNeng-beaha; \nApan' songchi re-angna \nSikbeaha; \nNa-an angni Nokgipa, \nDilgipaba, \nAngko pangnan watnabe \nSikujana.", 'songNumber' : 193},
  {'title' : 'CHISOL\'NA ANGA RE-BAA',
  'song' : "1. Chisol'na anga re-baa, \nKangal, bilgri, mikgria; \nP'lakko jabol chanenga. \nJokako man-gen anga.\n\n(Ring-taitaiani.) \nAnga, Gitel, Nang-osa \nKa-donga, Jisu ka-saa. \nBama Nangni Chisolo. \nDa-o angko jokatbo.\n\n2. Ruutbeen ma-ambejok, \nRuutbeen pap' dakaijok, \nJisu ka-sri inaha, \nNang-ni papko wataha.\n\n3. Da-o on-a anga p'lakkon, \nRipeng, somoi, gamsengkon, \nJanggi, be-en, Nang-ona, \nNangnisan jringjrotona.\n\n4. Jisu angna re-baaha, \nAngko rongtalataha, \nAng' bilgriko chel-atjok, \nAngko bilakakatbejok.", 'songNumber' : 194},
  {'title' : 'INDIN DONGE RE-BAENGA',
  'song' : "1. Indin donge re-baenga, \nAngna Nang' an-chi jokaha; \nNang-ni re-babo inana, \nO Jisu, Nang-ona re-baa.\n\n2. Indin donge kangal, kana; \nGam, janggin' an-senga Nang-o, \nAngni p'lak nangako man-na, \nO Jisu, Nang-ona re-baa.\n\n3. Galchipgimin mande angan, \nGisiko jegrikbeoba, \nKa-tongo kengnirang donga, \nJisuonasa re-bara. \n\n4. Sengsogija re-angaigen, \nNikpilna an-sengbegen 'na. \nOe p'lak angni nangarangko \nOn-gen, Isolni Jisuan.\n\n5. Jedakoba Ua ra-chakgen, \nKema ka-gen, rongtalatgen, \nNang' ku-rachakako ra-e, \nO Jisu, Nang-ona re-baa.", 'songNumber' : 195},
  {'title' : 'KNACHAKBO, NANG\' DEDRANGNA',
  'song' : "1. Knachakbo Nang' dedrangna, \nNang-ni ja-o tugopa, \nBrangarangko ku-rachaka; \nKnabo, Apa, chingko.\n\n2. Chisolni teng-suao, \nKratcha-e matnanga' man-a, \nGisik pil-e, nango bi-a; \nKnabo, Jisu, chingko.\n\n3. Rongtalgipa Gisikko, \nChonnike, chel-atronga, \nGaorade-e skatang daka, \nKnabo, Gisik, chingko.\n\n4. Okamako jeachim, \nRamatangko re-achim, \nGisik pil-na dontongachim; \nKnabo, Isol, chingko.\n\n5. Sae an-sengpana bi-a, \nGro watana mol-mola, \nRongtalataniko nanga; \nKnabo, Isol, chingko.\n\n6. Kanaoba nikna ska, \nKaaoniba jokna ska, \nDak nangoba talna sika; \nKnabo, Isol, chingko.\n\n7. Ka-sachakani gimin \nSalgi dongani gimin, \nKnachakronggipani gimin; \nKnabo, Isol, chingko.", 'songNumber' : 196},
  {'title' : 'JISU AGANA INDINE',
  'song' : "1. Jisu agana indine, \n\"Angona re-babo, \nNengtakbo Obal jrimgipa, \nAng' ka-bako dongbo.\" \nJisuona re-baoa, \nPapi, neng-beoba, \nUo anga neng-takengon \nKatchapilsrangaha.\n\n2. Jisu agana indine, \n\"Anga indin on-a, \nJanggini Chi', nangbegipa, \nRinge tangbo, na-a.\n\" Ua chiko ringeoa, \nJanggiko man-aha, \nOkkaa man-e an-saopila, \nJisuo tangenga.\n\n3. Jisu agana indine, \n\"Seng-ani gnang Angon; \nAngko nion sal nabagen \nKa-tong andalaon.\" \nJisuko anga nioa, \nAngo sal nabaaha, \nUn' seng-ao jringjring re-gen, \nSeng-atgipa baksa.", 'songNumber' : 197},
  {'title' : 'JISU RONG-BRAK',
  'song' : "1. Jisuching’ Rong-brak ong chong, \nKatnapram chasong chasong; \nUn' oksikni an-chichi \nPapko su-sranganichi, \nJokata norok' niko, \nNikata Un rasongko.\n\n2. Niamko chu-sokatna, \nPap wata'ko man-pana, \nJakni kamari ongja, \nGrapa skima chu-ongja; \nUn' ka-sachakana 'gre, \nNaljokani gipin gri.\n\n3. Gitel jakari anga \nNang mikkangona re-baa; \nNang-ni chisolko rim-e, \nKa-sachakako am-e, \nNang-ona katnapenga, \nJokatpabo, sijana.\n\n4. Janggin' salrang batango, \nGopramo tuna nango, \nSalgisakna merao, \nBichalo Nang-ko grongo, \nJisu ching’ Rong brak ong chong, \nKatnapram chasong chasong.", 'songNumber' : 198},
  {'title' : 'JISUN\' GIMIN UIBATNA',
  'song' : "1. Jisun chisolo siako, \nJokatna angni janggiko; \nMesokpana man-chong angan, \nBate bate salantian.\n\n(Ring-taitaiani.) \nKa-sabatrorona, \nAng' Gitel Jisuna, \nUn' ning tua ka-saaniko, \nMesokjok sie chisolo.\n\n2. Jisun' gimin u-ibatna, \nUn' rongtalako nikbatna, \nUn' bimungko gamchatnikna, \nIsolni Gisik dilchina.\n\n3. Angko uni okamahaon, \nTom-tom dongna Un' sepangon, \nBatroroe u-iangna, \nAngna bilko on-pachina.", 'songNumber' : 199},
  {'title' : 'KRISTO ANGO TANGA ',
  'song' : "1. Changsao sijok anga papchi, \nNikja ba'o teng-ani! \nOn-jok seng-a, Uni Katta \nKristo ango Tanga.\n\n(Ring-taitaiani.) \nUa ango tanga, Ua ango Tanga, \nO! mairong jokatani, \nKristo ango Tanga.\n\n2. Salni ga-sun' pipraa gita, \nBibalrang balgaoa; \nJanggi, teng-a, aro ka-saa, \nKristooni re-baa.\n\n3. Ong-a bitchri, bibal janggi, \nBite'n jama bolni; \nMitel Isol, kakket, bebe, \nUn' jagring ango donga.\n\n4. Suakpilon angni ka-tong, \nOng-na Uni jagring; \nAng' gisiko chanchijringna, \nKristo ango Tanga.", 'songNumber' : 200},
  {'title' : 'BEBE RA-BO',
  'song' : "1. Re-on Gitel baksa, uni katan sengao, \nAiao mairong katchaani ramao; \nDakon Un' namnika, Donga Ua ching baksa, \nBebe ra-gipa sakprak baksa.\n\n(Ring-taitaiani.) \nBebe ra-bo, dongjajok gipin chol. \nGitelo kusi ong-na, Uo bebe ra-bo.\n\n2. Sokjawa duknirang, dongjawa skimarang, \nPatigen Uan an-ching kamrangna; \nDongja ka-o nanga, mikbu-miknenggrika, \nMan-gen patia bebera-on.\n\n3.Katchae apsano, tom-gen Un' sambao, \nRe-gen Un' baksa ching ramao; \nDakgen Un' ge-eta, Re-gen jechi wata, \nKenjawa bebera-gen Uo.", 'songNumber' : 201},
  {'title' : 'MAIRONGGIPA KA-SACHAKANI',
    'song' : "1. Mairong ka-saa knatobea, \nAnggita papina; \nGimajokchim, dao nikpiljok, \nKanachim nikpajok.\n\n2. Sikiaha ka-saan kenna, \nUan ka-dimeata; \nA-bachengon bebera-na, \nKa-saakon nikpaaha.\n\n3. Bang-a kengnirang jachio, \nAnga songrebajok; \nKa-saan angko dilbaaha, \nDilgen Uan nokona.\n\n4. Ang' rang-sita jensal tipgen \nJensal janggi watgen; \nKatchaan janggi, tom-tomani, \nU'rang ong-gen angnin.", 'songNumber' : 202},
  {'title' : 'SALGI RE-BAA',
  'song' : "1. Omaironggipa, maironggipa sal, \nGualja ang pangnaba; \nAndalan' ramao re-brange anga, \nGrongjok ang' Jokatgipa; \nMairong sontol, ka-sagipa Ripeng, \nChu-ongjok ang ka-tongna; \nKatchae ang' agana; andalan jagringrang \nTang-angjok dingtang dingtang.\n\n(Ring-taitaiani.)\nSalgi re-baa, rasongan suakpiljok! \nChisolosa angko gital dakjok, \nSu-srangjok paprangko; \nOng-ataha sal ang' wallko, \nSalgi re-baa, rasongan suakpiljok!\n\n2. Atchijok gisikchi kosakoni, \nIsol deragatachi; \nRongtal srangjok Kriston' ka-saachi, \nNambejok da o ang' janggi; \nMaironga gital ong-aha dingtang, \nRe-baon ang papni saksan; \nRa-chakjok an-tangna Kriston' Ka-sachaka; \nJokatjok, Rasong Una.\n\n3. Gnang da o ka-donga Ua salna, \nOng-bagni ang janggina; \nDongchongmota Salgio biap angna, \nNokdring mairongpilgipa; \nUa mairongpilgipa salonisa \nJeon bebera-chenga; \nDongkagipa gamrang, Aiao! Un' patiarang \nUn' jakni kamrang angna.", 'songNumber' : 203},
  {'title' : 'ISOL ANGKO RIMANGENGA',
  'song' : "1. Isol angko rimangenga, \nO, maikai katchaani ong-a! \nJe je daka, jeo donga, \nAngko Uan rimangenga.\n\n(Ring-taitaiani.) \nRimangenga, rimangenga, \nJaktangchi angko rimanga; \nOlakichongmotgen anga, \nMaina jaktangchi rimanga.\n\n2. Ang' duk man-bean' saloba, \nEden suk nokchi re-oba; \nChi namoba pokpekoba, \nUan angko rimangenga.\n\n3. O Gitel Nang' jako rime, \nRe-anggen anga katchae; \nJeba ong-chong, ring-gen anga, \nAngni Isol rimangenga\n\n4. A-gilsako kam chon-ode, \nUni ka-saachi amode, \nSiani china kenjawa, \nMaina Isol ka-dongata.", 'songNumber' : 211},
  {'title' : 'GITEL, ANGKO RAKIBO',
  'song' : "1. Jisu, angko ka-sapae, \nWatnabe a-gilsako, \nAn-tang jakchi boita rim-e, \nChibimako batatbo; \n{Gitel angko x2\nNang' mikkango rakibo.} x2\n\n2. Nang nasa ka-donga anga, \nSal sal gisik pil-atbo, \nMiteltokgen Nang-ko chinga; \nA-rikatbo satanko. \nGitel Jisun', x2\nRa-gen Nang' ge-etako.} x2\n\n3. Gitel angna ka-sapae \nA-gilsakna re-baaha; \nJokani jalang, chanange, \nSal gittam a-oaha \n{Ka-sabee, x2\nGitel re-bae dakaha.} x2", 'songNumber' : 212},
  {'title' : 'KA-SNE, GITEL CHINGKO DILBO',
  'song' : "1. Ka-sne, Gitel, chingko dilbo, \nIa grapram a-kongo; \nO Gitel, chingna on-pabo \nKenan' salo ka saako.\n\n(Ring-taitaiani.) \nDimdimatbo, dimdimatbo, \nA-rongsrek apko re-o.\n\n2. Ruran' brarang chingko nango, \nChinga ramako brango, \nNang-ni nama bon-jachina. \nRama chong-motko dilbo.\n\n3. Saani salo, saknaengon, \nSian' sal sepangbaon, \nDa-on ka-tongko olgrokna, \nDa-on janggiko kenna.\n\n4. A-gilsako janggi bon-o \nNang-ni ka-bako rimbo. \nSa-gren' kotok angko dile \nMikrakjaskal salgio.", 'songNumber' : 213},
  {'title' : 'ANG\' GITEL ANGKO DILENGA',
  'song' : "1. Ang' Gitel angko dilenga; \nAnga maiko am-kugen? \nAngko pangnan Dilgipana \nAnga maina kenchakgen? \nIsolni tom tomaniko \nAnga iano man-ronga, \n{Maina anga pangnan uia \nJisu namako daka.} x2\n\n2. Ang' Gitel angko dilenga, \nAngko ka-dimeata; \nNanga gita bilko on-a, \nJanggiko alduenga, \nAngni jaarang bilgrioba, \nAng' janggi ringna skoba, \n{Ang' mikkango ro-ongoni, \nNibo katchaani chimik.} x2\n\n3. Ang¹ Gitel angko dilenga, \nUn' ka saa maironggipa! \nKu-rachakjok neng-taka ko, \nAng' Salgini Paan' noko; \nAng' janggi siako baten \nSalgiona sokeon \n{Ang ring-ani jringjring ong-gen, \nJisu dilbaaha angkon.} x2", 'songNumber' : 215},
  {'title' : 'JISU, NANG-KO CHANCHIARA',
  'song' : "1. Jisu, Nang-ko chanchiara; \nAngko katchaata; \nNang-ni mikkangko nikpana, \nKusi ong-batbea.\n\n2. Ku-'chi ring-o, ka-a' chanchio \nNang' bimungna baten, \nMan-ja knatobatgipako, \nJokatgipa manden'.\n\n3. Gisik pil-gipan' ka-donga, \nSontolni katchaan; \nGa-akgipa', am-gipana, \nMaikai ka saa Na-an!\n\n4. Jekai chingni man-gni ong-gen \nNa'a katchaan ong-bo; \nJisu ching' rasong salanti, \nJringjrotnaba ong.bo.", 'songNumber' : 215},
  {'title' : 'MITINO UN BAKSA',
  'song' : "1. Un' mitino dongnuenga mairongpile nambea! \nUano dongpamitingengo namnambea skiata! \nA-gilsakni jajrengarang ang gisikko brangatja, \nMaina Satanni re-bao Un' mitinchi katronga, \nUn' mitinchi katronga.\n\n2 Angni janggi nom-bokengon, Uni grang'ning-chi kata, \nUno chelchaka nambea, janggini chiring joka, \nAro angko Jokatgipa angni sambao roronga, \nAgannan amsokjapila angna Uni agana, \nAngna Uni agana.\n\n3. lakosa, angni p'lak dukko Unasa agantoka; \nMairongpile Uan' chakchike knapae ampilata; \nMamung salo manengjane? Indakgipa ong paja; \nUni nikao paprangko name aganattoka, \nName aganattoka.\n\n4. Na-aba Gitelni ning o kusi ong na sikpaama? \nRe-ange mitin' Un baksa an-tangko donnupabo. \nJensalo gronggrikaoni na-a re-ongkatanggen. \nNang-ni mikkango Jisuni jagring rongchinge donggen, \nJagring rongchinge donggen.", 'songNumber' : 216},
  {'title' : 'ISU ANGKO DILANGBO',
  'song' : "I. Jisu angko dilangbo \nJanggin' sagal ta-rako; \nChi' ning-o ro-ongrang ginang, \nU'rangko chinga nikja; \nDilangani Nang-osa, \nJisu, angko dilangbo.\n\n2. Sagalni pokpekoba, \nNa-a tom-tomatgipa, \nMa-gipa bi-satangko, \nTom-tomatani gitan. \nSagalni Nokgipara, \nJisu, angko dilangbo.\n\n3. Jisu, angko dilangbo. \nIa a-gisako re-o; \nBrangatgipa bang-bea, \nJa-gitotanirangba; \nSatan angko man-na ska, \nAnga Nang-o ka-donga.\n\n4. Jensalo anga sigen \nSagal gam-ako knaa; \nAnga kenna nangjawa, \nMaina Na-a agana, \n\"Da-ken ka-dongbo ango; \nAnga dilanggen nang-ko.\"", 'songNumber' : 217},
  {'title' : 'ANGA RE-BAA GITELONA',
  'song' : "1. Anga re-baa Gitelona, \nNang-ni katchaa Salgin' Songna, \nAng' janggini Na-an Gitel, \nSichakaha, angni a-sel.\n\n(Ring-taitaiani.)\nRe-chakatjok angni songna, \nNama Kata' aganprakna, \nNang-ni an-chi, chiringona, \nSukni sagal', Nang-ni kamna.\n\n2. An saoaha an-chitangna \nMisilgenma be en' dukna? \nA-gilsakni ka-srokana \nRipingjawa gimaatna.\n\n3. Wa-alna kene du-dape \nIa nokol katgenmade? \nAnga re-baa, Gitel, Nang-'na \nSebo angko Salgin' Songna.\n\n4. Duko, suko, bilko on-bo, \nGisik' chakchikako on-bo; \nAnga re-a Salgin' songna \nKa-sroka Gitelni kamna.", 'songNumber' : 218},
  {'title' : 'KA-SAA SENG-A ANGKO DILBO',
  'song' : "1. Ka-saa Seng-a, andalbemitingon,\nDilbo angko;\nWal andaljok' ang' nok chel-beenga; \nAngko dilbo.\nAngni ja ako rakibo, nikjajok;\nChel-e nangja, ja-kuprak chu-onga.\n\n2. Pangnan ong-jachim, indake anga\nBi-rongjachim; \nNiksona skachim, ramatangko re-e;\nDa-o dilpabo. \nKatbrange roe salko re-atjok, \nSkatang dakjok, watpabone, Gitel.\n3. Indita sal Na-a patienga; \nDilangkugen,\nRama namja chi ta-rakengoba,\nSeng-jaskalna;\nPringo nikgen ka-sagiparangko, \nJerangko ruutantaltal nikjaha.", 'songNumber' : 219},
  {'title' : 'ISOLNI DE DAKGRIKENGA',
  'song' : "1. Isolni De dakgrikenga \nRajani mukutna.\nUn' an-chin' nisan balenga, \nSawa ja-rikanggen? \nDuktangko chakchikbatgipa \nAmsrange saknaako; \nChisoltangko ripegipa \nJa-rikenga Uko.\n\n2. Man-chenggipa so-otako \nGopako nikwate, \nNiksoemu Giteltangko \nJokatkal bi-aha. \nMan-miting sian'saknaako \nKemako wataha, \nBi-chakjok so-otgipana; \nSawa ja-rikpagen?\n\n3. Rasong, segimin bang-gija, \nJeo Gisik ga akjok; \nSakchigini ka-donggipa \nPangchakako u-ijok \nChisolna, wa-alna, singhona, \nRajana, kenjaha; \nGitoktangko on-jok den-na. \nSawa ja-rikpagen?\n\n4. Kotok namgipa manderang, \nBuchuma, me-trarang, \nJisun' Singhason' sepango \nMitelenga seng-ao. \nDojok Salgini chuako, \nChakchikemu dukko, \nO Isol, chingnaba on-bo \nJa-rikna u'mangko.", 'songNumber' : 220},
  {'title' : 'JISU DILANGKU',
   'song' : "1. Jisu, dilangku', \nNeng-tak' man-jana, \nRamao suk grisrangoba \nTom-tom donge ja-rikangna, \nNang’ jakchi dilbo, \nPaani Songona.\n\n2. Rama sikdikchong, \nBobil sepangchong, \nKena chingko srapjachina, \nKa-dongaba watjachina; \nBobil bang-oba, \nSongchi re-enga.\n\n3. Chelchakgipako, \nJensalo am-a, \nDakmajoao kimalon, \nAmsrangani bilko on-bo, \nSalgi' me-sokbo, \nGrapgijaramo.\n\n4. Jisu, dilangku', \nNeng-tak' man-jana, \nDilgipa chingko dilangku', \nBilakatbo rakikubo, \nPaani Songchina, \nSokangkujana.", 'songNumber' : 221},
  {'title' : 'KNATORIRI JISUN\' BIMUNG',
   'song' : "1. Knatoriri Jisun' bimung, \nBebera-gipana! \nUni dukrangko chel-ata, \nKenanirangkoba.\n\n2. Jisu balko cheng-atgipa, \nKa-tong' tom-tomata, \nOkkaata okkriako, \nNeng-ako gimaata.\n\n3. Jisu, ang' Nirikgipa, Na-a, \nAng' Ripeng ang' Raja, \nAng' Gitel, Janggi Ramaba, \nNang-ko miteljringa.\n\n4. Jisu, ang' Rong-brak Na-a ong-a, \nAng Danil, Katnapram, \nAngko chelchak Rakkigipa, \nPatiani Naram.\n\n5. Angni ka-tong bilgribea, \nMitelna changpaja, \nNang-ko talbate uimanon \nMitelna changbata.\n\n6. Nang' ka-saako parakna ska, \nDarang manderangna; \nNang' bimungni knatoara bri \nAn-saoatjringchina.", 'songNumber' : 222},
  {'title' : 'JISU NANG NI MIKKANG BIMANG',
  'song' : "1. Jisu Nang-ni mikkang bimang, \nNang' teng-suakoba, \nAng mikron nikkujaoba, \nSepangjringa Na-a.\n\n2. Nang-ko nikja, knajaoba, \nAngmung Na-an dongpaa; \nNambata biap dongjasrang \nNang-ko gronggrikramna.\n\n3. Nikgija Na-an ong-oba, \nMamungnaba kenja, \nGitel, Nangna anga ka-saa, \nNang-on ka-srokaba.\n\n4. Sia' mikron mikchipoa, \nAnga tangpiltaigen, \nNang-ni mikkangmung rasongko \nTale niksrangiringgen.", 'songNumber' : 223},
  {'title' : 'DA-ASALNA',
  'song' : "1. Gitel, knalo nanganina \nAnga bi-ja; \nRakipabo, paponiko \nDa-asalna. \nDa-asalna, da-asalna, \nRakipabo, paponiko \nDa-asalna.\n\n2. Nang' kamko kakketo dakna \nAnga bi-a;  \nKa-sana kamo, katao, \nDa-asalna. \nDa-asalna, da-asalna, \nka-sana kamo, katao, \nDa-asalna.\n\n3. Aganjana ong-gijako \nChanchigija;\nAng' ku-chil' Na-a champengbo, \nDa-asalna. \nDa-asalna, da-asalna, \nAng ku-chil' Na-a champengbo, \nDa-asalna.\n\n4. Knalo angni nanganina \nAnga bi-ja; \nAngko rim-e rakipabo, \nDa-asalna. \nDa-asalna, da-asalna, \nAngko rim-e rakipabo, \nDa-asalna.", 'songNumber' : 224},
  {'title' : 'RONGTALNA SAL RA-BO',
  'song' : "1. Rongtalna sal ra-bo, Gitelmung robo, \nUo dongkamjringbo skie katako; \nIsolni dedrangko ripeng ong-atbo. \nP'lak nang-ni kamrango patiako am-bo.\n\n2. Rongtalna sal ra-bo, a-gilsak skela; \nMitino dongbebo Jisu baksaan; \nJisuko nitaton, Ugita ong-gen \nRipengrang nang' kamon, Ugita nikgen.\n\n3. Rongtalna sal ra-bo, Jisu dilchina, \nUko katseknabe, jeba ong-china; \nKatchao kalimao, Uko ja-rikbo; \nJisuchiko nibo, Uo dongkambo.\n\n4. Rongtalna sal ra-bo, tom-tome dongbo; \nMangsonga mingprakko Una bamatbo; \nGisikni dilachi, ka-saaona; \nBakan na-a kragen kosak'ni kamna.", 'songNumber' : 225},
  {'title' : 'JISU AN.CHING\' OKAMENGA',
  'song' : "1. Jisu an-ching' okamenga, \nJanggin' sagal pokpeko; \nSalsal Un' ku-rang gam-enga, \nKristian Angko ja-rikbo.\n\n2. Jisu an-ching' okamenga, \nA-sakni gamoniko \nJean an-ching' champengenga; \nKristian Ang ka-sabatbo.\n\n3. An-chingni sukmung dukrango, \nKam ka-on ba neng-tako, \nJisu an-ching okamku'a, \nKristian Ang' ka-sabatbo.\n\n4. Nang-ni ka-sachakanichi, \nNang' okama' knachina; \nChing' Nang-ko manianichi, \nNang-na ka-sabatsrangna.", 'songNumber' : 226},
  {'title' : 'O GITEL, KRISTIAN ONG.NA SKA',
  'song' : "1. O Gitel, Kristian ong na ska, \n{Ang' ka-tong' ang' ka-tong', \nO Gitel, Kristian ong-na ska, \nAng' ka-tong'.} x2\n\n2. Nang-gitan ka sabena ska' \n{Ang' ka-tong', ang' ka-tong' \nNang-gitan ka-sabena ska \nAng' ka-tong'.} x2\n\n3. Nang-gitan rongtalbena ska, \n{Ang ka-tong', ang' ka-tong'; \nNang-gitan rongtalbena ska, \nAng' ka-tong'.} x2\n\n4. Nang-gitan ong-bapana ska, \nO Jisu, O Jisu \nNang-gitan ong-bapana ska, \nO Jisu.} x2", 'songNumber' : 227},
  {'title' : 'GITELNI BL.A',
  'song' : "1. OGitel, Salgioni,\nRa-chong bimungko Nang-ni; \nNangni Songnok jelchina; \nSongantina gipchina; \n{Ong-jok maikai Salgio, \nOng-chong indake a-o.} x2\n\n2. Salanti cha-na on-bo; \nAngni paprangko watbo; \nDakmajoaoniko \nJokatbo Na-a angko. \nBiljak Songnok, darangba \nJringjrot Nang-ni ong-china.} x2", 'songNumber' : 228},
  {'title' : 'ISOLO BI ANI GIMIN',
  'song' : "1 Ding-o salakimo gita \nBalwa balaoba, \nBi-o an-sengako man.a \nDuk jajreng'rangoba.\n\n2. An-ching jekai minitanti \nRang-sitgija tangja, \nBi-jaode sal salanti, \nGisikrangba tangja,\n\n3. Uchin Isoloni bilko \nPangnan salopronga, \nBatangon sian' chikoba, \nUchin ring choronga.\n\n4. Satan baksa dakgrikao, \nSkobikrok a-brio, \nGitel tario an-tangko \nJakkalaha uko.\n\n5. Namgipa, Gisik skipabo, \nChangja maikai bi-na; \nNangarangko mesokpabo \nChinga u-ipana.", 'songNumber' : 229},
  {'title' : 'GITEL JISU NOKGIPA',
  'song' : "1. Nibo, ku-gri dakarangko \nAmutoka pilakan; \nDa-ode nama sal re-bae, \nOlakia Jisukon! \n{Ring-tokenga x2 \nOlakia Jisukon.} x2\n\n2. Ian an-seng baljokani, \nPapirangko jokata; \nNorok' do-ga silko pe-e \nManderangko watata. \n{Nama Gitel, x2\nSawa donga Nang-gita?} x2\n\n3. Na-a je kamkoba ka-gen, \nSawa beng-gen Nang-koa? \nOng-bo ine ku-chi inon. \nRang-sa inon ong-aha. \n{Raka Gitel, x2 \nSawa beng-gen Nang-koa?} x2\n\n4. Gitel, chingni jeko bi-a, \nKnatimpabo namekai, \nSalaramni saliramna, \nJokattokbo pilakkon. \n{Pilak manden x2 \nRing-tokchina, pilakan.} x2", 'songNumber' : 230},
  {'title' : 'BI.SA JINMA SALGIONI',
  'song' : "1. Bi-sa jinma Salgioni, \nDulemu Isolko, \nJoktokemu paprangoni, \nMitele Gotelko, \nIna, nama, nama, \nNamen namchongmotgipan.\n\n2. Ba-ra bokako chinemu \nNamen nitobejok; \nPaprangoni joktokemu \nKusi ong tokbejok; \nIna, nama, nama, \nNamen namchongmotgipan.\n\n3. Ua an-senga biapo \nMaidake man-ejok? \nA-gilsakni bi-sarangko \nSawasa jokatjok? \nIna, nama, nama, \nNamen namchongmotgipan.\n\n4. Jisu an-tang an-chitangko \nOn-chakani gimin, \nUo katnapgiparangko \nJokatani gimin, \nIna, nama, nama, \nNamen namchongmotgipan.\n\n5. Dongmitingo a-gilsako \nSintie Jisuna, \nUko gronge Salgisako \nMan-ejok dongrimna; \nIna, nama, nama, \nNamen namchongmotgipan.", 'songNumber' : 231},
  {'title' : 'JISU RACHA DALDI',
  'song' : "1. Gisolo atchia sa? \nJisu racha daldi. \nSako pala tangkana? \nJisu racha daldi. \nNamen duk man-bejok sa? \nAngna sichakaha sa? \nJisu jokatgipasa, \nJisu racha daldi.\n\n2. Ang' bi-ako on-gen sa? \nJisu racha daldi. \nAng' ma.drangna bata sa? \nJisu racha daldi. \nSian chiko batango, \nSawa angko ra-batgen? \nJisu Mande pil-gipa. \nJisu racha daldi.\n\n3. Siako amaha sa? \nJisu racha daldi. \nSia'ko mittanga sa? \nJisu racha daldi. \nNibo, reki sandigen, \nSawa do-ga osogen? \nJisu racha, rachasa, \nJisu racha daldi.\n\n4. Nama biap on gen sa? \nJisu racha daldi. \nSalgio nambata sa? \nJisu racha daldi. \nMukut sonako on-e \nSabasi, sabasi 'ne, \nJokatgipa Jisuko. \nJisu racha daldi.", 'songNumber' : 232},
  {'title' : 'SABAS GITEL ISOLKO',
  'song' : "1. Ring-tokchenga bi-sarangan \nIsolni bimungko; \nAn-chingba ring na u'gitan \nUn' gisik katakon; \nRing-na sabas, sabas, \nSabas, Gitel Isolko.\n\n2. Nokma, raja kamalrangde \nUnan manengtokjok; \nJisusa bi-sana ka-sae \nU'mangna chakpajok, \nIna sabas, sabas \nSabas, Gitel Isolko.\n\n3. Isolni chingna ka-saana \nSastroko man-sojok; \nManderangni janggirangna \nJisu ka-sabejok; \nRing-na sabas, sabas, \nSabas, Gitel Isolko.", 'songNumber' : 233},
  {'title' : 'NIBO JISUNI BILJAKKO',
  'song' : "1. Nibo, Jisuni biljakko, \nPaamung asongako. \n{Ukon minge git ring-tokbo, \nMitele Uako.} x2\n\n2. Pilakan, budeparangba, \nOlakichong Ukon. \n{Sakantian gitko ring-e \nMitelchong Jisukon, } x2\n\n3. Cha-chat so-chakanikoba \nRa-e so-bo Unan; \n{Similako man-e Gitel, \nNama bi-a uan.} x2\n\n4. Je dobok bi-sa siaha. \nUa nama pangnan. \n{Un' skoo namgni ong-china, \nNambechina Uan.} x2\n\n5. Pilak songni, jatni ku-sik, \nA-gilsak gimikan, \n{Un' biljak, gisik, katako, \nMitelchong pilakan.} x2", 'songNumber' : 234},
  {'title' : 'NAMBEJOK ANG\' JANGGI',
  'song' : "1. Tom-tom ang ramao chiring gita jokon, \nDuk chipakkore gitaon; \nAngna jeba dong' skianisan Nang-ni. \nNambejok nambejok, ang' janggi.\n\n(Ring-taitaiani.)\nNambejok ang' janggi, \nNambejok, nambejok, ang' janggi.\n\n2. Satan duk on-oba, majogenoba, \nKa-donge donggen unoba; \nKristo ang' bilgrianirang uitoka, \nAn-chitang on-jok ang' janggina.\n\n3. Ang papan ang gisikna ka-srokani, \nP'lak pap ka-giminrang angni; \nJrengjok datkapman-on chisolmung Uni, \nMitelbo nang Gitel ang' janggi.\n\n4. Indiba Gitel Nang' re-baona sengna, \nGopramja salgisa chingna; \nSa-gren' ja-birang, Oh ku-rang Gitelni, \nKa-dongna, neng-takna ang' janggi.", 'songNumber' : 235},
  {'title' : 'TOM-\'............TOM-TOM!',
  'song' : "1. Gitel, bal ta-rakbeenga, \nChipakkore satbeengjok; \nSalgi mikka dalmang a-mitmat, \nBanon chaknok katnapnok! \n\"Gitel, 'ching gimanasia, \nTusinapa maio? \nGopgen pingope 'chingko basakon. \nKa-gitting sagal ning-o!\"\n\n(Ring-taitaiani.)\nBamtokgen angna balwa, sagalba, \nTom-'.........tom-tom! \n'Bri gita chipakkoreoba, \nMe-mang ba mande ba \nong-chong je bilba, \nChigripjawa uni tua ringko, \nSalgi a-sak sagalni Gitelko, Da \nU'rang angna name bamtokgen; \nTom-' tom-tom; tom tom-tom! \nU'rang angna name bamtokgen; \nTom-'.....Tom'........tom-tom!\n\n2. Gitel, ang gisik simbrabee, \nDa-'lo nang-na tubama; \nAng' ka-tong ning-o dukan gapjok, \nMikrak', jokat', ang' bi-a! \nPap sintean chi ta-raka, \nAng' janggi mripaha; \nGitel, anga, angade gimanok! \nOh bakbak bamatboha.\n\n3. Gitel, kengni badeangjok, \nP'lakchin tom-tombeaha, \nChio saljagring teng-engaha, \nSalgiko jaksokaha. \nWatnabe, Oh, Naljokgipa, \nSaksan gale angko;\nUnon katchae man-egen suk songko,\nNeng-takegen chi nalsao.", 'songNumber' : 236},
  {'title' : 'DE-A MINGA, BILJAK, RASONG',
  'song' : "De-a minga, biljak, rasong \nOng-china chasongni chasong; \nJisu chingko Jokatgipa; \nHalleluia! Halleluia!", 'songNumber' : 237},
  {'title' : 'ANGKO CHISOL\' SEPANGO',
  'song' : "1. Angko Chisol' sepango \nRakibo, O Jisu; \nJanggini Chimik uno, \nNa-a Skobikroko.\n\n(Ring-taitaiani.) \nChisolo, Chisolo \nAngni rasong pangnan, \nAng' an-senggipa janggi \nMan-jaskal Salgiko.\n\n2. Chisol' sepang ang dongo, \nPaptangna mopile, \nKa'saan angko man-aha, \nPringprang teng-sudape.\n\n3. Chisol' sepang! O Kristo, \nUko gisik ra-atbo, \nUko chanchijringjringe \nRe-e rona dakchakbo.\n\n4. Chisol' sepang' sengsogen, \nPangnan ka-dongchake, \nMan-jaskal chisam nama' \nJordanko batsrange.", 'songNumber' : 238},
  {'title' : 'RASONG! RASONG!',
  'song' : "1. Rasong! Rasong! Jisu an-ching Jokatgipa, \nRing-tokbo, inwate, Un' ka-saako, \nInchro! inchro! Salgini pamong sa-grerang, \nBil, rasongko Un' bimungna on-bo. \nNirikdile detangrangko rakigen; \nSal sal Jisu u'mangko kabaka.\n\n(Ring-taitaiani.)\nRing-bo! Ring-bo! Uni dal-ako aganbo \nRing-bo! Ring-bo! ka-sroke git' ring-bo\n\n2. Rasong! Rasong! Jisu an-ching' Jokatgipa \nAn-ching' papna Uan sichakaha; \nUan an-ching janggi jokna pangchakani. \nInchro! Inchro! Su-a man-gipako. \nUko ring-bo! an-ching' dukko ra-gipa, \nUn' ka-saako sawa tona ama?\n\n3. Rasong! Rasong! Jisu an-ching' Jokatgipa \nSalgin' ma-drang Hojana! inchroa, \nJisu Gitel jringjrotna Raja ong-sranggen, Stikbo! \nstikbo! Rajan' mukut' on-bo. \nRe-baenga, p'lakko chee re-baa; \nBil, rasongba Gitelni pal ong-a.", 'songNumber' : 239},
  {'title' : 'GODOM DAKE RE-BO',
  'song' : "1.Nisanko de-dobo, chee git ring-bo; \nRe-bo chel-beengbo, re-bo mikkangchi. \nJisuko ja rikbo, Uo ka-dongbo; \nKa-dongbo, sipairang, na simang chegen.\n\n(Ring-taitaiani.)\nRe-bo, re-bo, kusi ong-anga; \nMikkangchi pangnan bobil champengengoba \nRe-bo, re-bo, Kristoan nika, \nWarachaknajok, an-ching pangnan chegen.\n\n2. Re-bo, nama sipai, rama talengon; \nRe-bo, andaloba, kenchakani gri; \nNang-na skang re-gipa tale uisojok; \nKristoni ka-saana re-na ka-dongbo.\n\n3. Godom dake re-bo riting dakatbo; \nRe-bo, pangnan re-bo, nisan dilako, \nRitingko pe-gija git ring.e re-bo; \nJisu san Dilgipa, Uni bil donga.", 'songNumber' : 240},
  {'title' : 'HALLELUIA INCHROTOKBO',
  'song' : "1. Halleluia inchrotokbo \nAmchong amchong intokbo; \nJisuan amchong, mitelbo. \nJisun' bilko ring-tokbo\n{Halleluia! \nRasong on-bo Jisuko.} x2\n\n2. O Jihova, Nang-ni bilko, \nPilak manderang Nang-ko \nDe-gen minggen maikai Nang-ko \nHalleluia Isolko. \n{Halleluia! \nGisik nange Isolko.} x2\n\n3. Naan Pagipa, Na-an Degipa, \nAro Gisik Namgipa, \nSakgittaman Saksangipa, \nJokatna atchigipa \n{Halleluia! \nRing-tokchina pilakba.} x2 \n\n4. Papi manden' papko watna \nMikkang pa-jok an-chingna; \nJokgen Jisuni bimungna, \nKa-dongtokbo Jisuna. \n{Halleluia!\nJisu ama jokatna.} x2\n\n5 Halleluia! Amchong, amen;\nPangnan namchina, amen; \nJisuan ka sabegipan, \nGitel Saksa Na-asan, \n{Halleluia! \nA-ning, a-sak, pilakon.} x2", 'songNumber' : 241},
  {'title' : 'JISUNI BILKO RA-CHAKCHONG',
  'song' : "1. Jisuni bilko ra-chakchong, \nSa-grerang tubamchong; \n{Rajan' mukutko ra-babo, \nP'lakni Gitel songbo.} x2\n\n2 O Isolna sigiparang, \nStikatbo na simang; \n{Jessen' goldikko dal-nikbo, \nP'lakni Gitel songbo.} x2\n\n3. Israel jat segimin bitchri, \nChona aro bilgri, \n{Jokatgipako ra-chakbo, \nP'lakni Gitel songbo.} x2\n\n4. Papirang ra-bo gisiko, \nKristoni dukrangko, \n{Ong-chong rasongrang Un’ jao, \nP'lakni Gitel songbo.} x2\n\n5. A-gilsakni ma-chonganti, \nAroba jatanti, \n{On-chong Una p'lak rasongko, \nP'lakni Gitel songbo.} x2\n\n6. Toromi kotokmung 'chinga, \nUn' ja-o ga akna; \n{Cham-gija gito chappabo, \nP'lakni Gitel songbo.} x2", 'songNumber' : 242},
  {'title' : 'JISUNI BILKO RA-CHAKCHONG',
  'song' : "1. Jisuni bilko ra-chakchong, \nSa-grerang tubamchong; x2\nRajan mukutko ra-babo, \nStikat......bo \nStikbo, stikbo stikbo \nP'lakni Gitel songbo.\n\n2. O Isolna sigiparang, \nStikatbo na simang; \nJessen' gol-dikko dal-nikbo, x2\nStikat.................bo, \nStikbo, stikbo, stikbo \nP'lakni Gitel songbo.\n\n3. Israel jat segimin bitchri, \nChona aro bilgri; x2\nJokatgipako ra-chakbo \nStikat...............bo, \nStikbo, stikbo, stikbo \nP'lakni Gitel songbo.\n\n4. Papirang ra-bo gisiko, \nKristoni dukrangko; x2\nOng chong rasongrang Un' jao, \nStikat.........bo, \nStikbo, stikbo, stikbo \nP'lakni Gitel songbo.\n\n5. A-gilsakni ma-chonganti, \nAroba jatanti; x2\nOn-chong Una p'lak rasongko. \nStikat........bo \nStikbo, stikbo, stikbo \nP'lakni Gitel songbo.\n\n6. Toromi kotokmung 'chinga, \nUn' ja-o ga-akna; x2\nCham-gija gito chappabo, \nStikat............bo \nStikbo, stikbo, stikbo \nP'lakni Gitel songbo.", 'songNumber' : 243},
  {'title' : 'O JISU, ANGNI CHISOLKO',
  'song' : "1. O Jisu, angni chisolko \nRa-e re-na ja-manchi; \nKa-dingstekako man-oba, \nSuk man-begen Salgichi. \nDongjachina a-gilsako \nAngko mandera-ani, \nIndioba suk man-enga, \nIsolmung Salgi angni.\n\n2. Manderangni duk on-oba, \nNang-onasa a-rika; \nSiangkujao duk ong-oba, \nSalgichi suk man-naka. \nAnga Nang-na ka-saode, \nMamungba duk man-jagen; \nNang-na anga ka-sajaode, \nSalgichiba duk man-gen.\n\n3. Bebera-an grang gitachi, \nBilangna gamsengona; \nSalgioni jringjrot Songchi, \nIsol rimanggen angko. \nA-gilsako kam chon-ode, \nMan-na gita neng-takna; \nKa-donge bi-ani pal 'ne, \nSalgini sukko ring-na.", 'songNumber' : 244},
  {'title' : 'NANG\' SEPANG ANG\' ISOL',
  'song' : "1. Nang' sepang, ang' Isol, \nNang-ni sepang; \nNang' sepangatgipa \nChisol'oba, \nIndiba ring kugen. \nNang' sepang, ang' Isol, x2\nNang-ni sepang.\n\n2. Katbranggipa gita, \nSalni napo, \nAndala duuloba, \nRo-ong kokam; \nIndiba jumangchi, \nNang' sepang, ang' Isol, x2 \nNang-ni sepang.\n\n3. Unon rama nachong, \nSalgin' jang-ki; \nJeko Na-a on-a, \nSa-gre ong-a, \nAngko jakjipchina, \nNang' sepang, ang' Isol, x2 \nNang-ni sepang.\n\n4. Unon mikrakoa, \nMitelemung, \nAng' dukrangko ra-e, \nBethel gatgen; \nIndake ang' dukchin, \nNang' sepang, ang' Isol, x2 \nNang-ni sepang.\n\n5. Ba katchaani grangchi \nSalgi chapchap, \nSal, ja, aski bate, \nBildooba, \nUnoba ring-kugen, \nNang' sepang ang' Isol, x2 \nNang-ni sepang.", 'songNumber' : 245},
  {'title' : 'NANG NA KA-SABATNA',
  'song' : "1. Nang na ka-sabatna. \nKristo Gitel, \nKnabo ang' bi-ako, \nKa-saan' a-sel.. \nIako mol-mola, \nNang-na ka-sabatna, \nKa-sabatna, x2\n\n2. Skango a-gilsakna \nKa-pakaha; \nDa-o Nang-kosa am-a, \nNang' kusisa. \nIakosa bi-a, \nNang-na ka-sabatna, \nKa-sabatna. x2\n\n3. Duk angna skichina, \nSaknaa' on-bo, \nNang-ni sa-gre nama; \nUa salo. \nAngmu ring-pachina \nNang na ka-sabatna, \nKa-sabatna. x2\n\n4. Unon sian' salo, \nKu-rang jenten, \nSalna man-angao, \nDe-mitelgen; \nUnoba ang' bi-a, \nNang na ka-sabatna, \nKa-sabatna x2", 'songNumber' : 246},
  {'title' : 'NANG NI KA-SAA ANGNA',
  'song' : "1. Nang ni ka-saa angna \nSiaona, \nAnga amja rakna, \nGitel, Nang-na; \nRa-baa boli Nang-na. \nAng' gisikko chakna, \nKa-sao tubamna,\n Mairok Nang-na.\n\n2. Ka-saan' singhasono, \nBi-chakenga, \nNipaa man-gnina, \nJisu, Nang-na; \nChisolko ripena, \nDakchakpabo bi-na, \nKa-saako mesokna, \nMairok Nang-na.\n\n3. Gisik Na-a on-bo,\nNang-na gita, \nSalni p'lak bakrango, \nKamko nikna, \nKa-sao dakchengna, \nNamnikani kamna, \nBranggipako man-na, \nMairok Nang-na.\n\n4. Je ang' man-arangba \nSkatang on-na; \nTango duk sukoba, \nGitel, Nang-na; \nNang-ko nikan' salo, \nPiokaha uno, \nJringirotgipaona, \nAngko Na-a.", 'songNumber' : 247},
  {'title' : 'ANG\' KA-SARA JISU',
  'song' : "1. Ang ka-sara Jisu, Na-ade angnin, \nPapni kamrangko anga Nang-na galgen; \nAngko Piokgipa, Jokatpagipa, \nNang-na ka-saahaode, da-oba ka-sara.\n\n2. Angna ka-saahana, Nang-na ka-sara, \nSkobikrokni bolo angko naljoka, \nNang' skoo bu-sun' mukutko stikana. \nNang-na ka-saahaode, da oba ka-sara.\n\n3. Tangengon ka-sagen, sion ka-sagen, \nRang-sita dipetna Nang-ko mitelgen. \nSian gramchi naon angan inkugen, \nNang-na ka-saahaode, da oba ka-sara.\n\n4. Rasongni biaprangni katchaarango, \nPangnan olakigen Nang-ko salgio; \nAng' skoo mukut stike pangnan ring-na, \nNang-na ka-sahaode da-oba ka-sara.", 'songNumber' : 248},
  {'title' : 'JISU GITEL',
  'song' : "1. Jisuna ang' ka-saa, \nGipinrangna bata; \nJisu Gitel! \nO, Na-asan angni! \nNang-na 'gre gipin gri, \nAngni namnikgnini, \nJisu Gitel!\n\n2. Na-an De Isolni, \nRa-jok an-chitangchi, \nJisu Gitel! \nMaikai Nang ni ka-saa \nGipinrangna bata, \nKa-saa angni man-a, \nJisu Gitel!\n\n3. Nang-ona katnapon, \nNa-an angni jokram \nJisu Gitel! \nAnga maina kena \nA-gilsakni dukna? \nMaina Na-an sepang, \nJisu Gitel!\n\n4. Na-an re-bapilgen \nNa-a kusi ong-gen, \nJisu Gitel! \nUnon Nang-ko nikgen, \nAnga Nang'gita 'gen, \nJringjrot Nang' baksagen, \nJisu Gitel!", 'songNumber' : 249},
  {'title' : 'JISU SAKSAN CHISOL DE-E',
  'song' : "1. Jisu saksan Chisol' de-e, \nRe-genma salgichi? \nA-gilsak jakari Uko, \nJa-rikgen ja-manchi?\n\n2. Ong-ja, chisol donga angna, \nDe-e ja man re-na \nPakkretango chisol gate, \nNangpagen ja-rikna.\n\n3. Rongtalgipa chisol' anga \nPakkretango gatgen; \nJena kingking sion anga \nJakgitel ong-jagen.\n\n4. Unon anga re-gen Nokchi, \nMukkuttangko stikna; \nMaina uno donsoenga, \nGe-sa mukkut angna.\n\n5. Angni chisol chakatpilon, \nRasong' mukkut pil-gen; \nSa-gre salgi'ni re-baongu \nAngko rimangchina.\n\n6. Datkapgimin Jisun' ja-o, \nJaneran' wa-seo; \nKatchae sonan' mukkut done, \nMittelgen Isolko.", 'songNumber' : 250},
  {'title' : 'UNA TANGGEN',
  'song' : "1. Ang' janggiko Una on-a; \nIsol' Mes bi-sa siaha, \nUna kakket pangnan ong-na, \nKristo, angni Isol.\n\n(Ring-taitaiani.) \nAnga Sigipana ka-gen, \nMaikai katchabegipagen; \nUna tanggen, angna sijok - \nKristo, angni Isol.\n\n2. Na-a ra a anga uijok, \nMaina Na-an angna sijok; \nDa-ontaltal anga ra-gen, \nKristo, angni Isol.\n\n3. Ang' janggiko jokatnasa, \nNa-an chisolo siaha, \nAnga an-tangko on-kama; \nKristo, angni Isol.", 'songNumber' : 251},
  {'title' : 'ON-GIMIN JANGGI RA-BO',
  'song' : "1. On-gimin janggi' ra-bo, \nAng' Gitelna ong-china. \nAng' somoi salrang' ra-bo, \nRe-na Nang-ko mittelna. x2\n\n2. Ka saan ang' jakko ra-bo, \nUa Nang' skako dakchina. \nAngni ja arangko ra-bo, \nNitoe ta-rakchina. x2\n\n3. Ang' ring-an' ku-rang' ra-bo \nMitel' ring na Rajako. \nAng' ku-chilkoba ra-bo, \nNang-ni katta gapchina. x2\n\n4. Ang' sona rupa' ra-bo, \nNang-na uko on-skagen. \nAngni gisikko ra-bo, \nBilantiko jakkalbo. x2\n\n5. Angni ska' Nang-nin dakbo, \nAngnin'ong jawa ua. \nAngni ka-tongko ra-bo, \nRajan' singhason ong-gen. x2\n\n6. Angni ka-saani' ra-bo, \nNang-ni ja-o rugala. \nAngko an-tangko ra-bo, \nPangnan Nang-nin ong-china. x2", 'songNumber' : 252},
  {'title' : 'NANG-NI SKA GITA DAKBO, GITEL',
  'song' : "1. Nang-ni ska gita dakbo, Gitel. \nNa-ara Inda, angan a-ste, \nAngko nol-e, ska gita dakbo, \nAnga tom-tome sengsoengon.\n\n2. Nang ni ska gita dakbo, Gitel. \nAngko talatbo, Gitel, da-alo. \nSuurina bokbate su-srangbo, \nNang-ni mikkango bamgopengon.\n\n3. Nang-ni ska gita dakbo, Gitel. \nSaknabejok dakchakbo bi-a. \nPilakni bilan Nang-nin ong-a, \nAngko namatbo, Jokatgipa.\n\n4. Nang-ni ska gita dakbo, Gitel. \nAngko Nang ning-o bamatsrangbo. \nNang-ni Gisikchi gapatsrangbo, \nKristosan pangnan angmu dongbo.", 'songNumber' : 253},
  {'title' : 'O KA SAA WATGIJAGIPA',
  'song' : "1. 0 Ka-saa, watgijagipa, \nNang-o ang' janggi neng-taka; \nOn-pila ang' gro janggiko. \nNang' ka saan' sagal tu-gipao, \nSilbat' bang batchina.\n\n2. O Seng-a angko dilgipa, \nOn-pila ka-tongko Nang-na; \nAng' teng-rakgija bil-chamko; \nNang' salni wal-sare teng-ao, \nChing-bat' nambatchina.\n\n3. O Katchaa, dukchi am-gipa, \nChipja ang' ka'tongko Nang-na; \nMikkaon sundarechi uia, \nOng-gramjawa 'ne ku-chaka, \nUn' pring mikchin' griwa.\n\n4. O Chisol de-chaopilgipa, \nOn-bo Nang' kurion dongna; \nA-an' janggin' rasongko dape, \nGital balgaogen nitobee, \nJe janggin bon-jaha.", 'songNumber' : 254},
  {'title' : 'SALBO SEPANG',
  'song' : "1. Nang ni ka-saani ku-rangko knaa \nO Gitel anga Nang-nin; \nIndiba ska bebeo chadengna, \nSepangkalkuna Nang-chin.\n\n(Ring-taitaiani.)\nSalbo, sepang, sepang ang' Gitel, \nNang-ni siram chisol 'na; \nSalbo sepang, sepang, sepang ang Gitel, \nNang-ni oksik' an-chi'na.\n\n2. Kraatbo angko Nang' kamko ka na, \nNang' ka-saani bilo; \nKa-dongbee ang' janggi nidona, \nAngni ska ong-chong Nang-o.\n\n3. O, katchabea' somoisa dongna, \nNang' singhason mikkango; \nRipengskamung gita agangrikna, \nJa-'dipane bi-ao.\n\n4. Gnang' ka-saan' tu-a angni uigija, \nBatkujana sagalko; \nGnang' katchaan' chua ang' sokna amja, \nNeng-takjaskal tom-tomao.", 'songNumber' : 255},
  {'title' : 'ANGNI PILAKKON JISUNA ON-A',
  'song' : "1. Jisuna on-a pilakkon \nP'lakan Unin ong-china; \nKa-donga, ka-saa Unasan, \nUn' mikkangosan tanga.\n\n(Ring-taitaiani.) \nJisuna on-a, \nAngo gnang p'lakkon. \nAng' Gitel Jokatgipanin, \nP'lakan ong-china.\n\n2. Jisuna on-a pilakkon, \nTugope Uni ja-ao; \nA-gilsakniko wattoke, \nGitel ra-chakbo da-o.\n\n3. Jisuna on-a pilakkon, \nPilakkon Nang-nin dakbo; \nGisik Rongtalgipan' bilchi, \nAngko Nang-nin ong-atbo.\n\n4. Jisuna on-a pilakkon, \nAn-tangkon Nang-na on-a; \nNang-ni ka-saa bil gapchina, \nPatiani ong china. \n\n5. Jisuna on e pilakkon, \nDa-o anga katchabea; \nJokataniko man-srange, \nRasong! Rasong! Jisuna!", 'songNumber' : 256},
  {'title' : 'GITEL NANG\' BAKSA RE-PAO',
  'song' : "1. Gitel, Nang' baksa re-pao \nDangdike on-paanio, \nNang' ning-tua bilko on-bo, \nKamni balko ripechakbo.\n\n2. Nang' nolona branggipako \nRe-dilna dakchakbo angko; \nNang-na ka-tong rakgipako \nNang-ona rimbana skibo.\n\n3. Bebeni kamko ka-engon, \nKa-donga nam'jako cheon, \nNang' sepangbataona salbo, \nAngna chakchikkuna skibo.\n\n4. Ka-dongani teng-suengon, \nOng-bagni salna kenjaon, \nMan-jringe Nang' tom-tomako, \nGitel, Nang-mung tangna on-bo.", 'songNumber' : 257},
  {'title' : 'RIM-GITTANGBO ANGKO',
    'song' : "1. Gitel, rim-gittangbo, \nJakgitel ong-skagen, \nNang-na an-tangko bamaton, \nChegipa ong-sranggen.\nJa-tang chadengengo \nKengnirango sripa; \nNang-ni jakchi angko rim-bo, \nBilaksranggen anga.\n\n2. Gitelko man-jana, \nAnga kangalbea,\nJisu an saoatkujana,\nTom-tom ong-rongjawa.\nNang-na bamkujana\nJakgitel 'chong-motja,\nNang ka-saachi ang' rim-gittang', \nWatnabe pangnaba.\n\n3. Dangdike on-jana,\nAnga katchakuja, \nAn-saoataniko nanga,\nKa-dongatakoba.\nNa-a draatkujana \nAnga amkujawa,\nNang-ni bilko man-srangosa\nAman' nisan' de-a.\n\n4. Nang-ni namnikana\nAng' skatang bamata, \nChuatako anga am-ja, \nNang' onatakosa; \nChadengna kim kime. \nCheaia Nang-osa, \nNang-ni ka-bako neng-take \nAn-saobea, anga.", 'songNumber' : 258},
  {'title' : 'INDIN RE-BAA NANG-NIN ONG-NA',
  'song' : "1. Indin re-baa, Nang-nin ong-na, \nDamberangna Ka-sagipa, \nDa-o an-tangko Nang-na on-a, \nKristo, Nang 'na re-baa.\n\n2. Dambe ong-mitingo, anga, \nJanggitangko Nang-na on-a, \nOn-kangsranga, ra-piljawa, \nKristo, anga re-baa.\n\n3. Nang seng-ao re-rurana, \nBebekosa dakjringna ska, \nNang-na dangdike on-srangna, \nJisu, Nang-na re-baa.\n\n4. Dambepiti, bilakengo, \nSijaskalna, ka-gen, Nang-na; \nAngko ra-chak' bilakatbo, \nKristo, Nang-'na re-baa.", 'songNumber' : 259},
  {'title' : 'RONGTALBATNA ON-BO',
  'song' : "1. Rongtalbatna on-bo, \nBamroroangna; \nChakchikbatna duko, \nPap' mitchibatna; \nB'lakbatna bebera-o, \nUn' jak uibatna; \nKa-srokbat Un' kamo, \nBi-o changbatna.\n\n2. Mitelbatna on-bo \nUo pangchakbatna; \nKa-dongbatna kattao, \nMingsingbatatna; \nUn' sakna dukrangna, \nGrap sachakbatna; \nRurao chakchikbatna, \nKa-sabatangna.\n\n3. Grikbatangna on-bo, \nBil cherorona;  \nA-sak gelrorona, \nSalgi sikbatna \nNang songnok jakkalna \nKraroroangna;\nGitel Jisu gita.\nOng-roroangna.", 'songNumber' : 260},
  {'title' : 'KA-BO HAI KRISTIANRANG',
  'song' : "1. Ka-bo hai Kristianrang, chisolni sipairang. \nRikangkuna, rikangna ching' mondoliko; \nKa-sariri ku-rang, chu-sokatna kamrang. \nOkamenga, okama, okamenga chingko.\n\n(Ring-taitaiani.)\nRe-na ja-kusan, Kristo'n ching Nisan, \nWatgalgija ku-cholsan;\nBi-sa, pante me-tra, me-apa, me-chikma \nKa-angkugen, ka-anggen man-kujana Nisan.\n\n2. Ka-bo dukrangoba, Bobil bang-beoba, \nNiatkubo, niatbo Kriston' chisolko \nDuk, sia ba karap, ja-rikoba chapchap, \nOkamenga, okama, okamenga chingko.\n\n3. Nikronggija salrang, ong-ronggija kamrang, \nRe-baenga, re-baenga, Satan' kotokrang \nRa-bo kakket, bebe, Jisun' silchidare, \nKa-dongaibo, ka-dongbo hai Jisun sipairang.", 'songNumber' : 261},
  {'title' : 'RE-BA\', ANG\' DE, PAAN\' NOKCHI',
  'song' : "1. A-gilsako dongode,\nNanggen dakgrikbenade; \nKenja anga bobilna, \nJisu'n ka-sara angna; \nKenmangija re-anggen, \nSalgiona sokninggen; \nOkamsogen Salgichi, \nRe-ba', ang' de, Paan' nokchi.\n\n2 Ramao bang-bea ja-ga, \nAngko nisina daka; \nKatchi rangsi rurana, \nTima angni gisikna; \nSepang donge Jisuni, \nJokgen bobilrangoni; \nOkamsogen Salgichi, \nRe-ba', ang' de, Paan' nokchi.\n\n3. Bobil gipinna bata, \nGisiktang namjabata; \nChanchie namgijako \nA-sel nangata angko; \nJisun' gimin indiba \nJokpagen unoniba. \nOkamsogen Salgichi, \nRe-ba', ang' de, Paan' nokchi", 'songNumber' : 262},
  {'title' : 'ANGNADE GRIMA BOBILRANG',
    'song' : "1. Isol' songni sipai ine \nSeaha bimungko; \nAngara bobilna kene \nWatgenma Kristoko? x2\n\n2. Dukko man-beoba mande, \nRe-a Salgichina. \nRimpajagenma angkode, \nSalgiko man-atna? x2\n\n3. Angnade grima bobilrang? \nWarachaka papan; \nA-gilsako toromirang \nDakgrikbea pangnan. x2\n\n4. Salgiko man-pana skode, \nDakgrikbena nanggen; \nGitelni angna chakode, \nDakgrikao chegen. x2\n\n5. Mandesalde dakgrikao, \nSioba amkugen; \nKa-donge nibo, Salgiko, \nBakbakan man-egen. x2\n\n6. Chon-kamani Sal sokode, \nMan-emu gamrangko; \nAmgipa sipai kotokrang, \nMittelgen Jisuko. x2", 'songNumber' : 263},
  {'title' : 'TOM-AONI EKGRIKNABE',
  'song' : "1. Hiwa nibo Salgichiko, \nImbo, ripengrang, \nInchrobae kotok jinma, \nGitel' sipairang.\n\n(Ring-taitaiani.)\nTom-aoni ekgriknabe, \nJisu aganjok, \nNang-ni bilchi watja, Gitel, \nNang-on aganjok.\n\n2. Nibo, ua, bang-en re-baa, \nSatanni kotok; of \nChing' sipairang warachakna \nKa-dongangjajok.\n\n3. Hiwa nibo, aman' nisan, \nKnatokbo begul; \nChing' Gitelchi chinga amgen \nBang-oba bobil.\n\n4. Dakgrikbena nangahaoba, \nKengende maina? \nJisun dakchaktokgen chingna, \nKa-donga Una.", 'songNumber' : 264},
  {'title' : 'JAJRENGAN\' SALO KATNAPRAM',
  'song' : "1. Isol chingko Jokatgipa, jajrengan' salo \nKatnapram; \nJeba ong-bo kenjawaha, jajrengan' salo \nKatnapram.\n\n(Ring-taitaiani.)\nO, Jisu Katnapram neng-ani songo, \nNeng-ani song, neng-ani song, \nO, Jisu Katnapram neng-ani songo, \nJajrengan' salo Katnapram.\n\n2. Salo, walo Rakkigipa, jajrengan' salo \nKatnapram; \nKenani gri bobilnaba, jajrengan' salo \nKatnapram.\n\n3. Chingko duule nangjaoba, jajrengan' salo \nKatnapram; \nJisuosa ka-dongaigen, jajrengan' salo \nKatnapram.\n\n4. Jokatgipa Nambegipa, jajrengan' salo \nKatnapram. \nSalantian Uo dongbo, jajrengan' salo \nKatnapram.", 'songNumber' : 265},
  {'title' : 'O JRINGJROTNI RONG-DOT',
  'song' : "1. 0 Jringjrotni Rong-dot, Nang-o \nDonnubo, \nBal mikkani ta-rakengo \nDonnubo. \nJeo manden' jak amjawa, \nNang ka-saoni ekatna \nAngko, O Jringjrotni Rong-dot, \nRakkibo.\n\n2. Papiskani ja gaoni \nDonnubo, \nJanggin' jringjrot gamseng Na-an, \nDonnubo, \nA-gilsak angko ruraon, \nAngni ka tongko man-angon, \nAngko, O Jringjrotni Rong-dot, \nRakkibo.\n\n3. Wal gitan jajrengan' salo \nDonnubo, Ka-srokani sal'na kingking \nDonnubo, \nSian' songchi re-nasion, \nNang-ni ka-bako tuaten \nAngko, O Jringjrotni Rong-dot, \nRakkibo.", 'songNumber' : 266},
  {'title' : 'ANG\' GISIK, MIKRAKBO',
  'song' : "1. Ang' gisik, mikrakbo, \nHajal bobil donga, \nPap jinma am-enga nang-ko \nSalgioni' salna.\n\n2. Mikrak', dakgrik', bi-bo, \nPangnaba watnabe; \nSalsal warachaktaitaibo, \nIsolo bi-chae.\n\n3. Amjok 'ne da chanchi, \nDa-dondik krengako, \nKam matchotja bebera ani, \nMan-jaskal mukutko.\n\n4. Sijaskal dakgrikbo, \nNikjaskal Isolko; \nJanggi wato Ua nang-ko \nRinnapgen Noktango.", 'songNumber' : 267},
  {'title' : 'MAJOANIRANGKO MANINABE MAL',
  'song' : "1. Majoanirangko maninabejok, \nAm-a changantian nang ko dakchakgen; \nKa-donge dakgrikbo, skako bamate, \nJisuchiko nibo, Ua nang-na chakgen.\n\n(Ring-taitaiani.) \nJokatgipao bi-bo, \nNang-ko bilakatchina; \nUa dakchakgen nang ko, \nUa chakgen nang-na.\n\n2. Namgija ripengko gele watsrangbo, \nNamgija kattako mitchiniksrangbo; \nIsolni bimungko mandera-srangbo, \nNibo Jisuchiko, Ua chakgen nang-na.\n\n3. Chanchigipa ong-bo, gisik nanggipa, \nKa-sachakbegipa, bebe dakgipa; \nOn-sogen mukkutko amsranggipana, \nNibo Jisuchiko, Ua chakgen nang-na.\n\n4. An-ching bebera-achi an-ching amsranggen, \nGa-aktaitaioba, Ua chakatatgen; \nAn-ching Jokatgipa bilko on-sranggen, \nJisuchiko nibo, Ua nang-na chakgen.", 'songNumber' : 268},
  {'title' : 'DANIEL DAKE DONGBO',
  'song' : "1. Name mangsonge dongbo, \nIsolna bame; \nMandera bo Danielni \nBang-gija tok kakket!\n\n(Ring-taitaiani.) \nDaniel dake dongbo, \nSaksan jeb' ong-bo, bacial \nName mangsonge dongbo, \nParakatpabo.\n\n2. Bang-a bilakgiparang \nGimasrangbea; \nIsolna chakgenchime \nDaniel ong-pagenchim.\n\n3. Bobil gaorade-gipa, \nRe-ruragipa, \nAa-o garakjole bama \nDanielni tok' ja-o.\n\n4. Nama Katta Nisanko \nChuate chebo; \nChampenge Satan' kotok, \nInchro Daniel tokna.", 'songNumber' : 269},
{'title' : 'NAMA DAKGRIKAO KRENGBO',
  'song' : "1. Nama dakgrikao krengbo; \nKristo nang' bilakatani; \nJanggi tanganio rim-bo, \nJringjrot' mukut nang' katchagni.\n\n2. Isolni nama ka-saachi, \nDimbrenga katsusao katbo, \nKristo nang' Rama, nang' Man-gni, \nKristoko nigitoe nibo.\n\n3. Dilgipao ka-dongsrangbo, \nNang' sinteako galsrangbo. \nKristo nang' Janggi, ka-saa 'ne \nUo ka-donge uichong-motgen.\n\n4. Da kenrakbo, da nom angbo, \nJringjring sepang Uni jak gnang. \nUa dingtanggijagipa, \nKristo pilakni p'lak ong.a.", 'songNumber' : 270},
  {'title' : 'MIKKANGCHI GA-ANGBO, \nKRISTIAN SIPAIRANG',
  'song' : "1. Mikkangchi ga-angbo, \nKristian sipairang, \nJisuko miksonge \nNa-simangna skang. \nKristo an-ching Gitel \nBobilrangona \nNisanko de-doe \nRe-angsoaha.\n\n(Ring-taitaiani) \nMikkangchi ga angbo, \nKristian sipairang, \nJisuko miksonge \nNa-simangna skang.\n\n2. Jisuni Bimungna \nSatan katanga; \nGa-angbo sipairang \nCheaniona. \nNorok mojingjanga \nInchrotokana, \nGam-e git ring-tokbo, \nUko mittelna.\n\n3. Sipai kotok gita \nMondoli re-a; \nRongtalgiparangko An-ching ja-rika. \nAn-ching ma-malgija \nOng-a ku-cholsan, \nKa-dongao ka-saao \nSkiao saksasan.\n\n4. Mukut singhasonrang \nGimatokoba, \nJisuni Mondoli \nKim-kim chadenga; \nNorok amna man-ja \nUni kosak'na. \nKristo ku chakaha \nUan chu-soka.\n\n5. Mikkangchi re-pabo. \nChing' kotok baksa; \nChee git ring-pabo, \nMande jatrangba. \nRasong, de-mittela, \nRaja Kristona \nMandemung sa-grerang \nJringjrot' ring-china.", 'songNumber' : 271},
  {'title' : 'ANGKO, O ANG GITEL, ANGKO!',
  'song'  : "1. Angko, O ang' Gitel, angko, \nAngko donnubo; \nPangrakbea chakna nama, \nNang' kuri ka-bako.\n\n(Ring-taitaiani.) \nAngko, angko, \nO Gitel Jisu, angko, \nRakkibo dilbo \nDone Nang' ka-bako.\n\n2. Janggini sagal pokpekon, \nChakna biap gri; \nAngko rimnappabo, Gitel, \nNang-osan chakani.\n\n3. Dukrang, graparangchi angni \nJanggi nom-oba; \nNang-osan, Gitel, man-ronga, \nKatchaa kusikoba.", 'songNumber' : 272},
  {'title' : 'A GISINI BIJATCHIO',
  'song' : "1. A-gisini bijatchio \nGitel angko dilpabo; \nAnga bilgri, Na-a b'laka, \nJako rim-e dilpabo; \nSalgin' manna, Salgin' manna. \nSalanti angna on-bo.\n\n2. Chi janggini chimik grika, \nDa-o uan jokaha; \nAram aro wa-alni krong, \nAngna rama mesokbo; \nJokatgipa, Jokatgipa, \nChelchake rakipabo\n\n3. Jordan chibimaona sokon, \nAnga ga dapahaon, \nAngko dakmajoan' gri'nok, \nKanaanona re-baon; \nDe mittelgen, de mittelgen, \nUnon jringjrot ring.aigen.", 'songNumber' : 273},
  {'title' : 'DILANG\', JRINGJROTNI RAJA',
  'song' : "1. Dilang', Jringjrotni Raja, \nRe-paan, sal sokbasrang; \nChean' a bao dongon, \nChing' dongram tamburang. \nTarie salmitingon, \nNang' bil bilakata, \nDa-asal, Jringjrotni Raja. \nDakgrikan' git' de-a.\n\n2. Dilang', Jringjrotni Raja, \nPap dongpiljahaona, \nChekujana rongtala, \nTom-tom amkujana. \nTonualchi ong-gija \nBa dokachi dama, \nIndiba ka-saanichi \nSalgin' Songnok re-baa.\n\n3. Dilang', Jringjrotni Raja, \nKengija ja-rikpaa, \nSeng-baan' gita katchaa, \nJeoba Na-a donga. \nChisolko de-doenga, \nUn' seng-ao re-paa. \nChegipa mukut' man-a. \nDilang', bilgnang Raja.", 'songNumber' : 275},
  {'title' : 'CHAKAT, CHAKAT JISUNA',
  'song' : "1. Chakat, chakat Jisuna,\nChisolni sipairang; \nUn' nisanko de-doe, \nGa-akna da-onang; \nCheaoni cheaona, \nAmjana bobilko, \nKristo Gitel ong-jana, \nDilgen kotoktangko.\n\n2. Chakat, chakat Jisuna, \nOkamana bambo, \nUko rasong chaate, \nDakgrikachi re-bo; \nChansokja bobilrangko \nAmchaksona gita; \nNang' a-sel nangani kri, \nNabachong ka-donga.\n\n3. Chakat, chakat Jisuna, \nUn bilo chadengsrang; \nBe-enni bil bilgria, \nAn-tango da-ka-dong; \nKristoni bilko ganbo, \nIsolo bi-rongbo; \nJeona nang-ko nanga, \nUno pangnan dongbo.\n\n4. Chakat, chakat Jisuna, \nDakgrika dikdiksan,\nDa-o dakgrikaria, \nCheani bak tapan; \nAmsranggipa jringjrotni \nMukkutko man-egen, \nRasongni Raja baksa \nJringjrot dongkampagen.\n\n------------------------\n2-gipa Sul         \"Stand up, Stand up for Jesus\"\n-------------------------\n\nChakat, chakat Jisuna, \nChisolni sipairang\nUn' nisanko de-doe,\nGimaatna, gimaatna, on-jachong.", 'songNumber' : 276},
  {'title' : 'ISOL KILLA B\'LAKBEGIPA',
  'song' : "1. Isol killa b'lakbegipa, \nChakram ching' pangkamgipa, \nDukrango dongengon 'chingna. \nPangnan Dakchakenggipa. \nChing' bobil chasongna, \nNisina am-enga, \nUn' budi bil bang-a, \nMitchian ka-namgija, \nGri pilakba ugita.\n\n2. Ching' biltangna pangchakode, \nBobil 'chingko amgenchim; \nIsol mande pil-jaode, \n'Ching' chakgipa griwachim. \nSing-ama, Sa, Uan? \nKristo Jisu Uan; \nOkama jringjrotni \nPamong kotokrangni, \nDakgrikao chekamgipa.\n\n3. A-'sak gapoba bobilan \n'Chingko ka-mikken'oba \nKenja, Isolni mangsongan' \nChingchi bebeko amatna. \nAndalani raja. \nUna 'chinga moja, \nUa ka-o nangoba, \nSasti una dona; \nIsolni Katta amgen.\n\n4. A-ani bilrangna bate, \nKatta namen bil bata; \nGisikni bilko man dape, \nChakgipaoni' man-a. \nGamseng bakrang re- 'chong, \nJanggiba bon-changchong, \nBe-enko so-otchina, \nIsol dongkamkua, \nUn' Songnok jringjrot' donga.", 'songNumber' : 277},
  {'title' : 'ANGA RE-A SALGICHINA',
  'song' : "1. Burung a-jangchio roe, \nBachinasa re-ade ? \nA-bimanduko re-eba \nKenpajama na-ade ?\n\n(Ring-taitaiani.)\n\nAnga re-a Salgichina; \nRe-bapabo angmu baksa, \nMittelemu Isolko.\n\n2. Re-gipa agana bebe, \nKenja anga indiba; \nRama Mesokgipa donga, \nAngko Ka-dongatgipa.\n\n3. Nang-ni rama mikkangchide \nSian' chiba dongane, \nChipakkore satdapode, \nUno na-a kengenne?\n\n4. Kenja anga ua china, \nKenmangija batanggen; \nChipakkore satdapoba \nChi nalsachi sokanggen.\n\n5. Bebeaan Ua mande \nSian chiko batangjok; \nBa-ra nambeako chine \nMikhang dingtang ong-angiok.\n\n6. Anga Uni ja-manja-man \nKenmangija re-pagen; \nAng' Gitel Jisuni bilchi \nSalgiona sokpagen.", 'songNumber' : 278},
  {'title' : 'ISOL SIMSAKGEN NANG-NA',
  'song' : "1. Isol simsakgen nang-na, ne da-ken, \nDuk suko Uan nang-ko rakkigen; \nKa-sae nitimenga mandetangko, \nSaksan brangchina watjawa nang-ko.\n\n(Ring-taitaiani)\nIsol simsakgen nang-na bon-kame \nPaa piokgipa ripeng ong-e \nJisu aganchakgen nang' okamon, \nUan simsakgen, ka-dongsrangbo Uon.\n\n2. Isolan simsakgen salgimiko, \nRakkie nang-ni re-an ja kuko; \nUan rakkigipa, nirikgipa, \nDile dedrangko tom-tom chiona.\n\n3. Isol simsakgen nang' tangaona, \nPatie gipin amgijako nang-na; \nUan simsakgen nang' salrang bon-on, \nUn' songnokna rimgen nang ko unon.", 'songNumber' : 279},
  {'title' : 'GITEL JISU ANGO DONGA',
  'song' : "1. Gitel Jisu ango donga, \nAnga donggen Jisuo. \nMaini gimin kengen anga ? \nBiap man-gen Salgio.\n\n2. Anga papi ong-beoba. \nJisu angna ka-sagen; \nGualako dakmanoba \nJisu angko rimanggen.\n\n3. Sian' a-songko re-oba, \nJisu angko re-dilgen; \nRama nikjae brangangoba, \nJisu rama' mesokgen.\n\n4. Siani wariko bate, \nJisu angko chobatgen. \nSukko man-gen Salgisako; \nJisu baksa dongrimgen.", 'songNumber' : 280},
  {'title' : 'JRINGJROTNI RONG-DOT',
  'song' : "1. O angni Jringjrotni Rong-dot, \nAngni Na-an Chela mong-got, \nGitel, Na-an bika Rong-dot, \nAnga Nang-on rim-gen kotkot.\n\n2. Su-a pari oksikoni \nJokaha je an-chi Nang-ni, \nAnga Unon napbolaha, \nNang' kurion dongnuaha.\n\n3. Sikrip tangkrip bimchipoba, \nWalang salang ninioba, \nMikkol dare cholcholoba, \nBolchong agal be-en pil-oba.\n\n4. Indioba su-jawachim. \nNiam grooni jokjawachim; \nNa-an angko naljokaha, \nNiam groko grinataha.\n\n5. Jensalo angni manggisi, \nAmo tusigen, sari gri, \nO angni Jringjrotni rong-dot, \nAnga, Nang-on rim-gen kotkot.\n\n6. Gitel a-gilsakchi sokgen, \nBichal Salo Nang-ko nikgen; \nO angni Jringjrotni Rong-dot, \nNa-an angni Chela monggot.", 'songNumber' : 281},
  {'title' : 'CHISOLON, CHISOLON',
  'song' : "1. Ang' Jokatgipan' an-chia \nChisolo ong-jokma? \nAng gita nitogijana \nUan sichakjokma ?\n\n(Ring-taitaiani)\nChisolon, Chisolon Seng-ako man-chengjok, \nPapni bal tang-angjok unoba;\nUnosa anga ka-donge nikjok, \nDa-on anga pangnan ka-sroka.\n\n2. Angni namgija dakana \nUan sichakjokma? \nAiao, ka-sara indaka! \nTona man-piljaha.\n\n3. Do-pilgiman mikchi chotja \nAng' groko, ka-saani; \nGitel an-tangkon on-asa, \nIna 'gre dakna gri.", 'songNumber' : 282},
  {'title' : 'UN\' GRANG\' NING-O',
  'song' : "1. Un grang' ning-o, anga name dongenga; \nWal andaloba, balmikkaoba, \nAnga ka-donggen, Uan rakikugen; \nUan piokjok, Uni de angan.\n\n(Ring-taitaiani) \nUn' grang' ning-o. Un' grang' ning-o, \nUnoni sa ekatgen? \nUn' grang' ning-o ang' janggi donggen, \nName donggen jringjrotnan.\n\n2. Un' grang' ning-o angni dukrangko chakram; \nKa-tong sikbee Uchi pil-anga. \nAngko namatna a-gilsak bil grion \nUno patia, Uno namata.\n\n3. Un' grang' ning-o namen katchabeani, \nUno dongnugen, ruraan' bon-jaskal; \nUn' grang' ning-o bobil angko amjaha, \nJisuo donge kenmanjawaha.", 'songNumber' : 283},
  {'title' : 'NANG-ON DONGNUA',
  'song' : "1. O angna chubatgipa rong-dotona. \nDakgriko, jajrengo ang' gisik kata; \nAnga papi, neng-a, Nang-nin ong-na ska; \nO Jringjrotni Rong-dot, Nang-on dongnua.\n\n(Ring-taitaiani) \nDongnuenga, dongnuenga, \nO Jringjrotni Rong-dot, \nNang-on dongnua.\n\n2. Sintebean' salo, jajrengan' salo, \nJensalo ga aka majoan' bilo, \nJanggini sagalni balmikkangao, \nO Jringjrotni Rong-dot, Nang-on dongnua.\n\n3. Dakgrikon pil-anti bobil chabaon, \nAng Chakramchi kate agana dukkon, \nChipakkore gita ruraarang ong-on; \nO ang' janggin' Rong-dot, Nang-chi katronga.", 'songNumber' : 284},
  {'title' : 'JISUNASA KA-DONGA',
  'song' : "1. Ka-dongari salantin, \nDuk man-oba, ma-mantin; \nBebera-a nom-oba, \nJisunasa ka-donga.\n\n(Ring-taitaiani) \nMinitanti ka-donga, \nSalrikitba ka-donga, \nJeba ong bo ka-donga, \nJisunasa ka-donga.\n\n2. Uni Gisik teng-sua, \nAng' andala ka-tongo; \nUmung re-o gaakjawa, \nJisunasa ka-donga.\n\n3. Rama namode ring-a, \nNamjaode bi-skara; \nKeno Uko okama, \nJisunasa ka-donga.\n\n4. Sijaskal ka-donganga, \nA-ako batsrangjaona; \nSalgin' ning-o napjana \nJisunasa ka-donga.", 'songNumber' : 285},
  {'title' : 'KA SAGIPA JANGGINA',
  'song' : "1. Ka-sagipa janggina, \nNang' ka-bakchi ang' katna \nBal mikka ta-rakmiting, \nBol pangpik,' chi dal-miting. \nRa-chakbo, Gitel, angko, \nPilak kenanirango \nSalgin' Nokchi dilkubo, \nRa-chakbo ang' janggiko.\n\n2. Gipin jokani chol gri, \nNa-an janggin' Pangchakgni. \nDa-watgal, Gitel, angko, \nAngko pangnan chel-chakbo. \nNang-osa ka-dongenga, \nBilko Nang osa am-a; \nChel-atjaskal dukrangko \nNang-ni grangchi pindapbo.\n\n3. Nang-kosa, Kristo, nanga, \nNang-o pilakko man-a \nNom-boke gitilako, \nBil grirangko dakchakbo. \nNa-an Rongtalsranggipa, \nAngan marang nanggipa; \nAngo gapa paprangchi, \nNang-o gapa ka-saachi.\n\n4. Nang-on ka-sara bang-a, \nPap' pindapna chu-onga, \nPap' pariko namatbo. \nKa-tongko rongtalatbo, \nJanggini Chimik Na-a, \nOn-bo ringna, okkana. \nAng ka-tongo naatbo, \nChijanggiko jokatbo.", 'songNumber' : 286},
  {'title' : 'ANG\' SEPANGBAENGA',
  'song' : "1. Chisol' sepangbate dongna \nAng' sepangbaenga; \nSepangangna saini salna. \nAng' sepangbaenga. \nJisun' siramchi sepangna. \nAn-chi chiringni rikamna, \nJisuni su-a oksik' na \nAng' sepangbaenga, \nAng' sepangbaenga.\n\n2. Kristianni ka saa man ramna \nAng' sepangbaenga; \nMan-a toako cha-pana, \nAng' sepangbaenga; \nKa-dongango niksengro'a, \nJanggitangko on-jok angna; \nUn' sepangbate dongrongna \nAng sepangbaenga, \nAng' sepangbaenga.\n\n3. Bi-engo anga ka-donga, \nAng' sepangbaenga. \nKa-sabatna ang' ska donga; \nAng' sepangbaenga. \nNeng-a, sintia bon-naka, \nKatchaa, man-pana sepanga; \nStikna mukutko man-pana \nAng' sepangbaenga, \nAng' sepangbaenga.", 'songNumber' : 287},
  {'title' : 'JISUN\' AN.CHIN\' AGRE',
  'song' : "1. Sa ang' papko su.sranggen \nGitel Jisun' an-chin' agre. \nAngko sawa namatgen? \nGitel Jisun' an-chin' agre.\n\n(Ring-taitaiani) \nO Chiring, gamchata, \nSu-srange bokata; \nChiring gipinde gri, \nGitel Jisun' an-chin agre.\n\n2. Rongtalani cholan gri, \nGitel Jisun' an-chin' agre; \nPap watani gipin gri, \nGitel Jisun' an-chin' agre.\n\n3 Papna on-chakani gri, \nGitel Jisun' an-chin agre; \nAng namachi jokna gri, \nGitel Jisun' an-chin' agre.\n\n4 Ang ka-donga gipin gri, \nGitel Jisun' an.chin' agre; \nAngni gipin torom gri, \nGitel Jisun' an-chin' agre.", 'songNumber' : 288},
  {'title' : 'UN\' BIMUNG\' RASONG',
  'song' : "1 Chisolo Jokatgipa sijok, \nPaponiko rongtalatnakjok, \nUni an.chian ango nangjok; \nUn' bimung' rasong !\n\n(Ring-taitaiani) \nUn' bimung' rasong \nUn' bimung' rasong \nUn an-chian ango nangjok; \nUn' bimung' rasong!\n\n2 Aiao, anga paponi jokjok! \nJisu angni ka-tongo napjok. \nAngko ra-napatjok Chisolon; \nUn bimung rasong!\n\n3 Rongtalgipa Chimik jokgipa, \nAnga napahana ka-sroka, \nUno rongtalako man para; \nUn' bimung' rasong!\n\n4. Re.babo, ia Chimikona, \nJanggiko donbo Jisun' ja.o \nDa-asalo nape chu-sokpabo; \nUn' bimung rasong !", 'songNumber' : 289},
  {'title' : 'CHAKATBO, ANG\' JANGGI',
  'song' : "1. Chakatbo, ang' janggi, \nPaprangko chel-atbo; \nJisu' boli nibo, \nUni an-chi jokjok \nAng' a-selan Ua sichakjok x2 \nAng' bimungko Uno sejok\n\n2. Uan bi-chakpae \nSinghasonni sepang \nAn-tangni ka-saachi \nAro an-chitangchi \nPilak mandeko piokjok x2 \nAro singhasono nangjok.\n\n3. Mata dambongako \nSko bikrok a-dingo, \nMan-e mol-molbea' \nAngna bi-chakbea. \nWatpabo 'ne Ua bi-a, x2 \nPiokgimin sijachina.\n\n4. Ang' Isol ra-chakjok, \nKemaba on-manjok, \nAngko de mingatjok, \nKenchaka dongjajok. \nKa.donge uni sepango x2 \nApa, Apa, inpaman-jok.", 'songNumber' : 290},
  {'title' : 'ANGKO PIOKANTAL',
  'song' : "1. Ango ring-ani git donga, \nAngko piokantal, \nPiokgipa, Rajan' ring-na, \nAngko piokantal.\n\n(Ring-taitaiani) \nAngko piokantal,........ x2 \nUn'bimungna ka-srokgen, \nAngko piokantal, \nJokatgipana ang' ka-srokgen.\n\n2. Ango chu-sokatgipa gnang, \nAngko piokantal; \nUn skako daknasa nama \nAngko piokantal.\n\n3. Ango saki namnamgipa, \nAngko piokantal; \nChel-ata kenchakarangko, \nAngko piokantal.\n\n4. Ango katchana ka'a moa \nAngko piokantal; \nUn' an-chini gamchatana, \nAngko piokantal.\n\n5. Angna nambea Nok donga, \nAngko piokantal; \nJeo jringjrotna dongpagen, \nAngko piokantal.", 'songNumber' : 291},
  {'title' : 'ISOL NANG\' RAKIGEN',
  'song' : "1. Jajrengnabe jeba ong-bo \nIsol nang' rakigen. \nKa-saa grang ning-o dongkambo, \nIsol nang' rakigen.\n\n(Ring-taitaiani.) \nIsol nang' rakigen, \nSalantio, rama re-o; \nUa nang' rakigen, \nIsol nang' rakigen.\n\n2. P'lak nanganiko Ua on-gen, \nIsol nang' rakigen, \nUo ka-donge chu-onggen. \nIsol nang rakigen.", 'songNumber' : 292},
  {'title' : 'JISUN\' AN-CHIONA AGRE',
  'song' : "1 Jisun' an-chiona agre, \nAngni ka-dongchakani gri, \nNambatgipaoba ka-dongja, \nUn' bimungosan ka-donga.\n\n(Ring-taitalani) \nKristoo, Rong-brako chadenga, \nP'lak gipinde an-chengrara. x2\n\n2 Andala Uko pindapon, \nUn' dingtanggija ka-saon \nPangchakata jringjring anga, \nAng' siltin Unon raksranga.\n\n3. Un' mikcheta, an-chi angko \nMangrakata ruraarango. \nP'lakchi nom-bokon ang' janggi \nJisusan ang pangchakani.\n\n4 Re-bagen Ua jensalo, \nAngko Uo man-chong unon, \nPindapen Un' rongtalachi \nUn' mikkango dongna dos gri.", 'songNumber' : 293},
  {'title' : 'KA-DONGAIBO NA-MANG UNA',
  'song' : "1. Angni re-a mikkang, mikkang, \nBobil, singho bidom ginang, \nSalmitale chikna angko \nJakotenga rim-na jakko.\n\n2. Ia bobil ka-gitingrang; \nJisun' bilna bama u rang' \nKnapajok Elijako \nJordanchina watatako.\n\n3 Angni ska a-gilsaknirang, \nCha-minokna am-a u'rang, \nChanchisokja dukni salo \nSkimpila ka.gualao.\n\n4 Jokna an-ching saksanmangmang; \nSichakaha Gitel da-nang; \nKa-dongata Gitel angko, \nDongbo, Nang-ni danil, ango.\n\n5. Jongada, no, ama, apa, \nKa-dongaibo na-mang Una, \nBiap on-gen Salgisako, \nAn-ching' re-an' duk matchoto.", 'songNumber' : 294},
  {'title' : 'GITELNA BAMGIPA',
  'song' : "1. Gitelna bamgipa kusi ong.gnigipa \nOng-gen Salgin' gamko man-gipa; \nAgannan amjawa ua suk bon-jawa, \nMan-e p'lak janggini sukrangko.\n\n2. Ua suk' man. atgipa, angko Jokatgipa, \nAn-chitangchi papko talatjok. \nKristoo katnapoa, bebeko man-oa, \nRongtala bimungko man-pajok.\n\n3. Gitelko, nikode, bon-kaman' salode, \nUn' Singhason' sam'o asonggen, \nNamen ka-srokbee ring-pagen katchae, \nSalgin' sa-gre gita ong pilgen.\n\n4. Uan ka-saan' grangchi rimgen Salgin' Song chi, \nJeo pap, ruraa, dukrang grijok, \nDakmajoa grijok, bon-jok jajrengani; \nUnode namgen, ka-srokginok.", 'songNumber' : 295},
  {'title' : 'PANGNAN NANG.KO NANGA',
  'song' : "1 Pangnan Nang-ko nanga, \nO,ang' Gitel \nGri tom tomatgipa, \nGitel gita.\n\n(Ring-taitaiani.) \nNanga, O angna nanga! \nGitel, Nang-ko nanga; \nDa-o patipabone \nAnga re-baa.\n\n2 Pangnan Nang-ko nanga, \nSepang dongbo; \nRuraani bilgriwa, \nNang' sepango.\n\n3 Pangnan Nang-ko nanga, \nChu.sokatbo; \nNang' skako uina \nAngna skibo.\n\n4 Pangnan Nang-ko nanga, \nRongtalgipa; \nPatia man-gipa \nNang-nin anga.", 'songNumber' : 296},
  {'title' : 'ANG\' BEBERA-A NANG-O',
  'song' : "1 Ang' bebera'a Nang-o, \nChisolni Mes Bi-sao, \nJokatgipa; \nKnabo ang' bi-ako \nGimaatbo ang' papko \nO, da-ontal, angko \nNang-nin dakbo.\n\n2 Nang' ka-saani angna, \nBil ong-chong ka-tongna, \nBimchipatbo; \nNang-na ang ka-sana, \nNang' sichakanina, \nDimel' dingtanggija \nTangkamatbo.\n\n3 Ang' duk man.mitingo, Andalaan duulo Angko dilbo; \nChel-at' andalako, \nAng' duk mikchirangko \nSepang Nang-ni angko, \nPangnan donbo.\n\n4 Janggin' jumang bon.o, \nSian' ka-sinjrimao,\nJokatgipa, \nChel.atbo kenako, \nKa-donggijaniko, \nRimdobo jokgimin \nAng' janggiko.", 'songNumber' : 297},
  {'title' : 'SALGIO NENG-TAKANI',
  'song' : "1. Anga bao neng-takgen, \nNeng-bean saloba? \nA.kitikna am-eoba, \nBiapkon man-jawa.\n\n2. Jeo sina nanggen, \nDuk matchotjabejok; \nAiao ! maikai janggini duk, \nDukan dultokaijok.\n\n3. Suk man-na am-oba, \nA-gilsakode gri, \nSian' ja-mano janggiba, \nMan-egen dukari.\n\n4. Ojokbebeosa,\nGrapnade nangjajok; \nJeo jringjrotna biap gnang, \nUosa sukchong-motjok.\n5. O Isol, rakibo,\nAngaban jokpana; \nKa-sapaemung on-paboda, \nAngni jeko bi-a.", 'songNumber' : 298},
  {'title' : 'DUK SUKOBA',
  'song' : "1 Duk sukoba, gisik katchae \nSal re-atgen iano; \nGitelni re-baan' salode, \nJokna man.gen Salgio. \nPap ka-jaode grapan griwa \nJringirot ring-e mitelgen.\n\n2 Je suk man-gen anga uon, \nOng-gen uan jringjrotna, \nDakarangni chon-tokoba, \nIndiba ua chon-ja; \nUanode, chengo gitan, \nSukni bilsi ong-pilgen.", 'songNumber' : 299},
  {'title' : 'RA BO BIMUNGKO JISUNI',
  'song' : "1 Ra-bo bimungko Jisuni, \nDuk aro kalimgipa; \nIan ka-dimeatani, \nRa-bo jechi re-oba.\n\n(Ring-taitaiani) \nMingnama, su-ua ! \nA'an' aro Salgin' katchaa. \nMingnama, su-ua ! \nA-an' aro Salgin' katchaa.\n\n2 Ra-bo Jisun bimung' pangnan. \nJa-gana Danil gitan; \nRuraa nang-ko duleode, \nRang-spitbo bi-aode.\n\n3 Mingnama Jisun' bimunga \nMaikai katchabeata; \nKa-saani chingko rim-oa, \nChing' srerangba ring-ata.\n\n4. Jisuon dem-e ja-chikko \nTugope Uni ja-ao, \nRajan' Raja minggen Uko, \nAn-ching re-a matchoto.", 'songNumber' : 300},
  {'title' : 'SENG-BAN SALO KATCHATAIGEN',
    'song' : "1. Onichaobo, re-e neng-gipa, \nSengban'salo katchataigen. \nSastroo Isol agana, \nSengban' salo katchataigen,\n\n(Ring-taitaiani) \nPringwalo katchataigen, \nPringwalo katchataigen. \nGrapa wal sa ong-na ama, \nSeng-ban, salo katchataigen.\n\n2 Mopilgiparang kennabe, \nSeng-ban' salo katchataigen. \nO kalimgipa, grapnabe, \nSeng-ban salo katchataigen.\n\n3 Bal ripegipa, nidobo, \nSeng-ban salo katchataigen. \nKengipa papi, ka-dongbo, \nSeng-ban salo katchataigen.\n\n4 Isol mikchiko u-sitgen. \nSeng-ban' salo katchataigen. \nGrapa, skimarang bon-tokgen, \nSeng-ban salo katchataigen.", 'songNumber' : 301},
  {'title' : 'NAMA UIANI',
    'song' : "1 Nama Uiani, Jisu angnin, \nSalgin' rasongko man-soa ian; \nJoka' man-aha, Isol brejok, \nAn-chichi tale Gisikchijok.\n\n(Ring-taitaiani)\nIan ang kata, angni ring-an, \nJisuko ring-a salgimikan. \nIan ang kata, angni ring-an, \nJisuko ring-a salgimikan.\n\n2 Una bamsranga, ka-sroksranga, \nKatchae nikani angna naenga. \nSa-gre ong-one knaatenga, \nSalgini kata, ka-saania.\n\n3 Una bamsrange neng-takenga, \nAnga Kristoo an-sengbeenga. \nMikrak' sengsoe nidoenga, \nJisun' ka-saako man-beaha.", 'songNumber' : 302},
  {'title' : 'DUKNI SALO BI-A',
  'song' : "1 Angni dukni salo \nGitelo ninigen; \nDuk' ni joke sukko man-na \nGrape ring-e bi-gen.\n\n2 O Gitel Jihova, \nNibo angni dukko; \nPapni jima, dukni ram-a, \nNipilpabo angko.\n\n3 Bidom singho bobil \nRim-gitange jeta; \nA-ao matcha, chio buga \nJa-ga bisi sata\n\n4 Nini do-oldue, \nSinte' do-pilgimento \nAnga nini kalimronggen, \nJisun ja-o rim-e.\n\n5 Gitel Jisun' Gisik \nNagen ka-saan' Chimik; \nIa nokolni ka-tongo \nChipgen, ka-sindikdik.\n\n6 Ang duk andala sal \nSepangaha seng-na; \nJringjrotni pring an-sengao \nPangnan man-gen dongna.", 'songNumber' : 303},
  {'title' : 'NANG-NI PATIARANGKO CHANBO',
  'song' : "1. Janggini ta-rakarangchi pokpekon, \nKa-dongkuna man-ja ine chanchion, \nNang' patiarangko chanbo, mingprakprak, \nGitel jeko dakjok, aiao inbegen.\n\n(Ring-taitaiani) \nPatiarangko chanbo, mingprakprak, \nName chanbo, Uni kamrangko; \nName chanbo, mingbo mingprakprak, \nGitel jeko dakjok, aiao inbegen.\n\n2 Nang' skimarang basakoba jrimama ? \nNang-na on a chisolko jrimnikama? \nPatiarangko chanbo, kenchaka katgen, \nUnon salrang re-miting' ring-chakugen.\n\n3. Nion gipinrangni sona, a arangko, \nKriston' channa amja gamko chanchibo, \nBrena amja patiarangko chanbo, \nSalgio nang man-gni aro dongramko.\n\n4. Unon dakgrikao, dal-o chonoba, \nKa-donggija ong-nabe, Isol donga, \nPatiarangko chanbo, sa-grerang nigen, \nSiaona dakchak', bilakatkugen.", 'songNumber' : 304},
  {'title' : 'TOM-TOMCHONGMOT',
  'song' : "1. Tom-tomchongmot! ia pap a-gilsako, \nJisu tom-tomata ka-tong' ning-o.\n\n2. Tom-tomchongmot ! kamrang jrimmitingo, \nIan tom tom dakna Jisun' skako.\n\n3. Tom-tomchongmot! duk pokpekmitingo, \nTom-tom ong-aia Jisun' ka-bako.\n\n4. Tom-tomchongmot! bakrang chel-beoba, \nJisun, rakiao name dongtoka.\n\n5. Tom-tomchongmot! mikkangchiko uija, \nJisuko uia; Uan singhasono.\n\n6. Tom-tomchongmot! sian' jagringoba, \nJisu sian' bilrangko amaha.\n\n7. Chu-ongaha; dakgrikarang chon-gen, \nJisu salgin' tom-tom'na okamgen.", 'songNumber' : 305},
  {'title' : 'BASAKOBA TALGEN',
  'song' : "1. Da-o ong ja mikkangchisa, \nSalgio ong-naba donga, \nMikchini ortoko uigen, \nUnon basakoba talgen.\n\n(Ring-taitaiani) \nIndide ka-dong' Isolo, \nUa nang ko rim-a, da-ken; \nRing-kubo rama andalao; \nAn-ching basakoba talgen.\n\n2. Chottomgiminko man-taigen, \nIano dakspako matchotgen; \nSalgisa tale uiatgen; \nUnon, unon an-ching talgen.\n\n3. Maina chanchigramaibejok, \nUnon an-ching tale uigen; \nMaina ring-miting' mikchijok, \nUnon basakoba talgen.\n\n4. Maina an-ching' man-na skako \nInditan chang man-srapjajok; \nMaina onjetjok skarangko; \nUnon, basakoba tal' nok.\n\n5. Isol ramako uisranga, \nGualgija jakchi dilenga, \nBasak' ba mikchi gri nikgen; \nOe, unon, an-ching talgen.", 'songNumber' : 306},
  {'title' : 'TOM-TOM, ISOLNI TOM-TOM',
  'song' : "1. Ang' ka-tongni ning-o tom-tom, \nAiao, mairongpile tom-tom! \nKa-sroke ka-tongni tom-tom, \nTom-tom, Isolni tom-tom.\n\n(Ring-taitaiani)\nTom-tom, tom-tom, aiao inmananiko ! \nAiao inmanpile tom-tom, \nTom-tom, Isolni on-a\n\n2. Jisuni Chisoloniko \nAng' gro' Jisu chottokaha, \nGipinni ja-pang dongjaha, \nTom-tom, Isolni tom-tom.\n\n3. Jisu mukut' stikataon, \nKa-tongo tom-toman gapjok; \nUnosa patia man-jok, \nTom-tom Isolni tom-tom.\n\n4. Tom-tome Jisuo donga, \nUni sepango dongjaha. \nTom-toma agre dongjaha, \nTom-tom, Isolni tom-tom.", 'songNumber' : 307},
  {'title' : 'JOKGEN JISUN',
'song' : "1. Jokgen Jisun' jakpongo, \nTom-tom Un' ka-bako; \nAngni janggi neng-takgen, \nKa-saan' salakimo. \nKnabo sa-greni ku-rang, \nRing-ako u'mangni; \nRasong a'an nalsachi, \nSagalni pil-sachi.\n\n(Ring-taitaiani) \nJokgen Jisun' jakpongo, \nTom-tom Un' ka-bako ; \nAngni janggi neng-takgen, \nKa-saan salakimo.\n\n2. Jokgen Jisun' jakpongo, \nJokgen dukrangoni; \nPap amja saknaatna, \nJokgen ruraoni. \nDongja duk jajrengani, \nDongja uno kenan'; \nBang-ja nina dakani, \nMikchi tingtotsasan.\n\n3. Jisuan sijok angna, \nUchin ang katnapram; \nKim-kim Jringjrotni Rong-dot, \nAng' janggini chakram. \nUnon sengkugen tom-tom, \nWal seng-kuja dipet; \nPring teng-dapkujaona, \nSonan' rikam kakket.", 'songNumber' : 308},
  {'title' : 'JISU ANGNI RIPENG',
  'song' : "1. Bobil bang-beoba, \nSintea gri anga; \nMaina Jisu angni Ripeng, \nUni ripeng anga.\n\n2. Uo ka-donggipa, \nUn' dongako man-a; \nIa ka-dimeatako \nJisu angna ina.\n\n3. Gital Songjinmako, \nKosak' rikman-aha, \nJekon mikron tale nikgen, \nAnga ka-dongsoa.\n\n4. Gisikni jrima gri, \nKa-tong katcha, gapa; \nKa-sroke, ka-sroke ring-a \nSukkosan man-aia.\n\n5. Ka-sagimin Jisu, \nAng' mikron' seng-ata; \nAng suk kosak' dongsoenga, \nKa-tong katchae ring-a.", 'songNumber' : 309},
  {'title' : 'NANG\' KATCHAA SUAKPILENGON',
  'song' : "1. Nang' katchaq suakpilengon, \nBi-e mitelo, \nJongadana bak man-pana, \nOn-pabo.\n\n2. Miko rae jamo chimongon, \nGappilon uno, \nIsolna jongadanaba, \nOn-dapbo.\n\n3. An-saopilon nang ka-tongo, \nKam ka-na skao, \nJongadako dakchakpana, \nKrengbebo.\n\n4. Patiani bak' ra-ronon, \nDukni balkoba, \nDangdike on-chongmotenga, \nIsolna.", 'songNumber' : 310},
  {'title' : 'UNI KA-SARA AGANSOKJA',
  'song' : "1. Jisuni ka-sara angna, \nChisolo Uni duk chaka, \nAng' janggiko piokana, \nAganna amsokja.\n\n(Ring-taitaiani)\nUn' ka-sara agansokja, (agansokja) \nUn' ka-sara agansokja, (agansokja) \nKa-sara Jisuni angna, \nAgansokna amja.\n\n2. Chaktogija duk ong-aha, \nBu-sun mukutko stikaha, \nAngni janggiko tangatna, \nAgansokna amja.\n\n3. Tom-tomani ang' Gitelo \nMan-gen Un singhasonsamo, \nUn' rongtalgipa an-chio, \nAgansokna amja.\n\n4. Katchaani ong-gen Gitelo, \nJokgen tom-toma Un' on-ao, \nKa-donggen mangrake Uno, \nAgansokna amja.", 'songNumber' : 311},
  {'title' : 'JIHOVA ANGKO NIRIKGIPA ONGA',
  'song' : "1. Jihova angko Nirikgipa ong-a; \nAngna nanga griwa, tom-tom neng-taka. \nSam nama chisamrango angko moanga, \nNom-angon ang' janggi an-saoatpila. x2\n\n2. Siani a kongko anga re-oba, \nNa-an ang baksa donga mamung kenmanja Nang' gol-dik, \nNang' monggot; Ka-dimeatgipa \nDila ramarango jajrengman-gija. x2\n\n3. Bobilrang mikkango angna cha-ani' \nDonsoa rangkare suakpile, Na-a; \nPatie nongaha ang' skoo tochi, \nDakkugen angna mai nambata' Ua. x2\n\n4. P'lak namani aro ka-sae dakani \nAngni salrang dipet ja-rikchong angko; \nRe-miting ja-kolko pagitchamrangni \nSoke dongkam'jana Immauel songo. x2", 'songNumber' : 312},
  {'title' : 'NA-AN ANGNA SIMSAKA',
  'song'  : "1. Jajrengarang duulon angko, \nRe-on anga bu-sugrimko, \nNabaa Gitel, ang' gisiko, \nNa'an angna simsaka.\n\n(Ring-taitaiani)\nNa-an angna simsaka, (angna) \nNa-an angna simsaka, (angna) \nKenani gri Nang' sepango, \nNa-an angna simsaka.\n\n2. Janggin' simbrarang sinchepon, \nDukni jagringrang simdapon, \nMikrakata ang gisikko, \nNa-an angna simsaka.\n\n3. Duk, sukko anga grongoba, \nDingtang ong-ja indioba, \nMaina Gitel, anga uia, \nNa-an angna simsaka.", 'songNumber' : 313},
  {'title' : 'ISOLONI BRANGSRANGAONI',
  'song' : "1. Isoloni brangsrangaoni \nAng' ka tong katnappiltaia; \nAng' gisikni skimaoni \nGitel, Nang-on neng-taktaia.\n\n2. Nang' ku-rangko knataiaha, \nKa-tongo dakgrik' tom-toma, \nGisiko katchae, uia, \nRama, Bebe, Janggi, Na-a.\n\n3. Jena Nang-o ka-dongsranga, \nKa-dongako chu-sokata; \nMaina Na-a kakket ong-a, \nKa-saaba jringjrotona.\n\n4. Jean Isolo bebera-a \nJean Katao pangchaksranga, \nUna Isol Seng-an' ong-a \nNe' gisiko saki donga.\n\n5. O Rong-brak jringjrotnigipa \nNang-o ka-donggramaijawa; \nO jaksanni Nirikgipa, \nChingko rim-chakbo jringjrotna.", 'songNumber' : 314},
  {'title' : 'DUKKO NING-TUE GOPBO',
  'song' : "1. Re-angbo, nang' dukko \nNing-tue gopbo, \nA-gilsaknin bang-a, \nNang-nin' donnubo; \nWal do-ga chipchango \nChanchibo tom-tom; \nAganbo Jisuna, \nNamtokgen p'lakan.\n\n2. Aganbo Jisuna \nU-ia dukko; \nAganbo Jisuna, \nChel-atgen dukko; \nKolambo katchaako, \nSata ramao; \nBi-ebo, neng-gipa, \nJrengatgen balko.\n\n3. Jrime neng giparang, \nDukni ka-tongrang, \nAndalao dongenga, \nRe-e katchaatbo; \nKa-sroke dongchina \nGipinna on-bo; \nJisuna agane \nNang' duk' chel-atbo.", 'songNumber' : 315},
  {'title' : 'UA SAOBA NA-ANMA?',
  'song' : "1. Saoba nama kamko dakjok, \nRipeng chong-mot 'ne mesokjok, \nSaoba nama gitko ring-jok, \nSalgirangko ching-atbejok. \nUa saoba na-anma ? \nUa saoba na-anma?\n\n2. Saoba tangna namnikbejok, \nOn-nade kusi ong-bejok, \nSaoba ka-donge dakgrikjok, \nBebena warachakbejok. \nUa saoba na anma ? \nUa saoba na-anma?\n\n3. Saoba kontarangko galjok, \nSimsakgija re-ataijok. \nSaoba janggiko gimaatjok \nIndinari tangarijok. \nUa saoba na-anma ? \nUa saoba na-anma ?\n\n4. Saoba salko ching-ataha, \nJringjring walko a-rikata. \nSanibani kam katchaatta \nUni janggi bon-jawaha. \nUa saoba na-anma ? \nUa saoba na anma ?", 'songNumber' : 316},
  {'title' : 'O TUSIE ARATGIPA',
  'song' : "1. 0 tusie aratgipa, \nJanggin' salko watatgipa, \nChakatboda, an-ching re-na, \nJisun' miko bakbak rana.\n\n2. Okamenga an-ching' Gitel. \nJokpabone angni a-sel, \nO tusie aratgipa, \nJanggin' salko watatgipa.\n\n3. Papni marang gitcham soe \nGimaaha, Jisun' sie, \nO tusie aratgipa, \nJanggin' salko watatgipa.\n\n4. Sian' a songko re-oba, \nNamgija nang-ko duloba, \nNang-ni una ka-dongachi \nJokjawama, Jisun' bilchi?\n\n5. Sian' beri wal-sareko. \nKimitaha Jisu uko, \nO tusie aratgipa, \nJanggin' salko watatgipa.", 'songNumber' : 317},
  {'title' : 'SIA SUK\' DO-GACHOL',
  'song' : "1. Angni dukni wal seng-aha, \nA-gilsakko watnakaha, \nJisun' ku-rachaka. \nJringjrot Salgini sukrangko, \nSimanosa man-a uko, \nUchinan ka-sroka.\n\n2. Angni be eno saa ding-a, \nSukko man nasa badinga, \nDukko chakesa suk. \nA-gilsakni niam ian, \nUia pilak mandean, \nIndake Salgin' suk.\n\n3. Gitcham soe gital bite, \nSimanosa Salgin' mande, \nSian' suk' do-gachol. \nO Gitel, angko rimangbo; \nAngni paprangko watpabo, \nKa-sagipa Isol.", 'songNumber' : 318},
  {'title' : 'ANGMUNG DONGBO',
  'song' : "1 Angmung dongbo ! bakbak sal re-enga, \nAndalsimsim, dongbo, Gitel, angmung. \nGipin chakgiparng angko wato, \nCholgrina Chakgipa, angmung dongbo.\n\n2 Janggini sal bakbak bon-angenga, \nSukrang rongdima, rasongrang chon-a; \nDingtang ong-e pilak gimaangenga, \nDingtanggijagipa angmung dongbo.\n\n3 Nang' dongako pangnan angna nanga, \nNang' ka-sasan ruran' bilko ama. \nNang' gita samung angko chelchaka? \nJajrengo, ka-sroko angmung dongbo.\n\n4 Siangengo Nang' Chisolko nina; \nTeng-sudape Salgichi dilchina. \nSalgin' seng'baa! A-an' wal gimaanga \nTango, sio, Gitel, angmung dongbo.", 'songNumber' : 319},
  {'title' : 'AN-CHING PANGNAN TUSIJAWA',
  'song' : "1 An-ching pangnan tusijawa, \nMaina an-ching chakatgen; \nUn' salo ekgrikatjawa, \nPangnan Un baksa donggen. \nSagal tu-begipaoni, \nA-kawe aro a-bri, \nUarangoni, jeba dong', \nJinmarang chakattokgen. \n\n(Ring-taitaiani.)\nTusia pangnan ong-jawa \nRe-baenga nama sal, \nUnon ekgriktaina nangja, \nPangnan Un baksa donggen.\n\n2. Jensalo ripengko gope \nDukko man-batbeaha, \nIndiba ka-dongna man-a, \nMaina ua chakatgen! \nAro chakatatan' salo \nUko grongtaina man-gen; \nUntaltal ekgrikna nangja, \nIndiba damsan donggen.\n\n3. An-ching pangnan tusijawa \nAndalbea gopramo, \nMaina Gitel rimanggipa \nKa-saao daktokaha. \nNambea Songjinmaona \nSia, re-bana man-ja! \nPangnan sukko man-na amgen. \nJisu Kristoba donggen.", 'songNumber' : 320},
  {'title' : 'SRIPE SALRANG BON-ANGON',
  'song' : "1. Sripe salrang bon-angon, \nSalgini sal seng-on. \nUn' salni pringna katchae, \nAn-sengao mikrake; \nWaljatchin' wal andala \nSepangjok sal ong-na, \nDongkamgen Un' rasongo, \nImmanuel songo.\n\n2. Kristoni Chimik dilsa, \nKa-saan' wari tu-a, \nA-sakni p'lak chirangna, \nNambatbea ringna ; \nApala sagal gitan \nGipsoka Un ka-saan\" \nUn rasong donga pangnan, \nNama Song jean.\n\n3. Ka-srokgen ang mikronna, \nUn' mikkangko nikna, \nRasongko angna nangja \nMukutkosan am-ja; \nIndiba ian mingsa, \nJaksrama Un' ka-saa; \nP'lak rasong Mes Bi-sani; \nImmanuel songni.\n\n4. Ka-sachaka Un' bichal, \nRikaha salni sal, \nAiao! duk saknaa man-a, \nBon-gen Uni bilna, \nNitima jak ja a angna, \nMitelgen Nang' kamna, \nAsonggen rasongtango, \nImmanuel songo.", 'songNumber' : 321},
  {'title' : 'SABAS PAGITCHAMRANG',
  'song' : "1. Sabas pagitchamrang, rikchenggiparang, \nKriston' mondolina gamchenggiparang, \nNike chubatarang' a'sakna bate, \nNeng-oba chakchike kamtango donge.\n\n2. Sabas pagitchamrang, rikchenggiparang \nDonangjok an-chingna pangkamgiparang; \nOkama rongtale, ka-rikchong kamrang. \nRipingchong ra-rike cham-gija gamrang.\n\n3. Sabas chasong gital, gamenggiparang, \nKristoni a-bako, rakigiparang; \nKam dal-bo ba chonbo, na-a dajechak, \nJeo nang-ko nanga, re-angbo bakbak.\n\n4. Sabas pante me-tra, dal-baenggiparang, \nChingni ja-man, ja-man, riknakgiparang; \nBebeko dajakwat, nambatangkugen, \nRa-rike ching' gamrang, silroroanggen.\n\n5. Sabas indide ching' p'lak chasongnirang \nToksan, apsan a-bao gamenggiparang; \nJensalo kam bon-gen, Gitel rimsogen, \nRasongni mukkutko, sakpraknan on-gen.", 'songNumber' : 322},
  {'title' : 'ANG\' RE-GEN SIAN\' SALAKIM AKONGKO',
  'song' : "1. Ang' re-gen sian' salakim a-kongko, \nJokatgipani ka-sae simsakao \nKu-chakjok watgaljawa pangnan angko, \nUn'gol-dik ka-dimeargen angko.\n\n(Ring-taitaiani.) \nBakrajoljol, a-kaweko, \nRe-genoba sian' salakim a-kongko, \nKenatjawa chipakorerang angko, \nMan-egen tom-tom janggi uano.\n\n2. A-kaweo sian jagringko re-on, \nKenbeani salrangko badeangon; \nBilakgipa jakpongchi Uan dilanggen, \nUn' baksa katchabee donggen.\n\n3. Bakrajoljol kenanirang dongoba, \nNikegen rasongni pringko indiba; \nRing-epagen Jordanni nalsaoba, \nGitelan sengsogen angkoba.", 'songNumber' : 323},
  {'title' : 'SALGI\' NENG TAKA\' P\'LAK RONGTALGIPA\'',
  'song' : "1. Salgi' neng-taka p'lak rongtalgipa, \nJerang a-ao Nang-ko' ku-chakaha, \nNang-ko, O Jisu, miteljringchina, \nAlleluia! Alleluia!\n\n2. Na-an dakgrik' krengon Dilgipachim. \nRong-brak, Killa, Na-an u'mangninchim. \nAndalmitingo Seng-a chong-motchim, \nAlleluia! Alleluia!\n\n3. Nang' si pairang kakket bebe ong-chong, \nSkang rongtalgiparang gita dakchong, \nU'mang baksa mukutko man-pachong. \nAlleluia! Alleluia !\n\n4. Katchaan' rengsi uamangnin Salgio, \nChinga neng-e dakgrikkua iano, \nU'mang ching baksa nangrima Nang-o, \nAlleluia! Alleluia!\n\n5. Bilong' dakgrikon chinga nom-engon, \nChegni gitko chel-aoni knaon, \nKa-dongpiltaie man-taia bilkon, \nAlleluia! Alleluia!\n\n6. Seng-baa gita katchaan atam ong-gen, \nDakgrik' oni bakan chechimgen. \nJisu, ching' Raja, Na-an amsranggen, \nAlleluia ! Alleluia!\n\n7. Rasong ong-batgipa sal nabagen, \nRongtalgipa pilakan chechimgen, \nJisu, ching' Raja, Na-a amsranggen, \nAlleluia! Alleluia !\n\n8. P'lak songoni sagal' nalsaoni, \nNaptokegen do-gako Salgini, \nPa, De, Gisikko, mitelchrotokgni, \nAlleluia ! Alleluia!", 'songNumber' : 326},
  {'title' : 'AN-SENGANI SONG',
  'song' : "1. An-sengan' Song donga, \nNamen chel-a, \nUo torom manderang \nDongtokenga. \nKa-siroksiroksa, \nName ku-rang salesa, \nRajakon mitele \nRing-tokenga.\n\n2. 'Mo ka-sagiparang\nUn' Songona; \nRu-ute da-dongaha, \nMaina kena ? \nJeo song an-senga, \nJeo paprang gimara, \nUo Isol ka-sara, \nJajrengman-ja.\n\n3. Ua songo seng-bea \nWalang salang; \nIsolni ka-sara \nChu-chotgijan; \nJensal' Songnok ong-gen, \nToromi gamseng' man-gen, \nSal gita teng-sue, \nRaja ong-gen.", 'songNumber' : 327},
  {'title' : 'SALGIO MAN-GNI NOK',
  'song' : "1. Ka-saade sakantinan, \nO, maikai namani, \nNorokoniba jokgen 'na, \nNama, an-sengani.\n\n2. Ang' nok ong-ja a-gilsako, \nNokde donga chel-a; \nTorom mandeni dongrama \nName manchan chel-a.\n\n3. An-sengani song chel-oba. \nGisikode nika; \nSalgini songo angnaba \nJisusa nok rika.\n\n4. Niksengbeemu katchatoka, \nGisiko niktokjok; \nSalgisaka maikai donga \nUako niknakjok.", 'songNumber' : 328},
  {'title' : 'KA-SROKANI SONG',
  'song' : "1. Salgiode nama biap, \nUnon Isol songdonga.\nUko gisik ra-paode,\nDuk ong-aba gimara. \nChijanggiba dilsa unon,\nJisu uko jokata; \nUa chiko ringeode, \nSaa ding-aba an-senga.\n\n2. Hajal hajal sa-grerangan \nIsolkosa dultoke, \nSakantian ka-srokbee. \nDuldonggome ring-toka. \nJringjrotan' walade grijok, \nUan song an-sengao; \nToromirang jringjrot unon \nRing-tokenga, Songtango.\n\n3. Un ka-saako maichi togen? \nAgan' mesoknan man-ja. \nBilsi joljol re-angoba, \nUni ka-sara bon-ja. \nA-gilsakni manderangde, \nUa sukko u-ija; \nA-gilsako dongpaoba, \nDuk ong-asa matchotja.", 'songNumber' : 329},
  {'title' : 'JERUSALEM, SUK NOK ANGNI',
  'song' : "1. Jerusalem, suk' nok angni, \nChanchi' jringjrot uko; \nAngni duk ban’ salo chon gen, \nNikgen ua sukko. \nSal gita teng-sugipa song, \nNion ringrang ringrang. \nDo-garangba muktanisa,\nSonachek sorokrang.\n\n2. Un bari namen nambea, \nNitoa bolrangko, \nManderangde nikpakuja \nIndake namako, \nIndake nambea gamrang \nSalgio dongode, \n'Ode anga sina maina \nIndita kenade?\n\n3. Jeo tom-a toromirang. \nNeng-takronga pangnan, \nAngko rimbo uanona \nKa-sagipa Na-an, \nJeona Gitel re-angjok, \nUnonan re-anggen; \nJringjrotnan Ukon nikemu \nAnga mitelronggen.", 'songNumber' : 330},
  {'title' : 'SALGINI ANG\' NOK CHING-BEA',
  'song' : "1. Salgini ang' nok ching-bea, \nUano gri duk ba sia; \nChing-bata Un' krongrang salnan, \nAng' nok ong-gen, biap uan.\n\n(Ring-taitaiani) \nAnga re-gen, anga re-gen, \nUa Noko sukko man-gen, \nRe-gen uchin, sija unon \nPangnan janggi man-gen unon.\n\n2. Je nok ginang Salgisako, \nDonga Salgin' Apa uno; \nSalgini Song nama namen, \nA-gilsakko wate re-gen.\n\n3. Mande minga, suk gamrangko, \nAmtokchina a-gilsako. \nSepango singhason' Apan', \nMan-chong dongna jringjrot angan.", 'songNumber' : 331},
  {'title' : 'A-GILSAKONIKO WATBO',
  'song' : "1. A-gilsakoniko watbo, \nRa-pabo Kristoko; \nUnosa re-gen Salgina, \nSija je biapo.\n\n2. Salgin' Song namen nambea, \nJringjrot an-sengan' song; \nNeng-ani gri, an-sengbea, \nNamachin rika song.\n\n3. Unon Isol, Jisu Kristo, \nAro nama sa-gren ; \nToromi mande suk man-a, \nPangnan ka-sagrikgen.\n4. Uno gri tol-a, namgija \nAro papi mande; \nGri til-eka, gri ra-seka, \nUa suk songode.\n5. O Isol, ian ang' bi-a, \nSuk Songko man-pana; \nGalatbo papni jrimako, \nAngba mitelpana. ", 'songNumber' : 332},
  {'title' : 'RE-GIPA ANGA SALGICHI',
  'song' : "1. Re-gipa anga Salgichi, \nAngni salde re-angjok; \nUko beng-ja, re-angchina, \nUa duksa man aijok.\n\n(Ring-taitaiani.) \nSokjok anga Jordanona, \nRipeng batangjok uko; \nJa-manode anga man-gen \nSongjinma namgipako.\n\n2. Salgioni nokko nikjok; \nHai kang-kare kanaha. \nAn-ching' Gitel ge-etatjok, \nTariboda, re-naha.\n\n3. A-sel nangchong, tangmitingo, \nIndiba anga ring-gen; \nDukni pal man gen batesa, \nSonan' biapko man-gen.\n\n4. Gimachina duk man-arang, \nWatbo namgijarangko; \nSalgichi okamengaha, \nMan-gen nambea nokko.", 'songNumber' : 333},
  {'title' : 'ONG-JA AN-CHING SONGPANGGIPA',
  'song' : "1. Salgi ching' nok ringrang ringrang, \nSalgini sa-gre kirubrang \nDule Jisun' Singhasonko \nMitelronga jringjrot Uko.\n\n2. Ia tambu a-gilsakni; \nJrongna nanggen a-aoni; \nGitcham bitchil a-ao sogen, \nBimiksa rasongni ong-gen.\n\n3. la kacha ning-o donge \nNini kalima, gramchie; \nSongni dedrang songregipa, \nOng-ja an-ching songpanggipa.\n\n4. A.ningo pangnan tujawa,uni \nSiani bil ganggopjawa, \nSian' beri wal-sareko \nMangkimaha Shilo uko.\n\n5. Jisu jeo, Singhasono, \nChinga pangnan donggen uno; \nChing' nok ong-ja a-gilsako, \nJringjrotni Nok Salgisako.", 'songNumber' : 334},
  {'title' : 'SUK, SUK SONG',
    'song' : "1. Niram rang-sitgipan' sikan' ji-jaako, \nKnatoa janggina namgipa 'nako, \nAlao ka-saani dringko man-pana, \nSongo grongao Jisuko u-ina.\n\n(Ring-taitaiani.) \nSong song ! suk! suk! song! \nDaksoa Jisu angko katchan' Songna\n\n2. Tom-tomani manden' nangrima nama; \nJisuan nambata, Un' ka-saa chon-ja. \nNang-oni duko pil-nipil rooba, \nNang-ko nina ska, rasongni Songoa.\n\n3. Rang-spita anga, paponi joksrangna; \nPeng-begipa uan, Nang-mu nangrimna. \nRuraa bang-oba, chipakkore gita, \nTom-tom ong-tokgen, Songtango Nang baksa.\n\n4. Dakgrikani a-kongo dongengana, \nDakgrike manina dakchakbo angna; \nRe-gen nang-ona, duk ong'arangoni \nKa-sroke ka-donge Songo neng-takna.", 'songNumber' : 335},
  {'title' : 'RE-GIPA ANGA SALGICHI',
    'song' : "1. Re-gipa anga Salgichi, \nJringjrotan an-sengan' Songchi; \nNama biap bang-gipachi, \nPangnaba sigija songchi.\n\n2. Jeo pangnan sal, ja, aski \nTeng'suna nangja salanti, \nIsolni bil seng-a uno, \nSeng-dapenga sa-grerango.\n\n3. Re-gen uchin, re-gen anga, \nTambu be-en a ako watna; \nRe-gen ka-sroke unona, \nCham-gija mukutko man-na.\n\n4. Dongmitingo a-gilsako, \nRe-genoba sian' songko, \nA-bimandu a chang diltu, \nMan-genoba songni bu-su.\n\n5. Indioba dongdikjawa, \nChipakkore satdapjawa; \nRe-gen anga, re-gen anga, \nPangnan uchinan ka-sroka.\n\n6. Mikchi ong-e gisik pil-na, \nSokna man-gen Salgiona; \nO angni Jringjrotni Rong-dot, \nOn-bo rim na Nang-o kotkot.", 'songNumber' : 336},
  {'title' : 'APANI NOK DONGA',
  'song' : "1. A-gilsak burung pil-sachi \nApani Nok donga; \nJringjrotna suk bon-ja uno \nCham-gija Songjinmao.\n\n2. Uano gri saini ding-a, \nGri jani teng-sua, \nSia, saa gri uano, \nBobilna kenmanja.\n\n3. Chijanggi joka uano, \nGrikbea chi gita; \nUn' rikamo toromirang. \nKa-sroke ring-esa.\n\n4. Uamangni Songdongramo \nDuk aro grapa gri; \nUa namgipa Songjinmao \nIsolni saoba gri.\n\n5. O maikai nama sukni Nok! \nRongtalbea Biap ! \nUno donggipa pilakan \nAua suk sagalo.\n\n6. Ang re-a basako bon-nok? \nDakgrikaba chel-nok? \nBasako man-e uako \nAugen suk sagalo ?", 'songNumber' : 337},
  {'title' : '1. NAMA SONG, CHING-A SONG',
  'song' : "1. Ri-ra ri-ra ching-a ua Song; \nChel-bea chingoni unona. \nAn-chingni pangchake dongao \nSokegen donsoa biap'na.\n\n(Ring-taitaiani.)) \nNama Song, Ching-a Song! \nGronggen an-ching ua biapo. \nNama Song, Ching-a Song ! \nGronggen an-ching ua biapo.\n\n2. Kalimjawaha an-ching uno, \nMitele mitchue ring-egen. \nGronggen an-ching Nama Biapo. \nRang-spegija neng-taktokegen.\n\n3. Jaksrambegipa Apa Isol \nOn-tokjok patie salrangko; \nMitele ring-tokna salni sal \nAn-chingna on-ani rasongko.", 'songNumber' : 338},
  {'title' : 'RASONG ONG-GEN',
  'song' : "1. Jensalo ang' dukni kamrang bon-gen, \nAro Salgin' Nokchi name sokgen; \nKa-sagipa Gitel sepangon, \nJringjrotona kingking rasong ong-gen.\n\n(Ring-taitaiani) \nRasong ong-gen, angnin ong-gen, \nNama rasong, angna rasong \nJensalo Jisun' mikkangko nikgen, \nOe, ua rasong, jong, rasong ong-gen.\n\n2. Jensalo anga Un' ka-saan' gimin \nSalgio dongna cholko man-pagen, \nUni mikkangko nikpana mangmang \nJringjrotna rasong angna ong-begen.\n\n3. Ka-sagipa ripengrangko gronggen, \nKatchaara chibima gita jokgen. \nJokatgipan' namnike ra-chaka, \nJringjrotna rasong angna ong-begen.", 'songNumber' : 339},
  {'title' : 'KA-SAACHI JOKATAHA',
  'song' : "1. Basakoba sal bon-anggen, \nUnon da-o gita nikjawa. \nKusi ong-beani ong-gen, \nJensalo Salgina sokgen.\n\n(Ring-taitaiani.) \n{Uko mikkang chakgrikegen \nKa-saachi jokaha ingen.} x2\n\n2. Basakoba anga sigen, \nBadita ruuta da-o uija; \nIakosa anga uia. \nBiap damsa angna donggen.\n\n3. Jisu salsao re-bagen, \nUnon anga Uko nikgen; \nNama ine Ua ingen, \nAro anga neng-taksranggen.\n\n4. Un' saljaskal anga senggen, \nName mikrake dongkugen; \nJensalo Uko nikpagen, \nUnon ang' janggi katchagen.", 'songNumber' : 340},
  {'title' : 'RAJANI DE ANGA',
  'song' : "Man-e cha-gipa angni Paa ong-a, \nPilakchini gam Uni jako donga; \nHira, mukta aro tangka sona, \nUn' sundukrango gappilsrangaha.\n\n(Ring-taitaiani.) \nAnga Rajani De! \nRajani dejok! \nJisu baksa ong-a, \nAnga Rajani De!\n\n2 Angni Paani De, jokkatokgipa, \nChangsa a-o rojok kangalrang gita, \nDa-ode ong-jok jringjrotni Raja! \nSalgio on-sogen biapko angna.\n\n3 Skango roaigipa a-o dongjok, \nPapnasa mangsonge anga dongaijok; \nDeragatmanjok angko indiba, \nMan-nok mukutko, nok, ba-rakoba.\n\n4 Tambu ba nokko, maina simsaka. \nUchi angna nok te-sako rikenga; \nA-rikatako da ode man-oba; \nIsolna rasong, Rajan' de ong-a.", 'songNumber' : 341},
  {'title' : 'TOROM MANDEN\' DONGRAM BIAP',
  'song' : "1. Torom manden' Dongram Biap \nNamen an-sengbea; \nPangna jolan salan napja, \nSukko man-tokaia.\n\n(Ring-taitaiani) \n{Unongen angaba \nSinggako sikchengon, \nUnongen. } x2\n\n2. Chianingan tipja uno, \nBaljringan bibalko; \nSiani chi dilsachisa \nEkgrikata chingko.\n\n3. Jordan chini peng-a gita, \nIsraelna Kanaanko; \nDongpengenga sian' chichi, \nChingni pilak sukko.\n\n4. Mose gita gakatpae, \nNiwatna man-ode; \nSia ba duk mamungchiba, \nKenatjawa uode.", 'songNumber' : 342},
  {'title' : 'MIKKANGCHAKGRIKE',
  'song' : "1. Mikkangchakgrike Jisuna, \nMikkangchakgrike donggen; \nMairongpile katchabegen, \nJensalo anga nikgen!\n\n(Ring-taitaiani)\nMikkangchakgrike ang' Uko \nAskirangni gisepo, \nMikkangchakgrike ja-mano, \nRasongo Uko nikgen!\n\n2. Da-ode tale Uko nikja, \nAndala gisepona; \nIndiba nambea salo \nUni rasong parakgen.\n\n3. Uni mikkango katchagen, \nSaknaa dongjawaha; \nJensalo gonggea sronggen, \nAro p'lak mitin grigen.\n\n4. Mikkangchake, mairongpile, \nUko grongge uisranggen; \nMikkangchake Jokatgipa, \nJisu Kristo ka-sara !", 'songNumber' : 343},
  {'title' : 'JRINGJROTNI DONGRAM',
  'song' : "1. Salgini kosako donga \nNamen biap nama; \n{Torom mande siangode \nSalgiona re-a. x3 } x2\n\n2. Papirang ramako re-e \nMaikai dake jokgen; \n{O Isol, gisikko on-bo \nUosa jokna man-gen. x3 } x2\n\n3. Isolna anga ka-saode, \nAn-seng baljokaigen; \n{A-gilsak'ni siangode, \nJringjrot ring-e donggen. x3 } x2", 'songNumber' : 344},
  {'title' : 'JISU ANGNIN',
  'song' : "1. Aa'n sukrang gimachong, \nJisu angnin! \nKa-saarang ekangchong.  \nJisu angnin! \nAndala a-gilsak. \nGri neng-takram biap. \nJisuosan katnap, \nJisu angnin!\n\n2. Angko majonabe, \nJisu angnin! \nIan ang' biapde; \nJisu angnin! \nJrongang' a-mangnisan, \nSalsanagipasan, \nAngoni chel-angsrang, \nJisu angnin!\n\n3. Watnok walni jumang; \nJisu angnin! \nBon-china seng-na skang; \nJisu angnin! \nP'lak tikkelanichi, \nGri janggini man-gni; \nNamnikasan Uni; \nJisu angnin!\n\n4. Sia nang-ko watnok; \nJisu angnin! \nJringjrot janggi ra-nok; \nJisu angnin! \nKa-saarangko grongnok, \nNeng-takram' man-panok, \nJokatgipa' grongnok, \nJisu angnin!", 'songNumber' : 345},
  {'title' : 'SIANI NALSACHI SONGJINMA GNANG',
  'song' : "1. Siani a-kawe nalsachi songjinma gnang, \nSuk, rasong matchotja uanon, \nPangnajol sal napja bijakrang sikrepja, \nUa Nitogipa Sonan' Songo.\n\n(Ring-taitaiani) \nPangnajol (pangnajol) sal napja (sal napja), \nBijakrang (bijakrang) sikrepja, \nJokkatgipako piokgimin' niktoka. \nUa Nitogipa Sonan' Songo.\n\n2. Piokgipa Raja jena an-ching ka-saa, \nUko toromirang nikjringon \nAskirang gita toromirang teng-sua, \nUa Nitogipa Sonan' Songo.\n\n3. Sichakram chisolna pilakan bamenga, \nSonan, nolo, mesba rongtala, \nSakprakpraknan on-a sonani mukutko, \nUa Nitogipa Sonan' Songo.\n\n4. Sonachi rupripa uni p'lak sorokrang. \nSonan nokrang gamchatbatgipa; \nSinteja, kalimja Isolni, Songoa, \nUa Nitogipa Sonan, Songo.", 'songNumber' : 346},
  {'title' : 'KNATIM! KNATIM! SAGRERANG \nGIT RING-ENGA',
  'song' : "1. Knatim! Knatim! sagrerang git ring-enga, \nA-sak salgisakna jangatenga; \nHajalrang knatoe ring-chroprakenga, \nPap gri janggini gimin agana.\n\n(Ring-taitaiani.) \nJisun' sagrerang ring-chroenga, \nWalni songregipako nichakenga.\n\n2. Re-ang! re-ang! u'mang git ring-kuenga, \nNeng-gipa re ba' Jisu okama \nWalon ku-rangko katchae knaengkua, \nNama Kata u'mangko dilanga.\n\n3. Chel-beaoni, knatoa kontan' gita, \nJisuni ku-rang p'lakchin inwata, \nBal gnanggipa Jisuko knachakenba, \nNengtakan ko Jisuo man-sranga.\n\n4. Ring-angkubo, Salgioni sa-grerang, \nWalmadrang ring-angku' Salgin gitrang; \nSeng-baan katchaon chel-anggen dukrang, \nJringjrot ka-srokgen nabaon Pringprang.", 'songNumber' : 347},
  {'title' : 'OKAMGEN SALGIO',
  'song' : "1. Jensalo singgako sikgen Gitel salgio, \nJringjrotna namgipa sal p'lakna nabagen un' pringo; \nJokatgiminrang chimonggen sagal rikamo, \nUn' salo okamon anga dongpagen Uano.\n\n(Ring-taitaiani.) \nOkamgen Salgio....(Okamgen) \nOkamgen Salgio,. . (Salgio) \nChimonggimin pilak jatrangko, \nSalgio okamgen...(okamgen) \nAngaba dongpagen.\n\n2. Chakatokgen Kristona sigiminrang unon, \nRasongari chakatgimin' pa gen u'mang un'pringo; \nSeokgiminrang tom-tokgen i'nona salgio, \nUn' salo okamon anga dongpagen Uano.\n\n3. Oh! Indide da o Gitelna kam ka-na nanggen, \nSalrang matchotja skal anga Gitelna gamna nanggen; \nAng' janggi a-sakko unosa batangmano, \nUn' salo okamon, anga dongpagen Uano.", 'songNumber' : 348},
  {'title' : 'RAJAN\' MIKKANG CHADENGGEN',
  'song' : "1. Rajan' mikkang chadenggen, \nSa-grerangmung ring-pagen; \nChangsao,... changsao. \nSonan' chinggipa biapo, \nMitelgen jringjrot Uko, \nChangsao,... changsao.\n\n(Ring-taitaiani.) \nRajan' mikkang chadenggen, \nSa-grerangmung ring-pagen; \nRasong, rasong Rajana; \nInchrotoke Hallelujah, \nRajan mikkang chadenggen.\n\n2. Dokon salgin' kontako, \nGronggen an'ching Rajako; \nChangsao,...changsao. \nDukrang bon-tokgen uno, \nRing-tokgen Un bimungko, \nChangsao,... changsao.\n\n3. Un mikkango chadeng'na, \nNanggen mona on-pilna; \nChangsao,... changsao. \nTubamgen Rajan ja-o, \nNamtokgen Un' rasongo; \nChangsao,... changsao.", 'songNumber' : 349},
  {'title' : 'SALGI MAIRONGPILE NAMA',
  'song' : "1. Poraiman-a Salgi dongana. \nRongtalgipa janggirangna; \nIsol Un Katao agana, \nSalgi mairongpile nama.\n\n(Ring-taitaiani) \nSalgi mairongpile nama, \nAn-sengbea dongram ina; \nNeng-takram Songree neng-gipana, \nSalgi mairongpile nama.\n\n2. Salgio sintiani dongja, \nSikja re na gipinchina; \nBon-changja Isolni teng-sua, \nSalgi mairongpile nama.\n\n3. Chijanggirang grike jokenga, \nRinggiparang Janggi joka; \Nitoe gamrang ching-chetengga, \nSalgi mairongpile nama.\n\n4 Nitogipa sagal rikamo, \nSagrerang ring-mitelenga; \nKna ka-siri Bina salako. \nSalgi mairongpile nama.", 'songNumber' : 350},
  {'title' : 'BI-SARANGNA RIPENG DONGA',
  'song' : "1. Bi-sarangna ripeng donga \nSalgini kosako, \nJean jringjrot' dingtangja \nJen' ka-sara bon-ja; \nA-sakni ripeng gita \nOng-ja Un’ ka-sara, \nGamchatbegipa Ripeng; \nMingnama Un' bimung.\n\n2. Bi-sarangna biap donga \nSalgini kosako, \nJean Gitelna ka-saa, \nIsolko mania. \nP'lak dukoni neng-takram \nPap ruraoni joke \nSongregipa sakanti \nNeng-takgen pangnajol.\n\n3. Bi-sarangna dongram donga \nSalgini kosako \nUo Jisu Raja ong-a \nTom-tom kusin' songa. \nA-sakni songde ong-ja \nTosusana amja, \nNama ka-srokan gapa \nUa suk songjinma.\n\n4. Bi sarangna mukut donga \nSalgini kosako, \nKristoko ja rikgipa \nU'mang uko stika. \nChing-a rasong mukutko \nJeko Ua on-a' \nKa-saako man-gipana \nKa-sagiparangna.\n\n5. Bi-sarangna ring-na donga \nSalgini kosako; \nJeko pangnajol ring-na \nNeng-nikani dongja. \nJeko salgin'sagrerang \nU'mang ring-na man-ja; \nJokatgipa 'ne uija \nRaja 'nesa bama.\n\n6. Bi-sarangna ganna donga \nSalgini kosako, \nKnatobata ring-ani \nInchroa cheani. \nPilak mingnama gamko \nKristoniko man-a, \nRe-ba' ka-sa' bi-sarang \nU'rang Nangnin ong-gen.", 'songNumber' : 351},
  {'title' : 'ISOL KA TONG SEPANG',
  'song' : "1. Biap donga neng-takani, \nIsol ka-tong sepang'; \nBiap jean pap jokbrinja, \nIsol ka-tong sepang'.\n\n(Ring-taitaiani) \nO Jisu Jokatgipa, \nIsolni ka-tongni; \nSalbo sepangbataona, \nIsol ka-tong sepang'.\n\n2. Biap donga dongtoani \nIsol ka-tong sepang'; \nDonga jeon Jokatgipa, \nIsol ka-tong sepang'.\n\n3. Biap donga naljokani, \nIsol ka-tong sepang'; \nBiap kusin' tom-tomani, \nIsol ka-tong sepang'.", 'songNumber' : 352},
  {'title' : 'CHANSOKJAWA SAGAL \nAN-CHENG GITA',
  'song' : "1. Jensal' an-ching tom-gen Jordan naisao \nChonkamani singgako sikon; \nSagal an-cheng gita biapsano. \nAiao! inmanbegen un' salo.\n\n(Ring-taitaiani.) \nChansokja sagal 'sam an-cheng gita, \nChansokja sagal an-cheng gita; \nO mairong nikani, jokgiminrang tom-ani, \nOe, chansokjawa sagal an-cheng gita.\n\n2. Pagitchamrangko nikgen 'ching' uno, \nKa-sroke ku-rangsan ring-ako; \nToromirang tom-tokon Rasongo, \nAiao! inmanbegen un' salo.\n\n3. Jensal an-ching nikegen Rajako. \nRasongmung aramo re-baako; \nSa-gre bahinirangni jatchio, \nAiao! inmanbegen un salo.\n\n4. Sakprakkon okamgen bimung minge, \nJanggini Kitapo seako; \nPatia man-giparang napbabo, \nAiao! inmanbegen un' salo.", 'songNumber' : 353},
  {'title' : 'GRONGGRIKETOKGEN UN\'RASONGO',
  'song' : "1. Gronggriketokgen Un' Rasongo, \nAng' songrean matchoto; \nMitel mitchue ang' Gitelko, \nJringjrotni suk songnoko.\n\n(Ring-taitaiani) \nUa ching-gipa sonani rikamo, \nPaan' daksogimin katchaan a-songo; \nAng' gronggen uano p'lak jokgiminrangko \nMan-egen donsoa mukutko.\n\n2. Gronggriketokgen Un' Rasongo, \nUn' ka-saan salakimo; \nMinggen de gen Jokatgipako \nJokataha Uan angko.\n\n3. Gronggriketokgen Un' Rasongo \nDuule Un' singhasonko; \nSalgin' sa-gre keruprang baksa, \nRing-gen Un' ka-saaniko.\n\n4. Gronggriketokgen Un' Rasongo, \nA-sak kamrang matchoto; \nKa-srokgen ang' janggi jringjrotna, \nUa ching gipa songjinmao.", 'songNumber' : 354},
  {'title' : 'AN-CHING GRONGGRIKPILTAIGENMA?',
  'song' : "1. An-ching gronggrikpiltaigenma? \nSa-grerangni roramo; \nIsolni singhasonsamo, \nChijanggini rikamo.\n\n(Ring-taitaiani.) \nOe,'ching p'lakan gronggriktaigen, \nAn-sengbegipa janggin' Chisamo; \nRongtalgiparang baksa tom-gen, \nUa singhason samo.\n\n2. Grika chijanggin' rikamo, \nUa sonan' salrango; \nDamsan rogen katchabee, \nIsolko de-mitele.\n\n3. Jensal' chisamona sokgen, \nPap bojarang ga-akgen; \nKa-saachi jokpana man-gen, \nSonan' mukut stikpagen.\n\n4. Jokatgipani mikkangko, \nNikpagen ua chisamo; \nP'lak jokgiminrang ka-srokbee, \nRing-tokgen de-mitele.\n\n5. Sokbahaode ua chisamna, \nNangjawaha songrena; \nRing-mitelainok jringjrotna, \nRasong on-e Isolna.", 'songNumber' : 355},
  {'title' : 'CHI NALSAON GRONGGRIKGENMA?',
  'song' : "1. Chi nalsaon' gronggrikgenma, \nChipakkore' batmanon? \nJeo duk pangna ong-jawa \nJringjrot Ching-gipa Songon.\n\n(Ring-taitaiani.) \nGronggenma? Gronggenma? \nChi nalsaon grongtaigenma? \nChi nalsaon gronggrikgenma? \nChipakkore' batmano.\n\n2. Ua Songo gronggrikgenma? \nSonachi rikgipa Song. \nGuare ripokko daka, \nIsol' jakchi rika Song.\n\n3. Ching' ripengrangko gronggenma? \nSkango re-sogiparang? \nKu-rangko knataikugenma? \nNikgenma mikkang bimang?\n\n4. Kristoko unon gronggenma? \nPiokgipa an-chingko? \nUn' baksa asongpagenma, \nSonachek Singhasono?", 'songNumber' : 356},
  {'title' : 'MONDOLINI GIMIN BI-A',
  'song' : "1. O Isol, ka-sabegipa, \nNamgnirangko Patigipa, \nIa songni mondolina \nKa-sapabo, Gitel, Na-a.\n\n2. Chona dal-amung pilakan \nKa-sagrikna gisik apsan; \nIndake salko re-atna; \nPatipabo, Gitel, chingna.\n\n3. Ina bobil mondolini, \nBao Isol na simangni? \nSiako tangchaatode, \nKristo bebe, indakode.\n4. Uamangni namgijako, \nGitel, Na-a watbo uko; \nChanchiatbo uamangna, \nKatnape jokchong Nang-ona.\n\n5. Pilak Nang-ni manderangna, \nIa songni mondolina, \nNamgnirangko on-e Na-a \nJelatangbo, a-gimikna.", 'songNumber' : 371},
  {'title' : 'MONDOLIKO NAMNIKA',
  'song' : "1. O Gitel, Nang' Songko \nAnga namnikbejok; \nNang' gamchatbea an-chichi \nUko rongtalatjok.\n\n2. Nang-ni Mondoliko, \nAngni namnikao, \nIsol uno nok dongnape, \nDakaha biapko.\n\n3. Duk onge Un' dukna, \nBi-chongmotgen anga; \nAngni bimchipa bon-jaskal \nNamgniko chanchina.\n\n4. Ka-sara manderanga \nDamsano tom-dake, \nMitele git ring-e bi-an, \nKusi ong-anian.\n\n5. Beben manderangan, \nNambe chong-motgipan, \nA-gilsakko nitoate \nSalgio teng-sugen.", 'songNumber' : 372},
  {'title' : 'MONDOLINI JA-PANG',
  'song' : "1. Ja-pangsan Mondolini, \nUni Kristo Gitel; \nUan Kata aro chichi, \nUn' dakgimin gital. \nSalgioni am-ejok, \nNamchik gital ong-na; \nAn-chitangchi brepiljok, \nUa sijok una.\n\n2. Segimin p'lak jatoni, \nA-gimikon ma-san, \nJa-pang Un' jokatani, \nBebera-a, mingsan; \nGitel Saksasan ong-a, \nCha-aniba ge-san, \nKa-donga mingsanasa \nTikkelenga uan.\n\n3. Kal-stapesa manderang \nNika Un' dukrangko, \nNangrimgrikgijanirang. \nNamgija skiako; \nIndiba namgiparang \nBi-enga mikraken \nGrapani wal bakbakan \nKatchaani pring ong.gen.\n\n4. Neng-arango, dukrango, \nDakgrikarangoba, \nJringjrotni tom-tomako \nUan nichaksoa; \nJensalo Mondolia \nNitoako nikgen, \nMondoli amsranggipa \nTom-tomao donggen.\n\n5. Da-oba ua Isolmu \nIano nangrima, \nNeng-takenggiparangmu \nUisokgijao ropaa. \nRongtalgiparang katchaa; \nO, Gitel, chingnaba,  \nUamang gita chacha \nOn-bo Nang-mu dongna.", 'songNumber' : 373},
  {'title' : 'RASONG, ZION, ISOLNI SONG',
  'song' : "1. Rasong, Zion, Isolni song, \nUni songjinma Na-a. \nNang Kata pangnaba be-ja, \nNang-ko An-tangna rika, \nBaigipa Rong-brak kosako. \nSawa amgen moatna, \nJokatani pakma duula, \nBobilrang amja pe-na.\n\n2. Nibo chijanggini chiring, \nJoka jringna unoni, \nChel-ata duk sakna' rangko, \nKane dedrangko uni; \nOkka'tna indaka dongon \nAn-ching jajrenggen maina? \nKa-sagipa an-ching Gitel, \nOn-gen Ua pangnajolna.\n\n3. Un' dongramni samtangtango, \nNibo wa-al, aramko, \nIsolko rasong chaata, \nGitel donga sepango, \nKa-sroka Zionni dedrang, \nPaponi piokmane, \nU'mangko rajarang daka, \nJisuna u' mang bame.\n\n4. Gitel, angaba Ziono, \nO! man-ode dongpanada \nNang' bimungo rasong chagen, \nA-gilsak mitchioba; \nA-gilsakni katcha'nirang, \nOng-gramaia rasongba, \nZionni gamchata gamko, \nUn' dedrangmangmang man.a.", 'songNumber' : 374},
  {'title' : 'TANGATPILBO NANG-NI MONDOLIKO',
  'song' : "1. Tangatpilbo Nang-ni mondoliko \nKamtango, mitelao; \nOng-atpilbo uko a-an kari, \nGasan kosak chaki. \nWalni jagring andalao, \nCha-bok mitchian jatchio, \nBil ganate ching' watatbo, \nDakchakbo, bilchaatbo.\n\n2. Skibo janggin Nang' Kata bebeko, \nUan teng-chong ching' ramao; \nNikna Nang-ko Nang' ka-san kamrango, \nNang' kata antio. \nNa' jekai detangko on-jok, \nJechi da-o ching' janggi jokjok, \nO dakchak ching, ka-saskana, \nNang' kata manina.\n\n3. Skibo bi-na Na' pangnan ching' sepang. \nKnat' Nang' tom-tom ku-rang; \nNang-ko man-jaskal tom-tomja janggi, \nKatcharam gipin gri. \nDonbo Nang' samo tom-tome, \nNang-ni skako chingnin dake, \nSal sal Nang' dilako am-na, \nSkibo chingko bi-na.\n\n4. Skibo ka-sana p'lak jatni mande, \nGisik ka-tong nange; \nGale mitchia, mania bewalko, \nAn-tangna ka-saako; \nNa' jekai janggitang on-a, \nBobil susaako gimaatna, \nSkibo salgin kasaa chingna, \nNang' gita ka-sana.", 'songNumber' : 375},
  {'title' : 'MONDOLINI DAL-ROROANI',
  'song' : "1. Nikjagringna \"sako salgin\" songnok \nMondoli, mondoli, \nDonangjok Kristo Jokan' ramako; \nMondoli.\n\n(Ring-taitaiani) \nDarangnin kosako bilko on-e \nRikaha rong-brako mangrake; \nAmja pe-na a-sakni bilrangde, \nMondoli.\n\n2. Napram salgin' cholguga mandeni, \nMondoli, Mondoli; \nRa-chakram Jisun' bimung an-chingni, \nMondoli.\n\n3. On-gen Gitel Kristoni Chisolko, \nMondoli, Mondoli; \nJringjrot Janggini nama katako, \nMondoli.\n4. On-jok gital Eden, Jerusalem, \nA-sako Mondoli. \nGisik rongtalgipaon tangkamgen, \nMondoli.", 'songNumber' : 376},
  {'title' : 'KRISTONI RE-BAANI SAL',
  'song' : "1. Sabasi, intokchong Isolni Deko, \nNamekai reki sandigen; \nNamen ka-sabegen kangal dukkiko, \nBobilrangko a-riktokgen.\n\n2. Maikai bilsi soko mikka waode, \nNitoriri sam chatoka; \nUa gitan, Uni re-baan', salode, \nDarangmarang katchatoka.\n\n3. Uni salosa namen torom gipgen. \nDarangmarang namtokbegen; \nGitel, nokol Jisuo katnaptokgen. \nPilakan ku-mong rangrimgen.\n\n4. Olakitokgen, minge Un' bimungko, \nJringjrotna uko mitelgen; \nDarang a-ni ki-tik, salni noksiko, \nManderang de tok mingtokgen.", 'songNumber' : 382},
  {'title' : 'SALGINI SONGNOK SOKBAOA',
  'song' : "1. Chon-an Salo Isolni a-bri nagen, \nNamani Dongramko chubee nikgen; \nSalgin' ning-oni pilak jatni manden \nGakate uno namen kusi ong-gen. x2\n\n2. Je chaki Zionni kosako ching-a, \nA-kitikna soka uni teng-sua; \nNok chua Ziono, asongram Rajan', \nPilak a-gilsakko amtokgen Uan. x2\n\n3. Dakgrikjawa ua toromni salo, \nPal daktokgen tonualko un' salo; \nSel-urangko pe-e atchili dakgen, \nOng-tokchina jongada pilak manden. x2\n\n4. Do-bokrang baksa se-elrang nangrimgen, \nMatcharang chikjawa, a-gilsak namgen; \nHajalsa bilsina indake ong-gen, \nSalgi gita a-gilsako ka-sagen. x2", 'songNumber' : 383},
  {'title' : 'RI-RO RI-RO NITOBEA',
    'song' : "1. Ri-ro ri-ro nitobea \nTasi salna bata, \nGitcham a-a gimaaha, \nSalgisak dongjaha. x2\n\n2. Jerusalem Salgioni \nOng-onbaaha a-aona, \nDukoniko Mondolina \nGamseng rasong' on-na. x2\n\n3. Kimko kimko sa-grerangni \nKnatokbo ku-rangko, \nNibo ka-saako Isolni \nBakrima papiko. x2\n\n4. Sa grerangmu nangrimgrikgen, \nMitelgen Isolko; \nMikron mikchi u-sittokgen, \nPangnan man-gen sukko. x2\n\n5. Be-en gisikni p'lak dukrang, \nSia ba saarang. \nNapjawaha namgijarang; \nOng-aiegen sukrang. x2\n\n6. O Gitel, Nang-ni re-baani \nBadita ru utkugen? \nUa chasong suk ong-ani \nBasako nabagen? x2", 'songNumber' : 384},
  {'title' : 'REBAA\', RE-BAA\', OE RE-BAA\'',
  'song' : "1. Re-baa', re-baa', oe re-baa', \nChel-aoni chimongbaa', \nA-kawe a-brirangoni, \nNeng-e sokbatokenga; \nJisu mandetang' salenga, \nUn' Chisol draatenga.\n\n2. Re-baa', re-baa', oe re-baa', \nChel-aoni chimongbaa', \nJat dal-a aro jat chona, \nJokatpila' man gimin, \nToksan dake re-baenga, \nKristochin nangrimgimin.\n\n3. Re-baa', re-baa', oe re-baa', \nChel-aoni chimongbaa', \nChona, dala songrangoni, \nChibiman' joka gita, \nChisolan u'mangni rasong, \nRing-chroe u'mang re-baa.\n\n4. Re-baa', re-baa', oe re-baa' \nChel-aoni chimongbaa', \nRe-baenga pante me-trarang. \nMe-apa me-chikmarang, \nKa-srokchime inchroenga, \nJisu chingko jokata.\n\n5. Re-baa', re-baa', oe re-baa', \nChel-beaoni chimongbaa', \nSalgisako gronggriktokgen, \nMiteljringgen Kristoko, \nRing-chimtoke ka-srokbegen, \nGronggrikramo nalsao.", 'songNumber' : 385},
  {'title' : 'KRISTOO SALARAM SALIRAM',
  'song' : "1. Kristoo salaram, saliram. \nSalgro, salgipeng gri, \nKristianrang ka-sagrikaon \nDarang, dolsanari.\n\n2. Pilak bebera-giparang \nUko olakipaa, \nKristona dangdike on-on \nKadimako man-paa.\n\n3. Ka-rimgrikbo, jongadarang, \nNang' jat ong-chong jeba, \nJeko Kristo jokataha, \nIsolni de ua.\n\n4. Salaramo saliramo \nSalgroo salgipengon, \nAn-ching' nangrimgrikram Kristo \nPilakna pilakon.", 'songNumber' : 386},
  {'title' : 'ON-JOK JOKANI CHOLKO',
  'song' : "I. A-gilsakoni manderang \nMore mode ja achi, \nJa-re ja-sokangtokenga, \nNibo, andalsisi.\n\n2. Chanchi' nibo, gisik on-bo, \nJisun' ka-saa jongdrang, \nJokan' cholko mesokpana, \nHai, Kristian panterang.\n\n3. Kristian mandeni p'lak jako \nOn-jok jokna cholko; \nMonako man-gipa gita \nGopnakama uko?\n\n4. Jedake on-aha Gitel \nAn-ching sakantina, \nUa cholchin ama an-ching \nJokan' cholko dakna.", 'songNumber' : 390},
  {'title' : 'SALRANG RE-ANGMITINGO',
  'song' : "1. Mituraragiparangko, \nSalrang re-angmitingo, \nJokatna norokoniko, \nSalrang re-angmitingo. \nNama cholrangko dakna, \nAn-ching re-mikkangana, \nIndake kusi ong-na, \nSalrang re-angmitingo.\n\n(Ring-taitaiani) \nRe-engon! Re-engon! \nRe-engon! Re-engon! \nNama choirangko dakna, \nAn-ching sal man-mitingon.\n\n2. Mitchinikani sal dongja, \nSalrang re-angmitingo, \nMikkang pring gita ong china, \nSalrang re-angmitingo; \nA-gilsal ka-beani, \nDuk mikchi ong-rarani, \nDakchakbo nang’jongrangko. \nSalrang re-angmitingo.\n\n3. Stitgrikaha ka-saachi, \nSalrang re-angmitingo; \nWatrikrikbaa ja-manchi, \nSalrang re-angmitingo; \nJe naman' bitchri' ge-jok, \nChae bijimbabenok, \nWal-chaa gita ching-benok, \nSalrang re-angmitingo.", 'songNumber' : 391},
  {'title' : 'NIKGENMA AN-CHINGNI MIKRAKAKO',
    'song' : "1. Nokoltang na Jisun' re-baan' salo, \nOng-chong seng-o ba walo, \nNama, jeko nikgen mikrakako, \nTarie sengsoako.\n\n(Ring-taitaiani) \nO man-genma aganchakna, jongrang \nNang-na sengsoenga 'ne? \nNikgenma an-chingni mikrakako, \nSengsoako Jisun' re-baana?\n\n2. Seng-na sepangbao ba walengon, \nSakantiko okamgen; \nJensalo on-pilgen monarangko, \nNama ingenma nang-ko?\n\n3. Un' ka-donga gita dakahama? \nDakna joton ka-ama? \nNamgija griode ka-tongtango, \nNeng-takgen Un' rasongo.\n\n4. Nama, jeko nika sengsoako; \nUn' rasongko man-pagen, \nRe-baode pringo ba walengon, \nNikegenma an-chingko?", 'songNumber' : 392},
  {'title' : 'UAMANGKO RIMBABO',
  'song' : "1. Knabo rakkual okamako, \nBakra a-bimanduchiko; \nRe-ange am-e mestangko, \nNoloni chel-e brangako.\n\n(Ring-taitainai.) \nRimbabo, rimbabo, \nPap a-baoniko rimbabo; \nRimbabo, rimbabo, \nBranggipako rimbapilbo.\n\n2. Sa' re-gen uko dakchakna, \nBranggipa mesko am-pana; \nSa' mobagen noltangona, \nSin-beaoniko jokatna?\n\n3. Knabo ku-rang bakrachini, \nA-bri a-bimanduchini; \nKnatim, Gitel ina nang-ko. \nAm-ebo re-e pilakchiko.", 'songNumber' : 393},
  {'title' : 'JAKARIA RE-ANGGENMA?',
  'song' : "1. Jakaria re-anggenma, \nIndaken Jisuona? \nSal saba Una ka-gija, \nUni ja-o donna gri?\n\n(Ring-taitaiani.) \nJakaria re-anggenma, \nIndaken Jisuona? \nBite grian Uko grongna \nIandaken re-nama?\n\n2. Siaona kenja re-na, \nMaina Jisu jokata; \nIndiba jakari grongna, \nUan angni duk ong.a.\n\n3. Maikai bilsi papan gapa! \nU'rangko man-pilgenchim, \nJisuna wattoksranggenchim, \nUni skana bamsrangna.\n\n4. Otoromirang, mikrakbo, \nSalmiting kam ka-srangbo; \nSiani wal srapkujaon \nBite, man-na krengbebo.", 'songNumber' : 394},
  {'title' : 'SATENGA BITCHRI',
  'song' : "1. Satenga bitchri pring wal seng-on, \nSatenga bitchri saljatchion, \nSatenga bitchri salniangon, \nSatenga bitchri andalengon; \nRakario mai ong-gen? \nRakario mai ong.gen?\n\n(Ring-taitaiani) \nAndalengbo ba niksengo satbo, \nAn-chingni bilchi ba bilgrioba, \nDa-omangni sal ba jringjrotogen. \nMi ragen, rachongmottokgen!\n\n2. Satenga bitchri ramasamo, \nSatenga bitchri rong-brak', aiao! \nSatenga bitchri bu-sugrimo, \nSatenga bitchri nama a-ao, \nRakario mai onggen? \nRakario mai onggen?\n\n3. Satenga bitchri saknaa' kamna, \nSatenga bitchri paglachina. \nSatenga bitchri marang nangna, \nSatenga bitchri kratcha jringna; \nRakario mai ong-gen? \nRakario mai ong-gen?\n\n4. Satenga bitchri ka-pakaon, \nSatenga bitchri mikchi ong on, \nSate, ka-donge ragni sepang. \nKusi ong- e miko tom-atna; \nRakario mai ong-gen? \nRakario mai ong-gen?", 'songNumber' : 395},
  {'title' : 'MI RAGIPARANG BAO?',
  'song' : "1. Mi ragiparang bachitokenga? \nA-bani miko rana namaha; \nBebeni atchilichi ratokbo. \nMatchotsrangjaskal da dondikkubo\n\n(Ring-taitaiani.) \nMi ragipa bao? Sa re-bagen? \nMi misiko rana sal ong-mitingo. \nDakchakgipa bao? chimongpana \nPap' a-baoniko nama miko.\n\n2. A-brengrangona re-ange nibo, \nBurung dikpripo mi dongnaba gnang. \nRamarangkoba watchanggalgija, \nOn-timintiba gimajachina.\n\n3. A-barango mirang mintokaha, \nMi rakariba da-o ong-aha, \nRagiparang bang-ja mia bang-a, \nSal badejokode gimatoka.\n\n4. Indide da-o re-batokboda, \nSonani miko damsan chimongna; \nMini Nokgipare-bajokode, \nUn baksa an-ching man-pagen bakde.", 'songNumber' : 396},
  {'title' : 'ONA CHAKIRANG CHING CHINA',
  'song' : "1. Ching-e an-ching' Paani ka-saa \nTeng-suenga sakoni, \nIndiba an-chingna on-a; \nTeng-suako rikamni.\n\n(Ring-taitaiani.) \nOna chakirang ching-china. \nPokpekako seng-dapen; \nDubinasienggipako \nJokatna na-a amgen.\n\n2. Papni wal namen andaljok \nGam-kale ta-rakenga; \nRikamni teng-suarangko \nKengiparang nienga.\n\n3. Nang-ni chakiko taribo; \nSaoba gimanasia, \nBondorko am-bemitingo \nAndalao gimagen.", 'songNumber' : 397},
  {'title' : 'RAJANI KAM',
  'song' : "1. Anga songregipa \nGipin a-song' ning-o; \nAng' songde chel-bea, \nSonani rikamo; \nSagal nalsaoni \nBaltigipa anga, \nRajan' kamni gimin donga.\n\n(Ring-taitaiani.) \nIan ang kata ra-bara, \nSa-grerang skachim ring-pana, \nNangrimtokchongmotbo, \nGitel aganenga, \nIsol baksa nangrimtokbo.\n\n2. Raja ge-etenga,\nPilak'ni mandeko, \nPapni ruraaoni \nGisik pil-srangtokbo, \nMaikai manigipa \nDongpagen Un' baksa, \nUan ang' Rajana ang' kam.\n\n3. Ang' Nok an-sengbata, \nSharon jolna bata, \nJringjrot janggi, katchaa, \nUno giptokenga \nUano manderang \nMaikai dongna man-gen, \nAganchina watatenga.", 'songNumber' : 398},
  {'title' : 'SA GITELMU DONGA ?',
  'song' : "1. Sa Gitelmu donga? Sa Raja' bamgen? \nSa, Un' dakchakgipa gipin' rimbagen? \nSa a-gilsak' watgen? Sa bobil' so-otgen? \nSa Gitelmu donga? Sa Una re-gen? \nNang-ni okamachi, Nang ni ka-saachi, \nChing' Gitelmu donga; Gitel, ching' Nang ni.\n\n2. Ching rasongko am-ja, mukut, gamkoba, \nChing' Nang' baksa donga, Nang-ni git' ring-a; \nMaina Nang' ka-saako gipinna on-jok; \nSako Jisu okam Umu dongchina, \nNang-ni rakian'chi, Nang-ni ka-saachi, \nChing' Gitelmu donga; Gitel, ching' Nang-ni'.\n\n3. Jisu chingko brejok, tangka, ripok gri, \nIndiba an-chichi Songnokna Nang-ni: \nNang' pati'chi gapa jean Nang' re-baa \nNa-a chingko jokatjok, jakgitel Na-a. \nNang' jokatanichi, Nang-ni ka-saachi, \nChing' Gitelmu donga: Gitel, ching' Nang-ni'.\n\n4. Dakgrik' ta-rakode, bobil biloba, \nPilaknaba Raja' kotokko amja: \nUn' sepang chadenge bobilko amgen : \nUn' jringjrotni bebe pilakko amgen. \nKusi ong-e re-baa Nang-ni ka-saachi, \nChing' Gitelmu donga; Gitel, ching Nang-ni'.", 'songNumber' : 399},
  {'title' : 'ANGA KAKKETGIPA ONG-NA NANGENGA',
  'song' : "1. Anga kakketgipa ong-na nangenga; \nAnga rongtalgipa ong-na nanga; \nAnga bilak' aro kengijagipa \nOng-gen, maina gipinrang ka-donga. x2\n\n2. Anga namgipa ripeng ong na nanga, \nKangal, man-echa-giparangnaba; \nAn-tangko onnikgipa ong-na nanga; \nAnga kusi ong gipa ong-anggen. x2", 'songNumber' : 400},
  {'title' : 'ANG\' JOKATGIPAN DILENGA',
  'song' : "1. Ang' Gitel jechi dilenga, \nP'lak nangarangko on-enga, \nUn' ka saon anga pangchaka. \nRe-gen anga Un baksa.\n\n(Ring-taitaiani.) \nJokatgipa jechi dilgen, \nJokatgipa jechi dilgen, \nJechi angko dilgen Ua. \nJa-rikgen ang' Un' ja-man.\n\n2. Angni rama andaloba, \nRe-na ja ku ja-nengoba, \nUn' ka-saan ku-rang katchaata, \nRe-gen anga Un baksa.\n\n3. A-sak angko saknaatoba, \nBal mikka ang; jajaatoba, \nKa-san' jakpongchi salbaka, \nRe-gen anga Un' baksa.\n\n4. Jensal' a-saknirang watgen, \nSongpangna Ua okamgen, \nChi nalsa'n Ka-sagipaona, \nRe-gen anga Un' baksa.", 'songNumber' : 401},
  {'title' : 'CHAKATBO KRISTIANRANG',
  'song' : "1. Chakatbo, Kristianrang ! \nNamgijako watbo: \nJanggi, ka-tong, gisik, bilko \nJisuna on kangbo.\n\n2. Chakatbo, Kristianrang ! \nUn' Songnok dongkuja; \nKa-sagrikan' salko peng-na \nPapni wal dongkua.\n\n3. Chakatbo, Kristianrang! \nMondoli sengsoa: \nUa nang-ni bilko nanga, \nChakatbo, jak on-na.\n\n4. Un' chisol' de doe, \nJisuko ja-rikbo: \nJisuni sninggipa onge \nKristianrang chakatbo!", 'songNumber' : 402},
  {'title' : 'KA-BO KAM, WAL RE\'BAENGA',
  'song' : "1. Ka bo kam, wal re'baenga, \nPringni kontarango: \nRipamchi dongkuoa, \nKa-bo, kam ka-bo. \nKa-bo sal chukaloa, \nKa-bo sal rakao; \nKa-bo kam, wal re-baenga, \nBon-a kam jeo.\n\n2. Ka-bo kam, wal re-baenga, \nSaljatchi ong-oa; \nBimchipbo sal ching'beenga, \nMan-a neng'takna. \nMinitantin maikoba \nChimongchina jamo, \nKa-bo kam, wal re-baenga, \nP'lak ka-ja jeo.\n\n3. Ka-bo kam, wal re'baenga, \nNapa je a-o sal; \nKa'bo sal wa-sa'oa, \nMaina baija sal; \nSal jagring dongkuengon, \nKa-bo, walkuja'na; \nKa-bo, andalnasion, \nJensal' kam bon-a.", 'songNumber' : 403},
  {'title' : 'GIMAENGGIPAKO JOKATBOLA',
  'song' : "1. Jokatna dakchakbo, gimaenggipako, \nSripe papo gimagen salrikbo; \nGimaengjok brange, rimbabo ka-sae \nJisu jokatgipa 'ne agane.\n\n(Ring-taitaiani.) \nJisu ka-sagipa, Chingko jokata, \nKa-sachakbegipa Uan jokatgen.\n\n2. Ka-tongko onate, me-sokbo ka-sae \nNaljokani katako agane; \nDe-mesabo da-nang, jokpachong u'mang, \nKa-tong rim-gen knatogipan' ku-rang.\n\n3. Gimaenggiparangko, jokat u'mangko, \nBilrakatgen chu-sokna kamrangko; \nChakchikao chegen, branggipa jokgen, \nJisuni sichakako agangen.", 'songNumber' : 404},
  {'title' : 'GISIKKO DE MESAANI',
  'song' : "1. Kristo Jisun' kamko ka-na \nSawa re-gen a-baona? \nWal seng-aha, sal nabaaha, \nWalni sukko watboaha.\n\n2. Bimchipbo, Kristian pamongrang, \nMikrakbo, Kristian panterang. \nKatchatokbo mondolirang, \nJisuni kamna na-simang.\n\n3. Je manderang jeko ge-gen \nChon-an' salo uko ragen; \nAn-ching boljanggiko ge-na, \nChijangiko man gen, ringna.\n\n4. Janggitangko ripinggipa, \nUa uko gimaatgen. \nJisun' kamna dukko chakbo, \nSukko man-gen, ka-dongbebo.\n\n5. Be-entangna kacha wate, \nAn-chitangna wa-sing sine, \nJe manderang sal re-atgen, \nIsol uko chubatatgen.", 'songNumber' : 408},
  {'title' : 'SAWA RE-GEN PATALONA?',
  'song' : "1. Sawa re-gen patalona ? \nMi minaha, an-ching rana; \nKa-sroke, ka-sroke rana, \nJisun' noko pake donna.\n\n2. Sninggipako Jisu ina, \nBang-bea mi' rana nanga; \nBi-bo mi ragiparangko, \nRachina ua mirangko.\n\n3. Hai, hai re-na miko rana ; \nBakbak re na patalona \nGitel Jisun' miko rana, \nNanga an-ching re-chongmotna.\n\n4. Jisuni miko je ragen. \nNaman salo rasong chagen; \nPangnan ua okkrijagen ; \nSalgisakni sukko man-gen.\n\n5. Ramitingo dukko man-gen, \nDukni pal suk bate ong-gen, \nAnga ragen janggin' miko; \nGitel, angna on-bo bilko.\n\n6. O tusie aratgipa, \nOkamenga nang' Nokgipa; \nChakatboda, hai, re-naha; \nRe-na bakbak tarinaha.\n\n7. Aratemung tusiode, \nMijanggiko rajaode, \nJa-manode okkribegen, \nSaknae sitengtochomgmotgen.", 'songNumber' : 409},
  {'title' : 'METAL ITCHILE',
  'song' : "1. Pringo pringni sate, ka-san' bitchri' sate, \nSaljatchio sate, atamgrooba. \nMinkarina senga, rakarina senga, \nAn-ching ka-srokegen, metal itchile.\n\n(Ring-taitaiani.) \nMetal itchile, metal itchile, \nAn-ching ka-srokegen, metal itchile. \nMetal itchile, metal itchile, \nAn-ching ka-srokegen metal itchile.\n\n2. Sal rakao sate salakimo sate, \nMikkana kengija, suurinaba; \nJensalo mi mingen, unsalo kam bon-gen \nAn-ching ka-srokegen, metal itchile.\n\n3. Indide Gitelna, satebo grapeba, \nAn-ching gam bon-oba, duk ong-beoba. \nAn-ching grapa bon-o, Uan biap on-gen \nAn-ching ka-srokegen, metal itchile.", 'songNumber' : 410},
  {'title' : 'PATALONA RE-ANGBODA',
  'song' : "1. O neng-gipa, baoni re-baa, \nJakari aro mikskema ? \nRamako saksan re-ange, \nBaoni kolamaha da alde ? \nA-ba ragiminkosa \nRuuto anga nikaha, \nMetalko ra angtokjok; \nMegapari angna dongjok.\n\n(Ring-taitaiani) \nPatalona re -angboda, \nChol man-mitingo kolamna, \nRagiparangni sepango \nSalgimikon kolamebo.\n\n2. Simsakgija kolamgipa, \nSikrepa pul'; maina ra-baa? \nOkkria, ringna ska na-a \nBaoniko kolamaha? \nSalgimik salakimo \nAnga ameaha pulko ; \nDa-o angni pilak man-a \nJabolarikosa nika.\n\n3. Metal donga kolamgipa, \nBebeen neng-enggen na-a. \nKatchae nokchi ring-ange, \nBaoni kolamaha da-alde? \nDa-ruutat sal bon-jaskal; \nJakam jakam dake metal' \nRagiparangni sepango, \nKolamaha ino uno.", 'songNumber' : 411},
  {'title' : 'KRITGIPARANG SIANGTOKENGA',
  'song' : "1. Kritgiparang, hajal hajal \nSiangtokenga, salni sal; \nO Kristianrang, skibo na-mang, \nJokchong Kristochi uamang.\n\n2. Bil, gisik, gam, janggitangko \nOn-bo, jokatna papiko; \nGitel nang-na sichakaha, \nNa-a Una mai daknasa ?\n\n3. O Isol, ka-sabegipa, \nMikrakatbo, pilakkoba; \nSalaramni, saliramna, \nJisun gimin joktokchina.", 'songNumber' : 412},
  {'title' : 'KNAMAN-JOK KATCHAANIKO',
  'song' :  "1. Knaman-jok katchaaniko, \nJokata! Jokata! \nAganprakbo pilakna, \nJokata jokata ! \nSongantichi ra-boda, \nA-bri, sagal peng-oba, \nHai' re- Gitel ge-eta, \nJokata! Jokata !\n\n2. Balpongbatbo sagalko, \nJokata! Jokata! \nPapirangna aganbo, \nJokata! Jokata ! \nSagal chichangrang ring-bo, \nA-gilsakni katchaako, \nJisuko Gitel mingbo, \nJokata ! Jokata !\n\n3. Dakgrikmiting' ring-kuna, \nJokata! Jokata! \nSiachi, tangachiba, \nJokata! Jokata ! \nPaptangna kalimoa, \nKa-saako mol-moloa, \nSion chee ring-kuna, \nJokata! Jokata !\n\n4. Balwa iko inchina, \nJokata! Jokata ! \nJatanti katchachina, \nJokata! Jokata ! \nChu-sokjok jokatani, \nA-ding, a-kong ring-ani, \nInchro, an-ching cheani, \nJokata! Jokata !", 'songNumber' : 413},
  {'title' : 'PROCHARNI GIT',
  'song' : "1. Ang' jongada, ang' noabi, \nMande gitcham, atchu, ambi, \nJanggi gimaariaha, \nJama nasiariaha.\n\n2. Re-ange a-a namgijachi, \nJa-soke kil gogijachi \nKatchirangsi chual chonggal \nMinoktokenga, salni sal.\n\n3. Nibo, mikka simdimdimchi, \nNibo, guuri jarimrimchi, \nKu-rang tang-sokgijachina, \nDo-reng bilsokgijachina.\n\n4. A-gilsak burungko re-e \nMaina neng-a bu-su bu-e, \nAganboching, ja-man rama \nGipinko re-na man-jama?\n\n5. Cheche, A-chik, angni ma-drang, \nNene, nene, noabirang, \nAng' jongada ka-saarang, \nJisu bebe, janggi, jal-ang.\n\n6. Adam, Hoba, me-a me-chik \nEdenoni wakidikdik, \nJe jang-kiko ong-onaha. \nSalgioni Norokona.\n\n7. Norokoni Salgiona \nJe jang-kiko Jisu chana, \nJokna jang-ki Jisu mangmang, \nA.ning, a'sak, pilak a-mang.\n\n8. Ka-tongni binako mobo, \nAn-seng an-seng mesatokbo; \nKu-ranganti ja-ku de-bo, \nAn-senge ka-sroke dobo.", 'songNumber' : 414},
  {'title' : 'TARAKKUBO, ZION, NANG\' \nKAM CHU-SOKGEN',
    'song' : "1. Ta-rakkubo, Zion, nang' kam chu-sokgen, \nP'lakna kna'tna Isol seng-a ahan'; \nIsol sikja dakgipa p'lak jatrangko, \nGimaatna janggi' wal andalao,\n\n(Ring-taitaiani.) \nKatchan' katako p'laknan knaatbo. \nTom-tom jokan Jisuni naljokani.\n\n2. Aganprakbo sakprakna jatantina, \nIsol ka-saa an-ching Uosa tanga; \nChoknokaha gimaaoni jokatna, \nAhaon sijok sako mande tangchong.\n\n3. On-bo chingna Nang rasong Kata' satna, \nNang' gamrangko ramako dakatna; \nJanggi on-bo, bi-bo chebo u'mangna, \nJeko satjok Jisuan chotpilgen.\n\n4. Uan re-bajok Zion na-a grongna skang \nP'laknan uiatbo janggin jokaniko; \nGrongtokchina jokata man-giparang \nSimsakjae kragija ong-jachong.", 'songNumber' : 415},
  {'title' : 'SURIN\' NOK GREENLANDONI',
  'song' : "1. Suurini 'bri a-chujol, Sagal chichangoni: Joka an-cheng sorijol, Afric chiringoni; \nChibiman an-chengoni, \nKejur akawe'ni; \nOkama ching' p'lakonin. \Jokatna paponi\n\n2. Balmrikoba simila. Ceylonni chichango; Katcha'ni 'ba mandena, Ka-donggramanio; \nIndinsajok on-arang. \nIsolni ka-sae; \nOlakia bol'wa-rang' \nUamang u-ijae.\n\n3. Seng-atgimin an-chinga. \nGisikchi 'sakoni, \nJegenma parakatna \nTochriko janggini? \nJokata, O! jokata, \nKatchae aganprakbo, \nMessiani bimungko \nJatantin' gipatbo.\n\n4. Un' katako balpakbo, nBalwa, chipakkore, \nRasongni sagal ong-e, \nA-gimik gipate; \nDakgipa, Piokgipa, \nPapna sigipani \nRaja ong-jana kingking, \nSalgio an-chingni.", 'songNumber' : 416},
  {'title': 'SENG-ATBO PILAKCHINAN',
  'song' : "1. Knamanjok, jatrangko okamaniko. \nSeng-atbo, seng-atbo! \nPilak janggirangko da-o jokatna, \nSeng-atbo, seng-atbo!\n\n(Ring-taitaiani.) \nSeng-atbo, Nama Katan' seng-a, \nSeng-angchong pilakchinan; \nSeng-atbo, Un patianiko, \nSeng-angchina jringjrotna.\n\n2. Makedonian' okamako knara, \nSeng-atbo, seng-atbo! \nAn-chingona chisolan sepang ong-a. \nSeng-atbo, seng-atbo!\n\n3. Jisun' ka-sarap'lakchin gipangchina, \nSeng-atbo, seng-atbo! \nKristianrangko pilakon niksengchina. \nSeng-atbo, seng-atbo!\n\n4. An-ching Uni ka-sano olgrokjana, \nSeng-atho, seng-atbo! \nDonsoa muktani mukutko man-na, \nSeng-atbo, seng-atbo !", 'songNumber' : 417},
  {'title': 'HIMALAY BRIRANGONI',
   'song' : "1. Himalay 'brirangoni, \nSongdu a-kaweoni, \nRongtala je chiringrang \nJoka sagalona; \nChing' Assam 'song niksokja, \nJatrangko chansokja.' \nJokatna janggirangko \nOkamenga 'chingko.\n\n2. 'Bri chiring aro bolgrim, \nA-ding a-kong rong grim, \nTa-rake balpakangbo, \nChing' A-chik 'songniko, \nJanggi jokan' katako, \nIsolni ka-saako; \nNikchina A-chik A-jong. \nGitel Songnok ong chong\n\n3. Tubama miterangna, \nDakgimin bimangna, \nMandeni sea leka, \nGimachong p'lak kata; \nAndala janggin' ka-tong', \nGitel teng-sudapchong! \nJanggini chiko ringna, \nRajanasa bamna.\n\n4. Nitoa an-ching jakrang. \nDe-bo Salgichina; \nJa-kuko apsan de-e. \nChean' gitko ring-e, \nSale ka tongo bina, \nRajako ja rikna; \nKenja chinga bobilna, \nSatanni kotokna.", 'songNumber' : 418},
  {'title' : 'JOKATGIPA RE-BAA',
  'song' : "1. Manden' dongram jeo, uno aganprakna. \nRe-babo ripengrang ka-sroke git ring-na, \nHai, Kristian ku-chilrang ring-bo katchaan kata \nJokatgipa re-baa!\n\n(Ring-taitaiani.) \nJokatgipa re-baa! Jokatgipa re-baa ! \nKu-rachakatangko on jok chingna uko, \nManden' dongram jeo aganprakna uno, \nJokatgipa re-baa!\n\n2. Andala dukni sal batangjok bal' gita. \nBobilrangko chee a-songko seng-ata. \nSonan' a-bri gita teng-sua sal gita, \nJokatgipa re-baa !\n\n3. Rajan Raja Ua, papko watanina, \nPilak manderangna jokaniko ra-baa. \nRipengrang ka-srokbo, ia gitko ring-na \nJokatgipa re-baa !", 'songNumber' : 419},
  {'title' : 'BUDUKO GOATBO',
  'song' : "1. Buduko goatbo, chi andala; \nSan'bani janggiko' jokatna gnang. \nSan'bani jonggipa uan sripengjok; \nGimachapoba sawa ree on-gen?\n\n(Ring-taitaiani.) \nBudu goatbo, budu goatbo. \nSaoba chio sripengjok; \nBudu goatbo, budu goatbo, \nSaoba sripenga da-alo.\n\n2. Buduko goatbo, jak bilakchong. \nMaina chakchika, maina sengsoa'? \nNibo, sripenga, bakbak dara salo \nChoangbo bakbikin, chongbo bakhai\n\n3. Goatho buduko branggipana \nRuraako man-a, dukko man-enga; \nNa-an jeo ga-akkuja, duk man-ao. \nUan bakbak gimagen papni andalao\n\n4. Bakbak jokatani sal re-anggen. \nBakbak re-anggen jringirot' dongram'na; \nBakbak, ripengrang, sengnabeaha \nBuduko goatbo da alo jokatbo.", 'songNumber' : 420},
  {'title' : 'JATRANGNA AGANNA KATA DONGA',
  'song' : "1. Jatrangna aganna kata donga. \nJean kakketona dilgen, \nKa-sa' bebeko mesokgen, \nJean tom-tom ong-atgen. x2\n\n(Ring-taitaiani.) \nMaina walba pring gita teng-gen \nPringba saljatchi gitagen; \nTom-tomgipa Gitelni songnok. \nA-gilsakna sokbagen.\n\n2. Jatrangna aganna kata donga, \nKa-sabegipa Rajako; \nOn-jok Detangko an-chingna \nJokat' pilak mandeko. x2\n\n3. Jatrangna aganna kata donga. \nJean an-chingmung dongpajok; \nIsolona re-batokchina, \nManderangna chol ojok. x2", 'songNumber' : 421},
  {'title' : 'P\'LAK RASONG NANG-NIN',
  'song' : "1. P'lak rasong Nang-nin, Tangchapil-gipa! \nBon-changja cheani, siako amaha; \nRo-ong champengani sa-grerang jita, \nGanbita Un' ba-ra' gopramon dona.\n\n(Ring-taitaiani) \nP'lak rasong Nang-nin, Tangchapil-gipa.! \nBon-changja cheani, siako amaha.\n\n2. Jisuko grongna gopramo dongja, \nKa-sao nang-ko gronga, kenan griaha; \nKatchabo Un' dedrang chean gitko ring-na, \nSian beri amjaha, Gitel tangenga.\n\n3. Nang-on ka-donga, Rasongni Raja; \nJanggi ong-nan amja. Nang' on-dapasa, \nDakbo ching' chegipa, Nang' ka-sachisan, \nJordanko chobatna, Nang' dongramona", 'songNumber' : 422},
  {'title' : 'MAIRONG BEBE NA-A',
  'song' : "1. Mairong bebegipa O Isol Na-a! \nNang' ka-sao gri jagring simdapa; \nDingtangja pangnaba O Gitel Na-a, \nNang' ka-saa jringjrotni jringjrotnaba.\n\n(Ring-taitaiani)\nMairong bebe Na-a! Mairong bebe Na-a! \nPringanti gital gital Nang' ka-saa \nP'lak angna nangani Nang' jakchin on-a; \nMairong bebegipa Gitel Na-a!\n\n2. Ding-kari, sin-kari, ritimkarirang, \nRakari, sal, jajong, askirangan; \nBakrima p'lak Nang ni dakgiminrangba \nOn-na sakki pilak Nang' bebena.\n\n3. Papna, kema ka-a aro tom-toma, \nNang' sambaon katchaani, dilaniba \nDa-alna bil, ka-donga knasalnaba; \nHajalrangsa Gitel Nang' patiarang!", 'songNumber' : 423},
  {'title' : 'IA BILSINI A-BACHENGO',
  'song' : "1. Ia bilsini a-bachengo \nNang' songnok' dakna; \nNa-an chingko sepajokma? \nIa songona.\n\n(Ring-taitaiani.) \nGitel, Gitel, Nang-ni ska gita. \nNama kamrangchi mesokna \nBil on-pakubo.\n\n2. Ia chingni dongram biapo \nNang Songnok ong-na; \nNang-ni ka-san' namnikachi. \nPatiangpabo.\n\n3. la A-chik songni jatchio \nNang' Songnok ong-na; \nDingtangmancha bi-a Nang-o \nIa biapna.\n\n4. Ia a-ding, a-kong, A-chiko. \nBurung jatchio \nChingko uigija a-songo \nNa-an seaha.\n\n5. Ia Nang-ni kamko ka-angna, \nChinga tom-tome \nDakangpana bilko bi-a, \nIa bon-kamao.", 'songNumber' : 425},
  {'title' : 'GITELNI MEATAMKO MANIANI',
    'song' : "1. Gitel nang-ko mikkangchak'na re-baa \nNikgijakoba ka-tongo nikna; \nKa-sachakako jringjrot man-batna ; \nAro Nang-o neng-taksrangna man-na.\n\n2. Janggin' pitako anga cha-na ska ; \nNang-mu salgin' ringaniko ringpaa ; \nA-sakni balrang: iano donna; \nPap' watanikoba am-taina ska.\n\n3. Nang-osa angni dakchakani gnang; \nNang' jakna agre gipinko nangja; \nO, angni Gitel, Na-an chu-onga; \nNang-ni bilosa anga bil' amn-paa\n\n4. Angara papi, Na-a rongtala; \nNang' an-chichi ang' gro' rongtalata; \nIako manie tom-toma' man-a; \nO Ka-saa jokatgipa Na-an ong-a.", 'songNumber' : 430},
  {'title' : 'MINGA GETHSEMANE',
    'song' : "1. Minga Gethsemane \nDonga ge-sa bari; \nUnon Jokatgipa Jisu \nOng-jok, an-chiari.\n\n2. Sintee an-chingna, \nChoknoke papina, \nUni bi-mitingo bobil \nRim-angjok so-otna.\n\n3. Walo sakchignina \nDake uamangna \nMesokangjok Niam Gital,\n An-chi be-en cha-na.\n\n4. Pita be-en gita : \nDraka an-chi gita : \nChana nanggen pilak mande. \nGisik ra-na gita.\n\n5. Angko cha-jaode, \nAngko ringjaode. \nUni okning gisikode \nDongja janggin' gamde.\n\n6. Isol ka-sagipa,; \nApa ching' Nokgipa, \nA-gilsakni mondoliko \nDakbo manigipa.", 'songNumber' : 431},
  {'title' : 'KRISTOO NANGRIME',
  'song' : "1. Jisuo ripengrang \nRe-bae tom-toka : \nGitelni Meatam' cha-na \nChinga kusi ong.a.\n\n2. Ka-donga mingsasan. \nBebera-ani apsan ; \nJongada noabi p'lakan \nGitelo nangriman'.\n\n3. Ripengni duk chingnin, \nUn' bal jrimbeoba \nJisuo ka-sagrikani \nUko ritchengata.\n\n4. Kristoo nangrime \nChinga maniaha ; \nGisik an-senge katchae \nChinga da-o watgrika.", 'songNumber' : 432},
  {'title' : 'PITAKO PE-PABO',
  'song' : "1. Pitako pe-pabo, \nGitel, angna, \nSagalni rikamo \nSkango gita; \nPilakna bateba \nNang-kon am-a; \nNang-na ka-pakbea, \nJanggin' Pita.\n\n2. Bebeko patibo, \nGitel, angna, \nGalilio gita \nOn-e pita, \nUnon kaarangoni \nJakgitelgen; \nGitel, tom-tomako, \nNang-on man-gen.", 'songNumber' : 433},
  {'title' : 'KA-SAAN\' CHIMIK',
    'song' : "1. OGitel p'lakni Nokgipa, \nOn-enga da-o chingni bi-a; \nRudapchina Nang' patiako, \nUmangni janggi tangao.\n\n(Ring-taitaiani.) \nPatibo Gitel ka-san' chimik. \nTipchanggija janggin' sal gimik; \nSalsaoni salsaona, \nRe-engon a-sakni rama.\n\n2. Ja-kusan ga e re-engon, \nMikkangchi rama andalon; \nRe-dilbo, dakchakbo Gitel, \nTeng-sue, seng-ani on-e.\n\n3. Ong-china kusini salrang, \nChel-china p'lak jajrengarang; \nPindapbo Gitel Nang' grangko, \nChel-chakbo pangnan u'mangko.", 'songNumber' : 434},
  {'title' : 'BIA KA-AO BI-A',
  'song' : "1. O Isol, skangon patia, \nMe-a me-chik kimgrikchina; \nChing' kosakoba ka-sabo, \nKu-siktangko chu-sokatbo.\n\n2. Ia me-a me-chik sakgni'n, \nKa-sae nangrimgrike donggen; \nDuk aro sukni saloba, \nNamatbo pilakchikoba.\n\n3. Siani sal re-ban' salo, \nKa-dimeatbo u'mangko; \nEkgrikatgija, Salgio. \nO Gitel racha, jokatbo.", 'songNumber' : 435},
  {'title' : 'EDENO ME-CHIK ME-A',
  'song' : "1. Edeno me-chik, me-a,\nDake Isol patia; \n{ Sakgniko nangrimate, \nKimchengata indake.}  x2\n\n2. Skangoni niam ia, \nName dake nangrima; \n{ Ma-ko pako watemung, \nRipeng dake jiktangmung. }  x2\n\n3. Sakgnian aldugrike, \nJringjrotna ka-sagrike; \n{ Be-en an-ma dingsasan. \nNama kamna ku-cholsan. }  x2\n\n4. Gitelko olakigen, \nJensalo u'mang sigen; \n{ Un salo biapsanon; \nMitelchina damsanon. }  x2", 'songNumber' : 436},
  {'title' : 'KA SAAN\' NING-TU\'A',
    'song' : "1. Ka-saan' Ning-tu'a, chanchina amsokja. \nRe-baa Nang-ona, choknoke bi-na \nU'mangni ka-sa' ong-china jringjrotna; \nNangrimatjok Na'a janggisan ong-na.\n\n2. Patibo Na-a, kim-kim beberaani, \nKa-sachakani, chu-soka janggi, \nKa-dong, mangraka, kim-kime chadengna. \nKena gri chakna, siako amna.\n\n3. On-bo kusini, chel-na p'lak dukrang'ni, \nTom-tome dongna, sokon dinggrika; \nNa-an rasongni pring, knasalo janggina, \nDongkama, ka-sa' janggi jringjrotna.", 'songNumber' : 437},
  {'title' : 'RE-BA\', MITELNA, RE-BA\'',
  'song' : "1. Re-ba', mitelna, re-ba', \nRakarini git' ring-na; \nMi akmane chimongjok, \nMikkang salrangna donjok. \nIsol patibeaha, \nChingna kraana bata; \nRe-ba\', mitelna, re-ba\', \nRakarini git\' ring-na.\n\n2. A-bani mi misirang, \nBarioni me-surang, \nBolni biterangkoba, \nIsol ka-sae on-aha, \nJaksrame Ua on-a, \nSimsak' gamgiparangna; \nRakari soko chingna \nApa biteko on-a.\n\n3. Nang-oni pilak ong-a, \nApa, Patibegipa; \nKatchae mitelna re-baa, \nNang-na gitko ring-toka. \nRe-ba mitelna, re-ba', \nRakarini git' ring-na; \nIsolni nok'na re-ba' \nRakarini git' ring-na.", 'songNumber' : 438},
  {'title' : 'SOBAO RING-ANI',
  'song' : "1. O Isol ka-sabegipa, \nNa-an chingna Patigipa, \nKa-saachi rakiaha, \nJongadako nikataha.\n\n2. Chinga ia bilsiona, \nJongadamung ku-monggrikna, \nMe-a me-chik ku-rang apsan \nMan-aha mitelna damsan.\n\n3. Ia songo jeko chinga \nChanchitokgen, Nang-ni kamna; \nTom-tokaha ianona, \nRe-babo, Gitel, chingona.\n\n4. Bilsi gital mikkangchina \nNang-ni kamko tongtong dakna, \nChingni gisik namgijako, \nAmatbo galna uako.\n\n5. Chinga pilak A-chik goka, \nUitokja maikai joka; \nMikronchi nikeba nikja, \nKnapaoba nachil songja.\n\n6. Apa Isol, ka-sagipa, \nPilakkon Na-an amgipa. \nChingni gisik sikgijako \nRongtalatbo paponiko.\n\n7. Chinga ia chon-kamao \nMol-molenga, Nang-ni ja o \nPa, De, Gisik Nambegipa, \nRe-babo ching' tom-aona.", 'songNumber' : 439},
  {'title' : 'A-SONGTANGAN NAMBATA',
  'song' : "1. O a-gilsakni pilak biapna, \nA-songtangan nambata; \nMingsinggipa gipin a-songrangna \nA-songtangan nambata. \nUno sal teng-a jringnan andalja, \nBibalrang balan pangnan sikrepja; \nKa-saani ku-rang salsan chotchangja, \nA-songtangan nambata.\n\n2. Ma-drang ka-saa jechi re-oba, \nA-songtangan nambata; \nSokja uko angni jumangrangba, \nA-songtangan nambata; \nMa-a-pa, jong-no aro ripengrang, \nKa-srokata O angni a-songtang; \nKa-saan kamrang teng-suata u'rang, \nA-songtangan nambata.\n\n3. Re-angoba gipin a-songrangchi, \nA-songtangan nambata; \nTusioba nikata jumangchi, \nA-songtangan nambata; \nChubatao donggipa chingni Paa \nPatiangbo ia ching' a-songna, \nRasong man-chong chasongni chasongna, \nA-songtangan nambata.", 'songNumber' : 440},
  {'title' : 'A-CHIK A SONG',
    'song' : "1. Angni A-chik songko. \nAtchiram songtangko, \nAnga ring.gen; \nSiram pagitchamni, \nDongram uamangnin, \nPilak 'brirangbani, \nRing-chong nang-kon.\n\n2. Angni A-chik songna, \nAtchiram songtangna, \nAnga ka-saa; \nKa-saa nang' bolgrimna, \nA-bri, chiringrangna, \nKa-a moa nang-na \nAngni songna.\n\n3. Nang' namako nikna, \nNang-ko teng-suatna \nMangsongtoka; \nNang-ko silatbatna, \nNang-ko chubatatna, \nJotton ka-gen chinga, \nAma dipet.\n\n4. Apa Isol Nang-on, \nChing' Jokatgipaon, \nChinga bi-a; \nNama Kata gipchong, \nChing' song teng-supachong, \nOng-atbo biltangchi, \nChingni Isol.\n\n5. Olakitokchina, \nIsolni bimungko, \nPilak mande'n; \nA-chik songgimikon, \nRatokchong Isolko, \nWate miterangko, \nChingni bi-a.\n\n6. An-tangni biltangchi, \nNang-ni nitimachi, \nDonbo chingko; \nDakna Nang-ni kamko, \nGipatna, toromko, \nA-chik songgimiko, \nOn-bo bilko.", 'songNumber' : 441},
  {'title' : 'ANG\' SONG ATCHIRAM SONG',
  'song' : "1. O angni song, ka-sara atchiram song, \nSongdongram pagitchamni nang-o tom-tom, \nNitoja burung, re-toja rong-grim, \nO angni namnika a-song.\n\n(Ring-taitaiani.) \nAng song, ka-sabata song, \nBe-en gisikan chipgen ka-saan, \nO angni ka-sara songnan, \nAng' song, ka-sabata song, \nBe-en gisikan chipgen ka-saan, \nKa-sabata A-chik songnan.\n\n2. Bang-paja uiani nitoja ganding. \nCholnikja chimongpana a-ani mitim, \nOn-gen janggikon bon-atgen gamkon, \nO ang ka-sabata songnan.\n\n3. Chonnikchong mitchichong pilak manderang. \nOng-jamade noktangan angna Eden, \nBang-oba songrang, nitoa nokrang, \nNa-an ang ka-sabata song.\n\n4. Kinalko moboda nichaoe pante, \nPilakan ring-china ku-rang til-tile, \nOn-bone rasong' nambata bimung', \nAng' songna patiangkuchong.", 'songNumber' : 442},
  {'title' : 'O GITEL, P\'LAKNA BI-CHAKON',
  'song' : "1. O Gitel, p'lakna bi-chakon, \nA-ani songantina, \nA-songtangnaba bi-chakpaa, \nChing' atchiram songna.\n\n2. Chingni a-songko re-dile, \nTom-tome patibo, \nChing gamgimin a-barangko \nSilroroatkubo.\n\n3. Nang mung bebena ka-saachi \nChingko nangrimatchong; \nJakgitelani gitrangko \nA-ding; a-we ring-chong.\n\n4. Jatrangni Gitel, Nang' jako, \nSongtangko pakwata; \nUan' Katnapram, Chelchakramba, \nRipeng jringirot, Na-a.", 'songNumber' : 443},
  {'title' : 'BI-SAKO ISOLNA PAKWATA',
  'song' : "1. Gitel Jisu, Jokatgipa, \nPangnajolna ka-sagipa, \nNang-jako ia bi-sako \nOn-jok, Gitel, chinga Nang-o.\n\n2. Gitel Na-an uko dilbo, \nNamginina patiangbo; \nKa-sapae ra-chakpabo; \nNang-ni mande uko dakbo.\n\n3. Nang-ni rongtalgipa Gisik, \nUko dilchong ka-sindikdik, \nGitel Jisu' bi-sa ong-e \nDal-angchina Nang-o donge.", 'songNumber' : 444},
  {'title' : 'NOKTANGO KA-SAA DONGON',
  'song' : "1. Noktango ka-saa' dongon, \nP'lakan nitoa; \nNoktango ka-saa' dongon, \nKatchaa dongkama. \nTom-toma'ba dongode, \nPilakkon an-sengata; \nNoktango ka-saa' dongon, \nSal name re-a.\n\n2. Nok chongipa ong-oba, \nKasaa' dongoa, \nKa-onanga, jegrika, \nPangnaba dongja. \nPulrang, nitoe bala; \nSara, bari silbea; \nJanggitangko chu-soka \nKa-saa dongoa.\n\n3. Noktango ka-saa dongon' \nSal raka gita, \nSakgipinna gipanga, Noktangni ka-saa' \nChirang, bolrang, do-orangba, \nKatchaako mesokpaa, \nSalgin' Apaba katchaa, \nKa-saa' dongoa.\n\n4. Noktango ka-sagrika, \nJisunin ong-a. \nNoktango ka-saa' donna, \nAngni pal donga. \nNokni mande sakanti, \nKa-sagrikna salanti; \nKristian nokko mesoka, \nJisun' kasaachi.", 'songNumber' : 448},
  {'title' : 'CHING\' ON-ARANG NANG-NIN',
  'song' : "1. Ching' on-arang Nang-nin, \nU'rang ong-chong jeba; \nChingo ka-donge Gitelnin \nJakkalna on-asa.\n\n2. Nang ka-sae on-arang, \nOng-kuchong nokolna; \nMan-a jekai patiarang, \nKatchae on-angskana. \nAMEN.", 'songNumber' : 450},
  {'title' : 'PAISAKO GILANI',
  'song' : "1. Anga bang-e man-paja, \nKu-si ong-e ra-bara, \nKa-sae on-ako u-ia \nKristo Jisu ra-chaka.\n\n2. Segrini paisa gita. \nAngni donako nika; \nSinghason' ang ka-donga, \nChandime patironga.", 'songNumber' : 451},
  {'title' : 'PAANA, DE\'NA GISIKNA',
  'song' : "Paana, De'na Gisikna \nRasong' on-na \nAnchinga pilakan; \nOng-chengon gita da-oba, \nApsan jringjrotonaba, \nSal chon-jaskal \n\nAmen, Amen.", 'songNumber' : 452}
];

List<Map> prayer = [{'title' :  'GITELNI BI-ANI\'', 'prayer' : 'O salgio donggipa chingni Paa, \nNang-ni bimungko rongtala ine intokchina. \nNang-ni Songnok ong-bachina. \nSalgio maikai, uandake a-aoba \nNangni namnika chusokchina. \nChingni chana nangako daalo \nchingna on-bo. \nAro chingna gro nanggiparangko chinga wataha gitan, \nchingni grorangko watbo. \nAro chingko dakmajoaona rimnapnabe, \nindiba namgijagipaoniko chingko jokatbo. \nMaina Songnok aro bil aro rasong \njringjrotna Nang-ni ong-a. \nAmen.'},];

List<Map> aganchakgrikani = [{
  'title' : 'ISOLKO MITELCHINA PILAK \nMANDERANGKO DIDIATA',
  'body' : "Dilgipa: Jihovana inchrobo, pilak na simang asongrang. \nJinma: Ka-sroke Jihovana dangdike on-box ring-ani gnang Uni mikkangona re-babo. \n\nD. Jihovaan Isol ong-a ine na simang u-ibo: \nJ. Uan an-chingko dakgipa ong-a, aro an-chinga Unin ong-a; an-chinga Uni manderang ong-a, aro Uni cha amramni mesrang.. \n\nD. De-mitela gnang Uni cholgugarango, aro mitela gnang Uni sa-rarango napbo: \nJ. Uko mitelbo, aro Uni bimungko namchina inbo. \n\nD. Maina Jihova namgipa ong-a.\nJ. Uni ka-sae dakara jringjrotnan, aro Uni bebe dakara pilak chasongrangonan ong-a.",
  'number' : 1},
  {'title' : 'JIHOVAAN NIRIKGIPA ONG-A',
  'body' : "Dilgipa: Jihova angko Nirikgipa ong-a; \nJinma: Tangsekgipa cha-amramrango Ua angko tuata; tom tomgipa chirangni sambao Ua angko moanga. \n\nD. Ua angni janggiko an-saoata: An-tangni bimungni gimin kakket dakani ramarango Ua angko re-dila. \nJ. Oe, anga siani salakimni a-kongko re-oba, anga mamung namgijana kenjawa; maina Nara ang baksa donga. \n\nD. Nang ni monggot aro Nang-ni gol-dik, Uarang angko ka-dimeata. \nJ. Na-a angna cha-chakaniko angni bobilrangni mikkango tarie dona. \n\nD. Angni skoo Na-a to nongaha; angni rangkare suakpila. \nJ. Beben namani aro ka-sae dakani angni janggi tangani sal dipet angko ja rikgen; aro anga jringjrotna kingking Jihovani noko dongkamgen.",
  'number' : 2},
  {'title' : 'NAMA KATAKO AGANPRAKANI',
  'body' : "Dilgipa: Ua uamangna aganaha, Moseni niamo, segimin pilakan chu-sokna nanga ine angni na-simang to katchinikgiparango, aro gitrango angni gimin baksa dongengmitingo na.simangna agangimin kata ian. \nJinma: Unon uamang Sastrorangko u-ichina gita Ua uamangni gisikrangko oe uamanga aganaha. \n\nD. Indake sea gnang, Kristo duk chakna, an salgitamo sigminrangoni tangchapilna. \nJ. Aro Jerusalemoni a-bachenge Uni bimungo gisik pil-ani, aro pap wataniko pilak jatrangna aganparakna nanggen \n\nD. Na-simangan iarangni saki ong-gipa. \nJ. Aro nibo, anga na simangona angni Paani ku-rachakgiminko watatgen, indiba na simangde kosakoni bilko ganatjana kingking songjinmao dongkubo. \n\nD. Jisu uamangna aganne inaha, Salgio ar a-gilsako darang bilkon angna on-aha.Uni gimin na-simang re-ange pilak jatrangko sninggipa dakba aro Pagipani aro Degipani,aro Gisik Rongtalgipani bimungo uamangko baptize ka-atbo. \nJ. Anga jeko jeko na-simangna geetaha ua pilakkon manichina uamangna skiebo; are nibo, sal chon-jaskal pangnan anga na-simang baksa donga.",
  'number' : 3},
  {'title' : 'JIHOVA AN-TANGNI MANDERANGKO \nRAKIGIPA',
  'body' : "Dilgipa: Anga a-brirangchiko nichaogen; angko dakchakani baoni re-bagen? \nJinma: Angko dakchakani Jihovaoni ong-a, Uan salgiko aro a ako dakaha. \n\nD. Nang-ni ja-ako jitatna Ua on-jawa: nang-ko rakigipa tusidimujawa. \nJ. Nibo, Israelko rakigipa tusidimujawa, aro tusijawa. \n\nD. Jihova nang-ko rakigipa ong-a: Jihova nangni jakrao nang na salakim ong.a. \nJ. Salo sal nang-ko dokjawa, aro walo jajongba. \n\nD. Pilak namgijaoniko Jihova nang ko rakigen, nang ni janggiko Ua rakigen. \nJ. Da-ontaltal jringjrotona kingking, nang-ni re-ongkatako aro nang-ni napbaako Jihova rakigen.",
  'number' : 4},
  {'title': 'KAKKET DAKGIPA ARO NAMGIJAKO DAKGIPAKO TOSUSAA',
  'body' : "Dilgipa: An-senga ua mande, je papirangni ku-patio re-ruraja.\nJinma: Aro namgija dakronggiparangni ramao chadengja, aro kal-stapgiparangni asongchakanio asongja:\n\nD. Indiba Jihovani niamo uni ka-srokani ong-a, aro uni niamko sal wal ua chanchibewala.\nJ. Aro uan chiringrangni chisamo ge-gimin bol gita ong-gen, je bol an-tangni kario bite nanga.\n\nD. Aro uni bi-jak sikrepja; aro ua jekoba daka uan silgen.\nJ. Namgija dakgiparang indake ong-ja, indiba balwana balponggipa bebu gita ong-a.\n\nD. Uni gimin namgijako dakgiparang bichalo. aro papirang kakket dakgiparangni jinmão chadengjawa.\nJ. Maina kakket dakgiparangni ramako Jihova u-ia; indiba papirangni rama gimagen.",
  'number' : 5},
  {'title' : 'ISOLNI KA SAANI GIMIN JOKATANIKO MANA',
  'body' : "Dilgipa: Na-simangkoba Ua tangchaataha, na simang na-simangni namgija dakanirango aro paprango sigimin ong-mitingo. \nJinma: Je paprango skango ia a-gilsakni tanga gita, bangbangni bilni, chongmotan manigijani dedrango da'o kam ka-gipa gisikni pamong gita nasimang reruraachim.\n\nD. An-chingba pilakan skango uamangni gisepo, be-en aro gisikni skako chu-sokate, an-tangtang be-enni aro chanchianirangni skarang gita dakrongachim, aro gipinrang gita ba-kapon ka-onangani dedrangchim.\nJ. Indiba ka-sachakao gam gnanggipa Isol, je ka-sara bang-beachi Ua anchingna kasaaha, uani gimin.\n\nD. An-ching paprango sigimin ong-oba, Ua an-chingko Kristo baksa tangchaataha-ka-saachin na simang jokatako man aha.\nJ. Aro Kristo Jisuo an-chingko Un baksa chakatataha aro salgirango Un baksa asongataha.\n\nD. Ua maikai re-baenga chasongrango Uni ka-saani agre gamchatako Kristo Jisuo an-chingna rinok rinok dake mesokna man-gen.\nJ. Maina ka-saao bebera-achi na simangko jokataha; aro ua na simangoni ong-ja, Isolni on-asa.\n\nD. Pilakba gaorade-jachina ua kamoni ong ja. kamrangna Kristo Jisuo dakgimin, an-ching\nJ. Maina an-chinga Unin dakgimin, nama Harango re-rurachina Isol jerangko tarisoaha.",
  'number' : 6},
  {'title' : 'JISU KRISTONI ATCHIANI',
    'body' : "Dilgipa: Aro ua songo jak nirikgiparang pattalo donge walo jaktangko nirikengachim..\nJinma: Aro Gitelni sa-gre saksa uamangni sepango chadengaha, aro Gitelni rasong uamangko teng-suduulaha; aro uamang namen kenbeaha.\n\nD. Aro ua sa-gre uamangna aganaha, Da-ken, maina nibo, anga na-simangna namen katchaani nama katako agana; ua darang mandenan ong-gen.\nJ. Maina da alo Daudni songjinmao na simangna jokatgipa atchiaha; uan Kristo Gitel.\n\nD. Aro ian nasimangna chin; na simang ba-rachi, remreme chikongo tugipa bi-sako nikgen.\nJ. Aro rang-gitik ua sa-gre baksa salgini kotok jinma Isolko mitele aganaha. \n\nD. Chubatao Isolna rasong, aro a-gilsako namnika manderangna tom-toma.\nJ. Aro ua sa-grerang uamangoni salgiona re-angmanoa, ua nirikgiparang agangrike inaha, Imbo, da-ode an-ching Bethlehemona kingking re-ange, Gitelni an-chingna uiatgipa ia ong-giminko nina hai.\n\nD. Unikoa uamang gong-rake re-ange, Mariam aro Joseph aro chikongo tuatgipa bi-sako am-e nikaha.\nJ. Aro nikoa ia bi-sani gimin uamangna agana katako uamang aganaha. Unon knagiparang pilakan nirikgiparangni uamangna aganani gimin aiao inmanaha.\n\nD. Indiba Mariam ia pilak katarangko chanchie gisiktango rakiaha.\nJ. Unikoa nirikgiparang an-tangtangna agana gitan pilakkon knaaha aro nikahani gimin Isolko mitele rasong chaate re-pilangaha.",
  'number' : 7},
  {'title' : ' AN-SENGGIPARANG',
  'body' : "Dilgipa: Jisu jinmarangko nike a-briona doangaha.\nJinma: Ua ku-sik oe uamangna indine skiaha.\n\nD. Gisiko kangalgiparang an-senga. \nJ. Maina Salgini Songnok uamangnin.\n\nD. Kal-imgiparang an-senga \nJ. Maina uamangko ka-dimeatgen.\n\nD. Sontolgiparang an-senga.\nJ. Maina uamang a-ako man-rikgen.\n\nD. Toromna okkrigipa aro ringna sikgiparang an-senga.\nJ. Maina uamangko okkaatgen.\n\nD. Ka-sachakgiparang an-senga.\nJ. Maina uamang ka-sachakako man gen\n\nD. Ka-tong rongtalgiparang an.senga.\nJ. Maina uamang Isolko nikgen.\n\nD. Nangrimatgiparang an-senga.\nJ. Maina uamangko Isolni depanterang ine ingen.\n\nD. Toromni a sel a-rika man-giparang an-senga\nJ. Maina Salgini Songnok uamangnin.\n\nD. Na-simang an-senga\nJ.Jensalo manderang angni a-sel na simangko intekgen, aro a'rikgen, aro tole ma manti namgijako agangen.\n\nD. Na simang katchabo aro ka-srokbo.\nJ. Maina salgio na simangni man-gni bang-a. Maina uamang na simangna skanggipa katchinikgiparangko indaken a-rikachim.",
  'number': 8},
  {'title' : 'KRISTIANNI PILAK TARIANI',
  'body' : "Dilgipa: Ja-manni kata ian, Gitelo aro Uni bilni bilakanio bilakbo.\nJinma: Diabolni budi dakanirangni mikkango chadengna amna gita, Isolni pilak tarianiko ganbo.\n\nD. Maina be-en aro an-chi baksade an-chingni dakgrika ong-ja, indiba raja ong-anirang, bilrang, ia andalani a-gilsak pamongrang, salgirango namgijani gisik kotokrang baksa.\nJ. Uni gimin na simang namgija salo champengna amna gita aro pilakkon chu-sokate chadengna amna gita, Isolni pilak tarianiko ra-bo.\n\nD. Uni gimin bebechi na-simangni kang-kareko wentonge, aro toromni chelo pa-aniko pa-e.\nJ. Aro tom tomani Nama Katana tarianio ja-kop gare.\n\nD. Aro jechi na-simang ua papni pilak wa-alni brako kimitna man-gen, pilakni kosako bebera-ani danilko ra-e chadengbo.\nJ. Aro jokani tupi aro Gisikni tonualko, chong-motan Isolni Katako, rabo.",
  'number' : 9},
  {'title' : 'JIHOVAO PANGCHAKGIPANI JAJRENGGIJA ONG-ANI',
  'body' : "Dilgipa: Namgijako dakgiparangni gimin an-tangko jajrengatnabe, aro kakket ong-gijako dakgiparangko mikbunabe.\nJinma: Maina samko gita uamangko bakan ragen, aro me-su samjak tangsekgipa gita sikrepgen.\n\nD. Jihovao ka-dongbo, aro namako dakbo;a-songo dongkambo, aro Uni bebe ong-ako cha-ambo.\nJ. Jihovao an-tangko ka-ba ka-srokatbo; unon nang-ni ka-tongni skarangko Ua nang-na ongen.\n\nD. Nang ni regniko Jihovana pakwatbo; Uano ka ba ka-dongbo, unon Ua uko ong-atgen..\nJ. Aro seng-a gita nang-ni kakket dakako Ua ongkatatgen, aro sal jatchi gita nang-ni kakket bichalko.\n\nD. Jihovani mikkango jrip dongbo, aro Una chakchike sengsobo; an-tangni ramao silgipani gimin, namgija chol dakanirangko chu-sokatgipani gimin an-tangko jajrengatnabe.\nJ. Ka-onangako dondikbo, aro kaagapako watgalbo; an-tangko jajrengatnabe, uan namgija dakaonasa ong-aigen.\n\nD. Maina on-tisa sal ong-kugen, unon namgija dakgipa dongjawaha: oe, naa uni dongramko name chanchie nigen, aro uan dongjawa.\nJ. Indiba ongiparang asongko manrikgen, are namen tom-tomao an-tangtangko ka-srokatgen.",
  'number' : 10},
  {'title' : 'TIPGIJAGIPA KA-SARA',
  'body' : "Dilgipa: Anga manderangni aro ku-sikko aganoba, indiba angni ka-saa dongjaode. anga gam-gipa pitol ba gam-gipa kakwa ong.aha.\nJinma: Aro anga katchinikaniko man-oba, aro pilak ning-tuarangko, aro pilak uianiko uioba; aro a-brirangko jitatna gita anga pilak bebera-ako man-oba, indiba angni ka-saa dongjaode anga mamung ong-ja.\n\nD. Aro anga angni pilak gamko alduna on-oba, aro so-a man-china anga angni be-enko on-oba, indiba angni ka saa dongjaode, angni mamung namgni dongja.\nJ. Ka-sara chakchika, rinok rinok daka.\n\nD. Ka-sara miknengja, gaoradeja, gangbingja.\nJ. Nitogija dakja, an-tangnirangko am-ja, ka-onangja, namgijako chanja;\n\nD. Torom ong-gijanio katchaja, indiba bebeo katchaa.\nJ. Pilakkon chaka, pilakkon bebera-a, pilakkon ka-donga, pilakkon chakchika\n\nD. Ka-sara pangnaba tipja. \nJ. Indiba katchinikanirang dongoba, uarang bon-gen; ku-sikrang dongoba, uarang chon-gen; uiani dongoba, ua bon-gen.\n\nD. Maina an-chingni uia chong-diksasan, aro an-chingni katchinikani chong-diksasan.\nJ. Indiba chusokgipa sokbaode, chong-dikgipa bon-gen.\n\nD. Anga jensalo bi-sa ong-achim, anga bi-sa gita aganachim, bi-sa gita uiachim, bisa gita chanchiachim; anga mande ong-ahaoa, anga bi-sanirangko wataha.\nJ. Maina da o an-chinga janerachi, aganmitapao, nika; mikkangchakgrike nikgen. indiba \n\nD. Da-o angni uia chong-diksasan onga; indiba unon angko uiaha gita anga uigen.\nJ. Indiba da o bebera a, ka-donga, ka-sara, ia minggitam donga; aro iarangoni ka saan dal-batgipa ong-a.",
  'number' : 11},
  {'title' : 'GE-ETA MINGCHIKUNG',
  'body' : "Dilgipa: Isol ia pilak katarangko agane inaha. \nJinma: Angan nang ni Isol Jihova.\n\nD. Angna agre nang-ni gipin isolrang dongjachina.\nJ. Nara an-tangna kitgimin mite dakaniko, ba kosako salgio donggipa, ba ka mao a 20 donggipa, ba a-ani ning-o chio donggipa mamungni bimangko daknabe.\n\nD. Na-a an-tangko uarangni mikkango tuchikopatnabe, aro na-a uarangna dangdike on-nabe. \nJ. Na'a Jihova nang ni Isolni bimungko indinari ra-nabe.\n\nD. Maina Jihova Uni bimungko indinari ra-gipako namgija gri ine injawa.\nJ. Nang-ni Isol Jihovani nang-ko ge-etgimin gita, neng-takani salko rongtalatna manibo.\n\nD. Saldoko na-a game nang-ni pilak kamko ka-bo.\nJ. Nang ni Isol Jihova nang-ko ge-etgimin gita, nang-ni ma ako aro nang-ni paako mandera bo\n\nD. Na-a mande so-otnabe\nJ. Na-a til-eknabe.\n\nD. Na a cha unabe.\nJ. Na-a nang-ni songsulna tol-e saki on-nabe.\n\nD. Na-a nang-ni songsulni jikna mikchanabe. \nJ. Nang ni songsulni nokna, uni a-bana ba uni nokol me asana, ba uni nokol me-chikna, uni matchuna, ba uni gadana, ba nang-ni songsulni mamungnaba mikboknabe.\n\nD. Gitel an-chingni Isol, Gitel saksan; aro na-a nang-ni pilak ka-tongchi, aro nang-ni pilak janggichi, aro nang-ni pilak gisikchi, aro nang-ni pilak bilchi nang-ni Gitel Isolna ka-sabo.\nJ. Na-a an-tang, songsulna an-tangna gitan ka sabo. Iarangna bate dal-batgipa minggipin ge-eta gri. Ia ge-eta minggnion darang niam aro katchinikgiparangni agana pangchaka.\n\nD. Ge-eta gitalko anga na-simangna on-a. Na-simang ka-sagrikbo jedake anga na-simangna ka-saaha na-simangba ka-sagrikbo.\nJ. Na simango ka-sagrika gnangode, uachi pilakan na simangko angni sninggiparang ine uigen.",
  'number' : 12},
  {'title' : ' KAKKET DAKGIPA BICHAL KA GIPA \nJIHOVAKO OLAKICHINA OKAMANI',
  'body' : "Dilgipa: Jihovana ring-ani gitalko ring-bo: Jihovana ring bo, a a gimik.\nJinma: Jihovana ring-bo, Uni bimungko namchina inbo; Uni jokataniko sal saoni salsaona parakatbo.\n\nD. Jatrangni gisepo Uni rasongko, pilak manderangni gisepo Uni aiao inmanani kamrangko aganprakbo.\nJ. Maina Jihova dal-a, aro namen mitelani ong-a; pilak miterangna bate Uan kenani ongbata.\n\nD. Maina manderangni miterang mamungba ong-ja; indiba Jihova salgirangko dakaha \nJ. Rasong aro rajani mikkim Uni mikkango donga; Uni torom biapo bil aro nitoani gnang.\n\nD. Jihovana on-bo, manderangoni na-simang ma-drangrang, Jihovana rasong aro bilko on-bo.\nJ. Uni bimungna kraa gita Jihovana rasongko on-bo; on-aniko ra-bae Uni sararango napbabo.\n\nD. Rongtalgipa gananirango Jihovako olakibo: Uni mikkango tiltilbo, pilak a-gilsak.\nJ. Jihova sason ka'a ine jatrangni gisepo aganbo; a-gilsakkoba mangrakataha, maikai uko il·lengatna man-ja: kakket dake Uan manderangko bichal kargen.\n\nD. Salgirang katchachina, aro a-gilsak ka-srokchina; sagal aro uni gapani gam-china.\nJ. A.ba aro uano donggipa pilakan ka srokchina; unon bolgrimni pilak bolrang ka-srokana ring.gen.\n\nD. Jihovani mikkango: maina Uare-baa, maina a-gilsakko bichal ka na Ua re-baa:\nJ. Kakket dakachi a-gilsakko, aro Uni bebe ong-achi manderangko, Ua bichal ka-gen.",
  'number' : 13},
  {'title' : 'ISOLNI KAMRANG ARO KATA',
  'body' : "Dilgipa: Salgirang Isolni rasongko aganpraka; aro bangbangan Uni jakni kamko mesoka. \nJinma: Sal sana sal sa agana, aro wal sana sa uianiko mesoka. wal sana wal sa uianiko mesoka.\n\nD. Ku-agana dongja aro agana kata dongja uarangni ku-rangko knaja.\nJ. Uarangni toani budu pilak a-gilsakchinan re-ongkataha, aro uarangni katarang arani bon-kamaona kingking, Uarango salna Ua dongchakaniko donaha.\n\nD. Ua chawari gita uni turamoni ong-katgipa gita ong-a, aro bilakgipa mande gita uni re-gniko daarina ka-sroka.\nJ. Uni re-ongkata salgini ku-chotoni ong'a, aro uni re-wilwila uni ku-chotrangona ong-a; aro uni ding-aoni mamungba donnua gri.\n\nD. Jihovani niam chu-soka, ua janggiko pil-ata; Jihovani saki mangraka, ua sontolgipako uigipa daka.\nJ.Jihovani ge ete donarang sronga, uarang ka tongko ka-srokata: Jihovani ge eta rongtala. ua mikronrangko niksengata.\n\nD. Jihovana kenara marang gri ong-a, ua jringjrotna donga; Jihovani bichalrang bebe ong-a uarang kakket ong-stanga.\nJ. Uarang sonana bate, oe, banga rongtalatgimin sonana bate mikchagni onga:\n\nD. Bija bitchina, aro bija birangkaponi jokrorotanina bate chi-aba chi-bata.\nJ. Aroba uarangchi Nang-ni nokol gisik rakataniko man-a; Uarangko manion dal-bea man-skaani gnang.\n\nD. Brangatangrangko sawa ma-sina ama? Dongnugiparangni gimin Na-a angko dos gri inbo. \nJ. Gangbinge dakanirangoniko Nang-ni nokolko salba salrikbo; Angni kosako uarangko gitel dakna on-nabe:\n\nD. Unode anga sronggipa ong-gen, aro niam pe-a dal gipaoni anga rongtalgen.\nJ. Angni ku-sikni katarang aro angni kartongni chanchibewalanirang Nang ni nikanio ra chakani ong-china, O Jihova, angni Rong-brak, aro angko Piokgipa.",
  'number' : 14},
  {'title' : 'JIHOVAO PANGCHAKGIPANI KENMANGIJA DONGANI',
  'body' : "Dilgipa: Chubatgipani donnugimin biapo dongkamgipa Bilaksranggipani salakimo donggen. \nJinma: Jihovani gimin anga agane ingen, Uan angni katnapram aro angni killa ong'a; angni Isol, jeo anga ka-donga.\n\nD. Maina do-o rim-gipani ja-gaoniko, aro siatgipa sabisioniko nang-ko Ua jokatgen.\nJ. Uni grangrangchi Ua nang-ko pindapgen aro Uni gangchingrangni ning-o nara katnapgen; Uni bebe danil aro sepi onga.\n\nD. Walo kenbegnina, aro salo bilgipa branaba. \nJ. Andalao re-rorogipa sabisina, aro sal jatchio bon-atgipa gimaatanina na-a kenjawa.\n\nD. Nang-ni sambao sak hajal sa, aro nangni jakrao sak hajal chikung ga-akgen; indiba ua nang ni sepangona re-bajawa.\nJ. Nang ni mikronrangchi na'a niasa niaigen, aro namgija dakgiparangni man skaaniko nikgen.\n\nD. Maina Na-a, O Jihova, angni katnapram ong-a! Chubatgipako na-a nang-ni dongchakani dakaha.\nJ. Mamung namgija nang-o ga-akjawa, aro mamung sabisi nang-ni tambuni sepangona re-bajawa.\n\nD. Maina nang-ni pilak ramarango nang-ko rakichina, Ua nang-ni gimin an-tangni sa-grerangko ge-etgen.\nJ. Uamangni jakrango uamang nang-ko de-tomgen, na-a ro-ongo nang-ni ja-ako nangtingjana gita.\n\nD.Na-a singho aro bisi rakgipa chipuko ga-dapgen: singho bidom aro chipuko na-a ga-belbelgen.\nJ. Angna ua ka-saaha, uni gimin anga jokatgen: anga uko chuatgen, maina ua angni bimungko uiaha.\n\nD. Ua ango bi-gen, aro anga uko knachakgen; duk ong-o anga un baksa donggen; anga uko jokatgen, aro uko rasong chaatgen. \nJ. Janggi tangbangachi anga uko chuongnikatgen, aro angni jokataniko una uiatgen.",
  'number' : 15},
  {'title' : 'GISIK PIL-GIPANI PAP WATAKO BI-ANI',
  'body' : "Dilgipa: Nang-ni ka-sae daka gita angna ka-sachakbo, O Isol: Nang-ni ka-sachaka bang-bea gita angni niam pe-anirangko kimitbo.\nJinma: Angni namgijako talatsrange angko su-srangbo, aro angni papko watsrange angko rongtalatbo.\n\nD. Maina angni niam pe-anirangko anga uienga; aro angni pap pangnan angni mikkango donga.\nJ. Nang ni kosako, Nang-ni kosakosa, anga pap ka-aha, aro Nang-ni nikanio namgijako dakaha.\n\nD. Maikai Nang-ni agananio Na-a toromi inako man-gen, aro Nang-ni bichal ka-ao Na-a rongtalgen.\nJ. Nibo, namgijao angko ba-aha; aro papo angni ma-a angko oko keaha.\n\nD. Nibo, ning-ni bakrango Na-a bebeko man-na ska aro, dongnugimin bako Na-a angna uianiko uiatgen.\nJ. Angko esobchi talatbo, Unon anga rongtalgen; angko su srangbo, unon anga suurina bate bokbatgen.\n\nD. Ka-sroka aro katchaako angko knaatbo; maikai Nang-ni be-atgimin grengrang katchana man-gen.\nJ. Angni paprangoni Nang-ni mikkangko donnubo, aro angni pilak namgija dakanirangko kimitbo.\n\nD. Angni ning-orongtalgipa ka-tongko ong-atbo, O Isol; aro ango kim-kimgipa gisikko daktaibo.\nJ. Nang ni mikkangoniko angko galatnabe; aro Nang ni rongtalgipa Gisikko angoniko raangnabe.\n\nD. Nang-ni jokatani katchaaniko angna on-pilbo; aro jaksramgipa gisikchi angko rim-chakbo.\nJ. Unon anga niam pegiparangna Nang-ni ramarangko skigen; aro papirang Nang-ona pil-baatako man-gen.\n\nD. An-chi ong-atani grooniko angko jokatbo. O Isol, Na-a angko jokatgipa Isol, Unon Nang-ni kakket dakanini gimin angni sre ring.gen.\nJ.O Gitel, Nara angni ku-chilrangko obo; unon Nang-ko mitelako angni kusik parakatgen.\n\nD. Maina Na-a bolio ka-srokja ong-ode, anga uko on-genchim: homo Na-a kusi ong-ja.\nJ. Isolni boliranga bnekgimin gisik ong-a: bnekgimin aro papna duk man-gipa ka-tongko, 0 Isol, Na'a chonnikjawa.",
  'number' : 16},
  {'title': 'JIHOVANI KA-SACHAKANA MITELANI',
  'body': "Dilgipa: Jihova namchina inbo, O angni janggi; aro angni ning-o donggipa pilakan Uni rongtalgipa bimungko namchina inbo.\nJinma: Jihova namchina inbo, O angni janggi, aro Uni pilak namgnirangko gualnabe.\n\nD. Ua nang-ni pilak namgijarangko wata; Ua nang-ni pilak saarangko namata.\nJ. Ua gimaataoniko nang ni janggiko pioka; Ua ka-sae dakani aro ka-sachakanichi nang'o mukutko stikata.\n\nD. Ua namgnirangchi nang ni skako chu-sokata, maikai do-gamdot rajako gita nang-ko pante ong-pilata.\nJ. Jihova pilak oniako man-giparangna kakket ong gipa dakanirangko, aro bichal karanirangko chu-sokata.\n\nD. Mosena Uni ramarangko, Israelni dedrangna Uni dakanirangko Ua uiataha.\nJ. Jihova ka-sachakgipa aro namgipa, ka-onangna ka singipa aro ka sae dakna jaksramgipa onga.\n\nD. Ua pangnan manengkamaijawa; aro jringjrotna kingking ka-onangchajawa.\nJ. An-chingni paprangna krae Ua an-chingna dakjaha, aro an-chingni namgija dakanirangna krae an-chingna on-skajaha.\n\nD. Maina salgirang maikai a ani kosako chubea, indake an-tangna kengiparangna Uni ka-sae dakanira bang-a.\nJ. Salaram maikai saliramoni chel-a, indita chel-aona an-chingni niam pe-anirangko Ua an-chingoniko chel-ataha.\n\nD. Pagipa maikai an-tangni dedrangna ka-sachaka, uandake an-tangna kengiparangna Jihova ka-sachaka.\nJ. Maina an-chingni bimangko Ua uia an-chinga a-dimusan ine Ua gisik ra'a.\n\nD. Mandeara, uni salrang sam gita ong-a; a-bani bibal maikai, indaken ua sila.\nJ. Maina uni kosakko balwa balpakanga, aro ua dongjaha; aro uni biap uko uijawaha.\n\nD. Indiba Jihovani ka-sae dakaniara an-tangna kengiparangni kosako, aro dedrangni dedrangona Uni kakket dakaniara jringjrotoni jringjirotona donga.",
  'number' : 17},
  {'title' : 'KRISTONI DUKKO CHAKCHIKGNI',
  'body' : "Dilgipa: Chingni aganako sawa bebera-aha? Aro Jihovani jakpongko sana parakataha?\nJinma: Maina Uni mikkango Ua nom-gipa samjak gita, aro aa ran-gipaoni ja dil gita chadoaha,\n\nD. Uni bimang aro nitoani dongja; aro an-ching Uko nikon an-ching Uko man na sikna gita nitoani dongja.\nJ. Ua manderangni mitchigimin, aro watgalgimin ong-aha,\n\nD. Dukrangko man-gipa mande, aro saarangko uigimalgipa.\nJ. Aro manderang mikkangtangtangko Uoni donnua gita Uko mitchiaha; aro an-ching Uko dal-nikjaha.\n\nD. Bebean an-chingni saarangko Ua ra-chakaha, aro an-chingni dukrangko ra-angaha.\nJ. Indiba an-ching Uko dokgimin, Isolni dokako man-gipa, aro sasti man-gipa, ine chanchiachim.\n\nD. Indiba an-chingni niam pe-anirangna Ua mata bu-ako man-aha, an-chingni namgija dakanirangna bnekako man-aha.\nJ. An-chingni tom-tom ong-gnini doke skianiara Uni kosako ong-aha; aro Uni doka man-achin an-chingko an-sengataha.\n\nD. An-chinga pilakan mesrang gita brangaha, an-ching sakantin an-tangni re-ani ramachin pil-angaha.\nJ. Aro Jihova an-ching pilakni namgija dakaniko Uni kosako gataha.\n\nD. Uko onia ka-aha, indiba Ua duk man-on an-tangni ku-sikko ojaha.\nJ. So'otaniona rim-anggimin mes bi-sa gita, aro mes kimilko rasotgiparangni mikkango ku gri ong-a gita, uandaken Ua an-tangni ku'sikko ojaha.\n\nD. Onia ka-ani bichalchi Uko rim-angaha..\nJ. Aro janggi tanggiparangni a songoniko Ua galatako man-aha ine, angni manderangni niam pe-ani gimin Ua dokako man aha ine, uni songni manderangoni sawa chanchie niaha?\n\nD. Ua mamung drae dakani grioba, aro mamung tol-napani Uni ku-siko dongjaoba, \nJ. Uni sion Uni gopramko denggugiparang baksa aro gam gnanggipa baksa uamang donaha,\n\nD. Indioba Uko bnekatna Jihova namnikaha; Uko Ua saataha,\nJ. Nara Uni janggiko papna boli dakon Ua an-tangni bitchriko nikgen.\n\nD. Ua an-tangni salrangko bakroatgen, aro Uni jako Jihovani namnikani silgen.\nJ. Uni janggini neng-beaniko Ua nike chu ongnikgen.\n\nD. An-tangko uianichi angni kakket ong-gipa nokol bang ako nama ingen.\nJ. Aro uamangni namgija dakanirangko Ua an tango ra gatgen.\n\nD. Uni gimin anga Una dal-giparangni gisepo rengsiko suale on-pagen,\nJ. Aro bilakgiparang baksa Ua ra-sekgiminko suale ra-gen,\n\nD. Maina siaona kingking Uni janggiko Ua ruprakaha, aro niam pe-giparang baksa chanchapako man aha.\nJ. Indioba Ua bang-ani papko ra'aha, aro niam pergiparangna mol-molchakaha.",
  'number' : 18},
  {'title' : 'MESSIANI SASON KA ANI',
  'body' : "Dilgipa: Nang-ni bichalrangko rajana on-bo, O Isol, aro Nang ni kakket dakaniko rajani depantena.\nJinma: Ua kakket dake Nang-ni manderangko aro mikkang nigija nang-ni ongiparangko bichal ka-gen.\n\nD. Kakket dakanio a-dingrang manderangna tom-tomaniko ra-bagen, aro a-brirangba.\nJ. Ua manderangoni ongiparangko bichal ka'gen, aro kangalgiparangni dedrangko jokatgen, aro onia ka-gipako pe-kninggen.\n\nD. Sal dongenga dipet uamang Nang-na kengen, aro pilak chasongrango, jajong donga dipet.\nJ. Ratgimin samni kosako mikka ga-aka gita, a ako chi rudapgipa mikka wapakarang gita, Ua ong onbagen.\n\nD. Uni salrango kakket dakgiparang silgen, aro namen tom-tomani, jajong dongjahaona kingking.\nJ. Sagaloni sagalona Gitel ong-ani Unin ong-gen, aro chibimaoni aani ki-tikrangona kingking.\n\nD. Bakrao songdongiparang Uni mikkango bamgopgen; aro Uni bobilrang a dimuko srakgen.\nJ. Tarshishni aro chichangrangni rajarang kajinako on-gen: Sheba aro Shebani rajarang on anirangko on-gen.\n\nD. Oe, Uni mikkango pilak rajarang tubamgen; pilak jatrang Una dangdike on-gen.\nJ. Maina Ua kangalgipako jokatgen, uni grapan salo, aro dakchakgipa grigipa ong-gipakoba. \n\nD. Bilgri aro kangalgipana Ua ka-sachakgen, aro kangalgipani janggirangko Ua jokatgen.\nJ. Onia ka-aoni aro dokpretaoniko uamangni janggiko Ua piokgen; aro Uni nikanio uamangni an-chi gamchatgen:\n\nD. Aro uamang tanggen; aro Una Shebani sonaoniko on-gen: Aro Una manderang pangnan bi-chakgen; Ua nama ong-china ine uamang salgimiko ingen.\nJ. A-ao a dingrangni kosako chu'onga mirang ong-gen, Uni bite Lebanon gita mogen; aro songjinmani manderang a-ani sam gita silgen.\n\nD. Jringjrotna Uni bimung dongkugen; salni ru-uta gita Uni bimung ong-kugen.\nJ. Aro Uno manderang patiako man-gen; Uko an-senga ine pilak jatrang minggen.\n\nD. Jihova Isol, Israelni Isol namchina, Uan mangmang aiao inmanani kamrangko ka-a:\nJ. Aro jringjrotna Uni rasongni bimung Namchina; aro Uni rasongchi a-gilsak gimikan gapchina. Amen aro Amen.",
  'number' : 19},
  {'title' : 'ISOLNI SONGNOK',
  'body' : "Dilgipa: Jisu Galiliona re-bae Isolni nama Katako aganprake inaha, \nJinma: Sal chu-sokaha, aro Isolni songnok sepangaha; na simang gisik pil-bo, aro Nama Katako bebera-bo.\n\nD. Aro ua Galili sagal rikamko re-mitingo, Ua Simonko aro Simonni jonggipa Andrewko sagalo chek galengako nikaha.\nJ. Aro Jisu uamangna aganaha, Imbo, ang ja.man ja.man, anga na simangko mande rim-gipa ong na dakatgen.\n\nD. Unon uamang bakan chekrangko wate un baksa re-angpaaha.\nJ. Ua uamangna toe agananiko on'e inaha. Salgini songnok besual bitchri rongsa gita; jeko saksa mande ra.e an.tang a.bao ge.aha.\n\nD. Ua darang bitchrina bate chonbata;\nJ. Indiba ua dal-ode samjakrangna bate dal-bata, aro bol ong-pila, maikai sakoni do-drang bilbae uni bipekrango ba'e roronga.\n\nD. Jisu aganchakaha, Angni songnok iaa-gilsakoni ong-ja.\nJ. Angni songnok ia a-gilsakoni ong'ode, indide Angko Jihudirangni jako on jana gita, Angni nokolrang dakgrikgenchim; indiba daro Angni songnok ianoni ong-ja.\n\nD. Uni gimin Pilat uko aganaha, indide Narara raja ongama?\nJ. Jisu aganchakaha, Angan raja ong-a ine na-an agana.\n\nD. Ianan Anga atchiaha, aro ianan a-gilsakona re-baaha, Anga maikai bebena saki on na mangen.\nJ. Bebeoni ong-gipa sakantin Angni ku-rangko knara.",
  'number' : 20},
  {'title' : 'DAKMAJOANI',
  'body' : "Dilgipa: Unon Diabolni dakmajoako man-na Jisu Gisikchi bakraona rim-angako man-aha.\nJinma: Aro sal sotbri wal sotbri okumu chakmanoa Ua okkriaha.\n\nD. Unon dakmajogipa re-bae una aganaha. Nara Isolni De ongrode, ia ro-ongrangko pita pil-china aganbo.\nJ. Indiba ua aganchake inaha, Sea gnang, Mande pitaarichi tangjawa, indiba Isolni ku-sikoni ong-katgipa pilak katachi tanggen.\n\nD. Unon Diabol Ukorongtalgipa songjinmaona rimange, torom nokni protchongo chadengate Una aganaha,\nJ. Na'a Isolni De ong-ode, chokonbo; maina sea gnang.\n\nD. Ua Nang ni gimin an-tang sa-grerangko ge-etgen; aro Naa ro-ongo Nang ni ja-ako nang-tingatjana gita, uamang an-tangtangni jakrango nang-ko de tomgen.\nJ. Jisu una inaha, Aroba sea gnang, Na.a an-tang Isol Gitelko dakmajonabe.\n\nD. Pile Diabol Uko namen chubegipa a-briona rimange a-gilsakni pilak songnokrangko, aro uarangni rasongko mesokaha.\nJ. Aro Una aganaha, Na-a angko tuchikope olakiode, anga iarangko nang-na on tokgen.\n\nD. Unon Jisu uko inaha, Ianoni katangbo, Satan; maina sea gnang, Nara an-tang Isol Gitelko olakibo, aro ukosan manibo.\nJ. Dakmajoanirangko chakchikgipa mande kusi ong-gipa; maina nama inako man-ahaon, ua Gitelni an-tangna ka sagiparangna janggini mukutko man-gen.",
  'number' : 21},
  {'title' : 'CHAKATPILANI',
  'body' : "Dilgipa: Unon nengtakani salni chon-kamao, antini skang salni wal seng-o, Magdalene Mariam, aro ua sakgipin Mariam gopramko nina re-baaha.\nJinma: Aro nibo, namen banggriaha, maina salgioni Gitelni sa-gre ong-onbaemung ro-ongko romtome uni kosako asongaha.\n\nD. Aro sa-gre me-chikrangna aganchake inaha, Na'simang daken; maina na-simang chisolo datkapa man gipa Jisuko am-enga ine anga uia.\nJ. Ua iano dongja; maina Uni agana gita Ua tangchaaha. Re-babo, Gitelni turamko nibo.\n\nD. Aro bakan re-ange uni sninggiparangna aganebo, Ua sigiminrangoni tangchaaha; aro nibo, na.simangna skang Ua Galiliona re-anga, uano na. simang uko nikgen; nibo, anga na simangna aganaha.\nJ. Aro uamang gopramoni kena aro katchabean baksa bakan re-ange Uni sninggiparangna uko aganna daariangaha.\n\nD. Da-o Kristo tusigiparangoni ong-chenggipa ong-e sigiminrangoni chakatatako man-aha.\nJ. Maina mandechi sia ong-ahani gimin, mandechin sigiminrangoni chakatpilaba ongaha.\n\nD. Maina jekai Adamo pilakan sia uan dakeba Kristoo pilakan janggi tangatako man-gen.\nJ. Maina pilak bobilrangko an-tang ja kokkimao donjana kingking Ua raja ong-na nanga.\n\nD. Chon-kamani bobil ine sia gimaatako man-a.\nJ. Jisu aganaha, Angan chakatpila aro janggi, ango bebera-gipa sioba tanggen.",
  'number' : 22},
  {'title' : 'KRISTIAN NOKDANG',
  'body' : "Dilgipa: Aro Jisuni ma-a paa bilsi anti Watchangani Alana Jerusalemona re-angrongachim.\nJinma: Aro uni bilsi bilsi chi-gniong-ahaoa, uamang alani dakbewal gita doangaha.\n\nD.Aro sal matchotoa, uamang re-pilangmitingo,bi-sa Jisu Jerusalemon dongrikaha; aro Uni mara paa uko uijachim. \nJ. Aro Uko am-joljole Jerusalemona re-pilangaha.\n\nD. Aro sal gitamni jamano uko torom noko man-eaha; Ua skigiparangni jatchio asonge uamangni katako knatimengachim, aro uamangko sing-engachim.\nJ. Aro Uni uianina aro aganchak anina knatimgiparang pilakan aiao inmanpiltokengachim.\n\nD. Aro uko nike, uamang aiao inmanaha; aro Uni mara uko inaha, Dederacha, chingna maina indake dakaljok? Nibo, Nang-ni paa aro anga ka-suangsuang dake nangko am-aha.\nJ. Unon Ua uamangna aganaha, Angko am-ara maini gimin? Angni Paani noko anga dongna nanga ine uijama?\n\nD. Indiba Uni uamangna aganani katako uamang uijaha.\nJ. Unikoa Ua uamang baksa Nazarethona ong-onangaha, aro uamangko manie dongaha.\n\nD. Aro Uni margipa ia pilak katakon gisiktango rakiaha.\nJ. Aro Jisu uianio aro bilsio, aro Una Isolni aro mandeni ka saao batroroaha.\n\nD. Jisuni chisolni sepango Uni margipa, aro margipani abitang, Klopasni Mariam, aro Magdalene Mariam chadengengachim.\nJ. Uni gimin Jisu an-tang ma-gipako aro sepango chadenggipa jena ka'sara ua sninggipako nike, ma-gipako aganaha, O Me-chik, nibo, nang-ni depante.\n\nD. Unikoa ua sninggipakoba aganaha, Nibo, nang-ni ma-gipa. J. Unon ua sal intaltal ua sninggipa uko an-tang nokona rim-angaha.",
  'number' : 23},
  {'title' : 'STEWARDSHIP',
  'body' : "Dilgipa: Aro an-chingna on-a ka saa gita dingtang dingtang ka sae on anirangko man'e, ua katchinike aganani ong-ode, an-chingni bebera-ani gitan aganchina;\nJinma: Dangdike on ani ong-ode, dangdike on ao dongna;\n\nD. Skigipa ong-ode, ua skie on ao dongchina;\nJ. Mol-molgipa ong-ode, mol-mole on-ao dongchina. \n\nD. On-gipa gisik sronge on-china; pamong ong-gipa bimchipe dakchina;\nJ. Ka-sachakako mesokgipa katchae dakchina. Ka-saa cha-chipilgija ong-china.\n\nD. Bang'gija dake satgipa bang-gija dake ragen, aro patia gita satgipa patia gita ragen.\nJ. Jajrenga gita, ba nanga gita ong-gija, sakanti ka-tongtango mangsonga gita on-china; maina Isol ka-sroke on-gipana ka-sara.\n\nD. Aro bebera-gipa jinma gisiksan aro janggisanchim, aro saksaba gamtangko angni ine injachim; indiba uamang pilakkon dondimachim. \nJ. Aro Watatarang, Gitel Jisuni. chakatpilanini gimin, bilake saki on-aha; aro uamang pilakni kosako namen ka-sara gnangchim.\n\nD. Maina uamango chuonggijagipa grichim: maina ararang ba nokrang gnanggiparang pilakan marangko pale palani damrangko ra-bae Watatarangni jarao donachim.\nJ. Aro nanga gita sakantina suale on-achim.",
  'number' : 24},
  {'title' : 'DISCIPLESHIP',
  'body' : "Dilgipa: Aro uamang rama re-angmitingo saksa mande uko inaha, Nara je jeona re-gen, unonan anga Nang baksa re-pagen.\nJinma: Unon Jisu una aganaha, Perurangni a-kol gnang; aro sakoni do-drangni turam gnang. indiba Mandeni Depanteni skotangko donchakna biap gri.\n\nD. Aro Ua sakgipinko inaha. Ang baksa re-bapabo. Indiba ua inaha, O Gitel, skang angni paako gopna re-angna watbo.\nJ. Indiba ua uko aganaha, Sigiminrang an-tangtang sigiminko gopchina; na-ade re-ange Isolni songnokko aganprakebo.\n\nD. Aro sakgipin aganaha, Anga nang baksa re-pagen, Gitel; indiba skang angni noko donggiparangna mikkang pa-na watatbo.\nJ. Indiba Jisu una aganaha, Nanggrio jakrime janggilchiniko nipilgipa pilakba Isolni Songnokna kraja.\n\nD. Angna bate mara paana ka-sagipa Angna kraja, aro Angna bate depante demechikna ka-sagipa Angna kraja.\nJ. Aro an-tang chisolko rare Angni ja-man re-pagijagipa Angna kraja.\n\nD. Janggitangko ripinggipa uko gimaatgen; aro Angni gimin janggitangko gimaatgipa uko ripinggen.\nJ. Saoba Angni ja-man re-bana skode, ua an-tangko jechina, aro an-tang chisolko ripee Ang baksa re-bapachina.",
  'number' : 25},];
